    'Cereal flours other than of wheat or meslin' => 'Plúir gránaigh seachas plúr cruithneachta agus plúr maislín',
    'Cereal groats, meal and pellets' => 'Piocuaran, min agus millíní ó ghránaigh',
    'Cereal grains otherwise worked (for example, hulled, rolled, flaked, pearled, sliced or kibbled), except rice of heading 1006; germ of cereals, whole, rolled, flaked or ground' => 'Gráinní gránach atá oibrithe ar bhealach eile (mar shampla, iad scilligthe nó rollta, calóga nó péarlaí déanta díobh, nó iad slisnithe nó garbhmheilte), seachas rís atá faoi cheannteideal 1006; ginidíní gránach, iad iomlán, rollta, calógach nó meilte',
