    'Hop cones, fresh or dried, whether or not ground, powdered or in the form of pellets; lupulin' => 'Buaircíní leannlusanna, iad úr nó triomaithe, bídís meilte, púdraithe nó i bhfoirm millíní nó ná bídís; lúpailin',
    'Plants and parts of plants (including seeds and fruits), of a kind used primarily in perfumery, in pharmacy or for insecticidal, fungicidal or similar purposes, fresh, chilled, frozen or dried, whether or not cut, crushed or powdered' => 'Plandaí agus codanna de phlandaí (lena n-áirítear síolta agus torthaí) de chineál a úsáidtear go príomha i gcumhradóireacht, i gcógaisíocht nó le haghaidh feithidicídí, fuingicídí nó úsáidí comhchosúla, iad úr, fuaraithe, reoite nó triomaithe, bídís gearrtha, brúite nó púdraithe nó ná bídís',
    'Locust beans, seaweeds and other algae, sugar beet and sugar cane, fresh, chilled, frozen or dried, whether or not ground; fruit stones and kernels and other vegetable products (including unroasted chicory roots of the variety Cichorium intybus sativum) of a kind used primarily for human consumption, not elsewhere specified or included' => 'Pónairí lócaiste, feamainn agus algaí eile, biatas siúcra agus cána siúcra, iad úr, fuaraithe, reoite nó triomaithe, bídís meilte nó ná bídís; clocha agus eithní torthaí agus táirgí plandúla eile (lena n-áirítear fréamhacha siocaire neamhrósta den chineál Cichorium intybus sativum) de chineál a úsáidtear go príomha lena gcaitheamh ag an duine, nach sonraítear ná nach n-áirítear in aon áit eile',
    'Swedes, mangolds, fodder roots, hay, lucerne (alfalfa), clover, sainfoin, forage kale, lupines, vetches and similar forage products, whether or not in the form of pellets' => 'Svaeideanna, meaingil, fréamhacha farae, féar tirim, meidic na mbó (alfalfa), seamair, coirm choiligh, cál foráiste, lúipíní, peasairí agus táirgí foráiste comhchosúla, bídísi bhfoirm millíní nó ná bídís',
    'Lac; natural gums, resins, gum-resins and oleoresins (for example, balsams)' => 'Leaic; gumaí nádúrtha, roisíní nádúrtha, gumroisíní nádúrtha agus olaroisíní nádúrtha (balsaim, mar shampla)',
    'Vegetable saps and extracts; pectic substances, pectinates and pectates; agar-agar and other mucilages and thickeners, whether or not modified, derived from vegetable products' => 'Súnna glasraí agus úisc phlandúla; substaintí peicteacha, peicteanáití agus peicteáití; agar agus gumalachtaí agus tiúsóirí eile, bídís modhnaithe nó ná bídís, a fhaightear ó tháirgí plandúla',
    'Vegetable materials of a kind used primarily for plaiting (for example, bamboos, rattans, reeds, rushes, osier, raffia, cleaned, bleached or dyed cereal straw, and lime bark)' => 'Ábhair phlandúla de chineál a úsáidtear go príomha le haghaidh trilseánú, (mar shampla, bambúnna, ratáin, giolcach, luachair, saileánaigh, raifia, grántuí atá glanta, tuartha nó daite, agus coirt teile)',
    'Vegetable products not elsewhere specified or included' => 'Táirgí plandúla nach bhfuil sonraithe ná áirithe in áit eile',
    'Pig fat (including lard) and poultry fat, other than that of heading 0209 or 1503' => 'Saill muice (lena n-áirítear blonag) agus saill éanlaithe clóis, seachas saill atá faoi cheannteidil 0209 nó 1503',
    'Fats of bovine animals, sheep or goats, other than those of heading 1503' => 'Saill ó bhó-ainmhithe, ó chaoirigh nó ó ghabhair, seachas iad siúd atá faoi cheannteideal 1503',
    'Lard stearin, lard oil, oleostearin, oleo-oil and tallow oil, not emulsified or mixed or otherwise prepared' => 'Stéirin blonaige, ola bhlonaige, oiléistéirin, ola-oilé agus ola gheire, nach bhfuil eiblithe, measctha ná ullmhaithe ar bhealach eile',
    'Fats and oils and their fractions, of fish or marine mammals, whether or not refined, but not chemically modified' => 'Saillte agus olaí agus a gcodáin, ó éisc nó ó mhamaigh farraige, bídís scagtha nó ná bídís, ach nach bhfuil modhnaithe go ceimiceach',
    'Wool grease and fatty substances derived therefrom (including lanolin)' => 'Sail caorach agus substaintí sailleacha a fhaightear uaithi (úsc olla san áireamh)',
    'Soya-bean oil and its fractions, whether or not refined, but not chemically modified' => 'Ola pónaire soighe agus a codáin, bídís scagtha nó ná bídís, ach nach bhfuil modhnaithe go ceimiceach',
    'Groundnut oil and its fractions, whether or not refined, but not chemically modified' => 'Ola pise talún agus a codáin, bídís scagtha nó ná bídís, ach nach bhfuil modhnaithe go ceimiceach',
    'Olive oil and its fractions, whether or not refined, but not chemically modified' => 'Ola olóige agus a codáin, bídís scagtha nó ná bídís, ach nach bhfuil modhnaithe go ceimiceach',
    'Other oils and their fractions, obtained solely from olives, whether or not refined, but not chemically modified, including blends of these oils or fractions with oils or fractions of heading 1509' => 'Olaí eile agus a gcodáin, a fhaightear ó ológa amháin, bídís scagtha nó ná bídís, ach nach bhfuil modhnaithe go ceimiceach, lena n-áirítear cumaisc de na holaí nó de na codáin sin le holaí nó le codáin faoi cheannteideal 1509',
    'Palm oil and its fractions, whether or not refined, but not chemically modified' => 'Ola pailme agus a codáin, bídís scagtha nó ná bídís, ach nach bhfuil modhnaithe go ceimiceach',
    'Sunflower-seed, safflower or cotton-seed oil and fractions thereof, whether or not refined, but not chemically modified' => 'Ola lus na gréine, ola cróch bréige nó ola síl cadáis agus a gcodáin, bídís scagtha nó ná bídís, ach nach bhfuil modhnaithe go ceimiceach',
    'Coconut (copra), palm kernel or babassu oil and fractions thereof, whether or not refined, but not chemically modified' => 'Ola cnó cócó (ola copra), ola eithne pailme nó ola bhabasú agus a gcodáin, bídís scagtha nó ná bídís, ach nach bhfuil modhnaithe go ceimiceach',
    'Rape, colza or mustard oil and fractions thereof, whether or not refined, but not chemically modified' => 'Ola ráibe, ola cholsa nó ola mhustaird agus a gcodáin, bídís scagtha nó ná bídís, ach nach bhfuil modhnaithe go ceimiceach',
    'Other fixed vegetable or microbial fats and oils (including jojoba oil) and their fractions, whether or not refined, but not chemically modified' => 'Saillte agus olaí plandúla miocróbacha do-ghalaithe eile (lena n-áirítear ola hahóba) agus a gcodáin, bídís scagtha nó ná bídís, ach nach bhfuil modhnaithe go ceimiceach',
    'Animal, vegetable or microbial fats and oils and their fractions, partly or wholly hydrogenated, inter-esterified, re-esterified or elaidinised, whether or not refined, but not further prepared' => 'Saillte agus olaí ainmhíocha, plandúla nó miocróbacha, agus a gcodáin, iad hidriginithe, idireistearaithe, atheistearaithe nó eilídinithe, go páirteach nó go hiomlán, bídís scagtha nó ná bídís, ach gan ullmhú thairis sin orthu',
    'Margarine; edible mixtures or preparations of animal, vegetable or microbial fats or oils or of fractions of different fats or oils of this chapter, other than edible fats or oils or their fractions of heading 1516' => 'Margairín; meascáin nó ullmhóidí inite de shaillte ainmhíocha, plandúla nó miocróbacha, nó d’olaí ainmhíocha, plandúla nó miocróbacha, nó de chodáin de shaillte nó d’olaí éagsúla atá faoin gCaibidil seo, seachas na saillte nó na holaí inite nó a gcodáin atá faoi cheannteideal 1516',
