    'Vegetable waxes (other than triglycerides), beeswax, other insect waxes and spermaceti, whether or not refined or coloured' => 'Céaracha plandúla (seachas tríghlicrídí), céir beach, céaracha feithidí eile agus spermaceti, bídís scagtha nó daite nó ná bídís',
    'Degras; residues resulting from the treatment of fatty substances or animal or vegetable waxes' => 'Déigreas; iarmhair a thagann ó chóireáil substaintí sailleacha nó céaracha ainmhíocha nó plandúla',
    'Sausages and similar products, of meat, meat offal, blood or insects; food preparations based on these products' => 'Ispíní agus táirgí comhchosúla, ó fheoil, scairteach feola, fuil nó feithidí; ullmhóidí bia atá bunaithe ar na táirgí sin',
    'Other prepared or preserved meat, meat offal, blood or insects' => 'Feoil, scairteach feola, fuil nó feithidí eile, iad ullmhaithe nó leasaithe',
    'Extracts and juices of meat, fish or crustaceans, molluscs or other aquatic invertebrates' => 'Úisc agus súnna ó fheoil, ó éisc nó ó chrústaigh, ó mhoilisc nó ó inveirteabraigh eile uisce',
