    'Other sugars, including chemically pure lactose, maltose, glucose and fructose, in solid form; sugar syrups not containing added flavouring or colouring matter; artificial honey, whether or not mixed with natural honey; caramel' => 'Siúcraí eile, lena n-áirítear lachtós, maltós, glúcós agus fruchtós atá íon go ceimiceach, i bhfoirm sholadach; síoróipí siúcra nach bhfuil ábhar breise blaistithe ná dathúcháin curtha leo; mil shaorga, bíodh sí measctha le mil nádúrtha nó ná bíodh; caramal',
    'Molasses resulting from the extraction or refining of sugar' => 'Molás a thagann ó úscadh nó ó scagadh siúcra',
