    'Pasta, whether or not cooked or stuffed (with meat or other substances) or otherwise prepared, such as spaghetti, macaroni, noodles, lasagne, gnocchi, ravioli, cannelloni; couscous, whether or not prepared' => 'Pasta, bíodh sé cócaráilte nó líonta le búiste (feola nó substaintí eile) nó ná bíodh, nó ullmhaithe ar bhealach eile, amhail spaigití, macarón, núdail, lasáinne, gnocchi, raiviólaí, canalóiní; cúscús, bíodh sé ullmhaithe nó ná bíodh',
    'Prepared foods obtained by the swelling or roasting of cereals or cereal products (for example, corn flakes); cereals (other than maize (corn)) in grain form or in the form of flakes or other worked grains (except flour, groats and meal), pre-cooked or otherwise prepared, not elsewhere specified or included' => 'Bianna ullmhaithe a fhaightear trí ghránaigh nó trí tháirgí gránacha a shéideadh nó a róstadh (calóga arbhair, mar shampla); gránaigh (seachas arbhar Indiach) i bhfoirm gránach nó i bhfoirm calóg nó gránach oibrithe eile (seachasplúr, piocuaran agus min), iad réamhchócaráilte nó ullmhaithe ar bhealach eile, nach bhfuil sonraithe ná áirithe in áit eile',
    'Bread, pastry, cakes, biscuits and other bakers\' wares, whether or not containing cocoa; communion wafers, empty cachets of a kind suitable for pharmaceutical use, sealing wafers, rice paper and similar products' => 'Arán, taosrán, cácaí, brioscaí agus táirgí eile báicéirí, bíodh cócó iontu nó ná bíodh; abhlanna, capsúil fholmha de chineál atá oiriúnach d’úsáid chógaisíochta, sliseoga séalaithe, ríspháipéar agus táirgí comhchosúla',
    'Vegetables, fruit, nuts and other edible parts of plants, prepared or preserved by vinegar or acetic acid' => 'Glasraí, torthaí, cnónna agus codanna inite eile de phlandaí, iad ullmhaithe nó leasaithe le fínéagar nó le haigéad aicéiteach',
    'Tomatoes prepared or preserved otherwise than by vinegar or acetic acid' => 'Trátaí ullmhaithe nó leasaithe ar bhealach eile seachas le fínéagar nó le haigéad aicéiteach',
    'Mushrooms and truffles, prepared or preserved otherwise than by vinegar or acetic acid' => 'Beacáin agus strufail, iad ullmhaithe nó leasaithe seachas le fínéagar nó le haigéad aicéiteach',
