    'Other vegetables prepared or preserved otherwise than by vinegar or acetic acid, not frozen, other than products of heading 2006' => 'Glasraí eile ullmhaithe nó leasaithe seachas le fínéagar nó le haigéad aicéiteach, gan bheith reoite, seachas táirgí atá faoi cheannteideal 2006',
    'Vegetables, fruit, nuts, fruit-peel and other parts of plants, preserved by sugar (drained, glacé or crystallised)' => 'Glasraí, torthaí, cnónna, craiceann torthaí agus codanna eile de phlandaí, iad leasaithe le siúcra (draenáilte, glacé nó criostalaithe)',
    'Jams, fruit jellies, marmalades, fruit or nut purée and fruit or nut pastes, obtained by cooking, whether or not containing added sugar or other sweetening matter' => 'Subha, glóthacha torthaí, marmaláidí, purée torthaí nó cnónna agus leafaois torthaí nó cnónna, a fhaightear trí chócaráil, bíodh siúcra breise nó ábhar milsiúcháin breise eile curtha leo nó ná bíodh',
    'Fruit, nuts and other edible parts of plants, otherwise prepared or preserved, whether or not containing added sugar or other sweetening matter or spirit, not elsewhere specified or included' => 'Torthaí, cnónna agus codanna inite eile de phlandaí, iad ullmhaithe nó leasaithe ar bhealach eile, bíodh siúcra breise nó ábhar milsiúcháin breise eile nó biotáille bhreise curtha leo nó ná bíodh, nach bhfuil sonraithe ná áirithe in áit eile',
    'Fruit or nut juices (including grape must and coconut water) and vegetable juices, unfermented and not containing added spirit, whether or not containing added sugar or other sweetening matter' => 'Súnna torthaí nó cnónna (lena n-áirítear úrfhíon fíonchaor agus uisce cnó cócó) agus súnna glasraí, neamhchoipthe agus nach bhfuil biotáille bhreise curtha leo, bíodh siúcra breise nó ábhar milsiúcháin breise curtha leo nó ná bíodh',
    'Extracts, essences and concentrates, of coffee, tea or maté and preparations with a basis of these products or with a basis of coffee, tea or maté; roasted chicory and other roasted coffee substitutes, and extracts, essences and concentrates thereof' => 'Eastóscáin, úscraí agus tiúcháin, de chaife, de thae nó de mhaité agus ullmhóidí de bhunús na dtáirgí sin nó de bhunús caife, tae nó maité; siocaire rósta agus ionadaigh rósta eile caife, agus úisc, úscraí agus tiúcháin díobh',
    'Yeasts (active or inactive); other single-cell micro-organisms, dead (but not including vaccines of heading 3002); prepared baking powders' => 'Giostaí (gníomhacha nó neamhghníomhacha); miocrorgánaigh aoncheallacha eile, marbh (gan vacsaíní atá faoi cheannteideal 3002 san áireamh); púdair bhácála ullmhaithe',
    'Sauces and preparations therefor; mixed condiments and mixed seasonings; mustard flour and meal and prepared mustard' => 'anlainn agus ullmhóidí lena n-aghaidh; tarsainn mheasctha agus blastanais mheasctha; plúr mustaird agus min mhustaird agus mustard ullmhaithe',
    'Soups and broths and preparations therefor; homogenised composite food preparations' => 'Anraithí agus bratanna agus ullmhóidí lena n-aghaidh; ullmhóidí cumaisc homaiginithe bia',
    'Ice cream and other edible ice, whether or not containing cocoa' => 'Uachtar reoite agus oighear inite eile, bíodh cócó iontu nó ná bíodh',
    'Food preparations not elsewhere specified or included' => 'Ullmhóidí bia nach bhfuil sonraithe ná áirithe in áit eile',
    'Waters, including natural or artificial mineral waters and aerated waters, not containing added sugar or other sweetening matter nor flavoured; ice and snow' => 'Uiscí, lena n-áirítear uiscí mianraí nádúrtha nó saorga agus uiscí aeraithe, nach bhfuil siúcra breise ná ábhar milsiúcháin eile curtha leo ná nach bhfuil blaistithe; oighear agus sneachta',
    'Waters, including mineral waters and aerated waters, containing added sugar or other sweetening matter or flavoured, and other non-alcoholic beverages, not including fruit, nut or vegetable juices of heading 2009' => 'Uiscí, lena n-áirítear uiscí mianracha agus uiscí aeraithe, a bhfuil siúcra breise nó ábhar milsithe eile curtha leo nó atá blaistithe, agus deochanna neamhalcólacha eile, seachas súnna torthaí nó glasraí atá faoi cheannteideal 2009',
    'Beer made from malt' => 'Beoir atá déanta as braich',
    'Wine of fresh grapes, including fortified wines; grape must other than that of heading 2009' => 'Fíon ó fhíonchaora úra, lena n-áirítear fíonta treisithe; úrfhíon fíonchaor seachas é sin atá faoi cheannteideal 2009',
    'Vermouth and other wine of fresh grapes flavoured with plants or aromatic substances' => 'Fíonta mormónta agus fíonta eile ó fhíonchaora úra atá blaistithe le plandaí nó le substaintí aramatacha',
    'Other fermented beverages (for example, cider, perry, mead, saké); mixtures of fermented beverages and mixtures of fermented beverages and non-alcoholic beverages, not elsewhere specified or included' => 'Deochanna coipthe eile (mar shampla, ceirtlis, leann piorraí, meá, sáicí); meascáin de dheochanna coipthe agus meascáin de dheochanna coipthe agus deochanna neamh-mheisciúla, nach bhfuil sonraithe ná áirithe in áit eile',
    'Undenatured ethyl alcohol of an alcoholic strength by volume of 80 % vol or higher; ethyl alcohol and other spirits, denatured, of any strength' => 'Alcól eitile gan dínádúrú ar 80 % nó níos mó a neart alcóil de réir toirte; alcól eitile agus biotáillí eile, iad dínádúraithe, d’aon neart',
    'Undenatured ethyl alcohol of an alcoholic strength by volume of less than 80 % vol; spirits, liqueurs and other spirituous beverages' => 'Alcól eitile gan dínádúrú ar lú ná 80 % a neart alcóil de réir toirte; biotáillí, licéir agus deochanna biotáilleacha eile',
    'Vinegar and substitutes for vinegar obtained from acetic acid' => 'Fínéagar agus ionadaigh fínéagair a fhaightear as aigéad aicéiteach',
