    'Carbides, whether or not chemically defined' => 'Cairbídí, bídís sainithe ó thaobh ceimice nó ná bídís',
    'Inorganic or organic compounds of mercury, whether or not chemically defined, excluding amalgams' => 'Comhdhúile orgánacha nó neamhorgánacha as mearcair, bídís sainithe ó thaobh ceimice nó ná bídís, seachas malgaim',
    'Phosphides, whether or not chemically defined, excluding ferrophosphorus; other inorganic compounds (including distilled or conductivity water and water of similar purity); liquid air (whether or not rare gases have been removed); compressed air; amalgams, other than amalgams of precious metals' => 'Foisfidí, bídís sainithe ó thaobh ceimice nó ná bídís, seachas fearófosfar; comhdhúile neamhorgánacha eile (lena n-áirítear uisce driogtha nó uisce seoltachta agus uisce d’íonacht chomhchosúil); aer leachtach (bíodh triathgháis bainte as nó ná bíodh); aer comhbhrúite; malgaim, seachas malgaim as miotail lómhara',
    'Acyclic hydrocarbons' => 'Hidreacarbóin neamhchioglacha',
    'Cyclic hydrocarbons' => 'Hidreacarbóin chioglacha',
    'Halogenated derivatives of hydrocarbons' => 'Díorthaigh halaiginithe hidreacarbón',
    'Sulphonated, nitrated or nitrosated derivatives of hydrocarbons, whether or not halogenated' => 'Díorthaigh shulfónaithe, níotráitithe nó níotrasaithe de hidreacarbóin, bídís halaiginithe nó ná bídís',
    'Acyclic alcohols and their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Alcóil neamhchioglacha agus a ndíorthaigh halaiginithe, sulfónaithe, níotráitithe nó níotrósaithe',
    'Cyclic alcohols and their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Alcóil chioglacha agus a ndíorthaigh halaiginithe, sulfónaithe, níotráitithe nó níotrósaithe',
    'Phenols; phenol-alcohols' => 'Feanóil; fenól­alcóil',
    'Halogenated, sulphonated, nitrated or nitrosated derivatives of phenols or phenol-alcohols' => 'Díorthaigh halaiginithe, shulfónaithe, níotráitithe nó níotrósaithe d\'fheanóil nó d\'fheanól-alcóil',
    'Ethers, ether-alcohols, ether-phenols, ether-alcohol-phenols, alcohol peroxides, ether peroxides, acetal and hemiacetal peroxides, ketone peroxides (whether or not chemically defined), and their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Éitir, éitear-alcóil, éitear-feanóil, éitear-alcól-feanóil, sárocsaídí alcóil, sárocsaídí éitir, sárocsaídí aicéatail agus sárocsaídí leathaicéatail, sárocsaídí céatóin (bídís sainithe ó thaobh ceimice nó ná bídís), agus a ndíorthaigh halaiginithe, sulfónaithe, níotráitithe nó níotrósaithe',
    'Epoxides, epoxyalcohols, epoxyphenols and epoxyethers, with a three-membered ring, and their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Eapocsaídí, eapocsa-alcóil, eapocsaifeanóil agus eapocsai-éitir, ag a bhfuil fáinne tríbhallach, agus a ndíorthaigh halaiginithe, sulfónaithe, níotráitithe nó níotrósaithe',
    'Aldehydes, whether or not with other oxygen function; cyclic polymers of aldehydes; paraformaldehyde' => 'Aildéid, bíodh feidhm ocsaigine acu nó ná bíodh; polaiméirí cioglacha d’aildéid; paraformaildéad',
    'Ketones and quinones, whether or not with other oxygen function, and their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Céatóin agus cuineoin, bíodh feidhm ocsaigine eile acu nó ná bíodh, agus a ndíorthaigh halaiginithe, sulfónaithe, níotráitithe nó níotrósaithe',
    'Saturated acyclic monocarboxylic acids and their anhydrides, halides, peroxides and peroxyacids; their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Aigéid mhonacarbocsaileacha neamhchioglacha sháithithe agus a n-ainhidrídí, a hailídí, a sárocsaídí agus a sárocsa-aigéid; a ndíorthaigh halaiginithe, sulfónaithe, níotráitithe nó níotrósaithe',
    'Unsaturated acyclic monocarboxylic acids, cyclic monocarboxylic acids, their anhydrides, halides, peroxides and peroxyacids; their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Aigéid mhonacarbocsaileacha neamhchioglacha neamhsháithithe, aigéid mhonacarbocsaileacha chioglacha, a n­ainhidrídí, a hailídí, a sárocsaídí agus a sárocsa-aigéid; a ndíorthaigh halaiginithe, sulfónaithe, níotráitithe nó níotrósaithe',
    'Polycarboxylic acids, their anhydrides, halides, peroxides and peroxyacids; their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Aigéid pholacarbocsaileacha, a n­ainhidrídí, a hailídí, a sárocsaídí agus a sárocsa-aigéid; a ndíorthaigh halaiginithe, sulfónaithe, níotráitithe nó níotrósaithe',
    'Carboxylic acids with additional oxygen function and their anhydrides, halides, peroxides and peroxyacids; their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Aigéid mhonacarbocsaileacha ag a bhfuil feidhm bhreise ocsaigine agus a n-ainhidrídí, a hailídí, a sárocsaídí agus a sárocsa-aigéid; a ndíorthaigh halaiginithe, sulfónaithe, níotráitithe nó níotrósaithe',
    'Phosphoric esters and their salts, including lactophosphates; their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Eistir fhosfaracha agus a salaInn, lena n­áirítear lachtafosfáití; a ndíorthaigh halaiginithe, sulfónaithe, níotráitithe nó níotrósaithe',
    'Esters of other inorganic acids of non-metals (excluding esters of hydrogen halides) and their salts; their halogenated, sulphonated, nitrated or nitrosated derivatives' => 'Eistir d\'aigéid neamhorgánacha eile de neamh­mhiotail (seachas eistir de hailídí hidrigine) agus a salainn; a ndíorthaigh halaiginithe, sulfónaithe, níotráitithe nó níotrósaithe',
    'Amine-function compounds' => 'Comhdhúile feidhme aimín',
    'Oxygen-function amino-compounds' => 'Comhdhúile aimín le feidhm ocsaigine',
    'Quaternary ammonium salts and hydroxides; lecithins and other phosphoaminolipids, whether or not chemically defined' => 'Salainn agus hiodrocsaídí ceathartha amóiniam; leicitin agus fosfa-aimínilipidí eile, bídís sainithe ó thaobh ceimice nó ná bídís',
    'Carboxyamide-function compounds; amide-function compounds of carbonic acid' => 'Comhdhúile feidhme carbocsa-aimíde; comhdhúile feidhme aimíde d\'aigéad carbónach',
    'Carboxyimide-function compounds (including saccharin and its salts) and imine-function compounds' => 'Comhdhúile feidhme carbocsa-imíde (lena n­áirítear siúicrín agus a shalainn) agus comhdhúile feidhme imín',
    'Nitrile-function compounds' => 'Comhdhúile feidhme nítríle',
    'Compounds with other nitrogen function' => 'Comhdhúile le feidhmeanna eile nitrigine',
    'Organo-sulphur compounds' => 'Comhdhúile orgánasulfair',
    'Other organo-inorganic compounds' => 'Comhdhúile orgána-neamhorgánacha eile',
    'Heterocyclic compounds with oxygen hetero-atom(s) only' => 'Comhdhúile heitreachioglacha nach bhfuil acu ach heitrea-adamh/adaimh ocsaigine',
    'Heterocyclic compounds with nitrogen hetero-atom(s) only' => 'Comhdhúile heitreachioglacha a bhfuil heitrea-adamh/adaimh nitrigine iontu amháin',
    'Nucleic acids and their salts, whether or not chemically defined; other heterocyclic compounds' => 'Aigéid núicléasacha agus a salainn, bídís sainithe ó thaobh ceimice nó ná bídís; comhdhúile eile heitreachioglacha',
    'Sulphonamides' => 'Sulfónaimídí',
    'Provitamins and vitamins, natural or reproduced by synthesis (including natural concentrates), derivatives thereof used primarily as vitamins, and intermixtures of the foregoing, whether or not in any solvent' => 'Provitimíní agus vitimíní, iad nádúrtha nó atáirgthe trí shintéis (lena n-áirítear tiúcháin nádúrtha), díorthaigh díobh a úsáidtear go príomha mar vitimíní, agus idirmheascáin díobh sin, bídís in aon tuaslagóirí nó ná bídís',
    'Hormones, prostaglandins, thromboxanes and leukotrienes, natural or reproduced by synthesis; derivatives and structural analogues thereof, including chain modified polypeptides, used primarily as hormones' => 'Hormóin, prostaglaindiní, trombocsáin agus leocaitríéiní, iad nádúrtha nó atáirgthe trí shintéis; díorthaigh agus analóga struchtúracha díobh, lena n­áirítear polaipeiptídí slabhramhodhnaithe, a úsáidtear go príomha mar hormóin',
    'Glycosides, natural or reproduced by synthesis, and their salts, ethers, esters and other derivatives' => 'Gliocóisídí, iad nádúrtha nó atáirgthe trí shintéis, agus a salainn, a n-éitir, a n-eistir agus a ndíorthaigh eile',
    'Alkaloids, natural or reproduced by synthesis, and their salts, ethers, esters and other derivatives' => 'Alcalóidigh, iad nádúrtha nó atáirgthe trí shintéis, agus a salainn, a n-éitir, a n-eistir agus a ndíorthaigh eile',
    'Antibiotics' => 'Antaibheathaigh',
    'Glands and other organs for organo-therapeutic uses, dried, whether or not powdered; extracts of glands or other organs or of their secretions for organo-therapeutic uses; heparin and its salts; other human or animal substances prepared for therapeutic or prophylactic uses, not elsewhere specified or included' => 'Faireoga agus orgáin eile chun úsáidí orgánaiteiripeacha, triomaithe, bídís púdrach nó neamhphúdrach; eastóscáin faireog nó orgán eile nó eastóscáin dá dtáil le haghaidh úsáidí orgánaiteiripeacha; heipirin agus a salainn; substaintí daonna nó ainmhíocha eile a ullmhaítear le haghaidh úsáidí teiripeacha nó próifiolacsacha, nach bhfuil sonraithe ná áirithe in áit eile',
    'Human blood; animal blood prepared for therapeutic, prophylactic or diagnostic uses; antisera, other blood fractions and immunological products, whether or not modified or obtained by means of biotechnological processes; vaccines, toxins, cultures of micro-organisms (excluding yeasts) and similar products; cell cultures, whether or not modified' => 'Fuil an duine; fuil ainmhíoch a ullmhaítear le haghaidh úsáidí teiripeacha, próifiolacsacha nó diagnóiseacha; antaiséirim, codáin fola agus táirgí imdhíoneolaíocha eile, bídís modhnaithe nó ná bídís, nó bídís faighte trí phróisis bhith-theicneolaíocha nó ná bídís; vacsaíní, tocsainí, saothráin miocrorgánach (seachas giostaí) agus táirgí comhchosúla; saothráin ceall, bídís modhnaithe nó ná bídís',
    'Medicaments (excluding goods of heading 3002, 3005 or 3006) consisting of two or more constituents which have been mixed together for therapeutic or prophylactic uses, not put up in measured doses or in forms or packings for retail sale' => 'Íoca leighis (seachas earraí atá faoi cheannteideal 3002, 3005 nó 3006) arb é atá iontu dhá chomhábhar nó níos mó a meascadh le chéile le haghaidh úsáidí teiripeacha nó próifiolacsacha, nach bhfuil cóirithe ina ndáileoga tomhaiste nó i bhfoirmeacha nó i bpacáistí lena miondíol',
    'Medicaments (excluding goods of heading 3002, 3005 or 3006) consisting of mixed or unmixed products for therapeutic or prophylactic uses, put up in measured doses (including those in the form of transdermal administration systems) or in forms or packings for retail sale' => 'Íoca leighis (seachas earraí atá faoi cheannteideal 3002, 3005 nó 3006) arb é atá iontu táirgí measctha nó táirgí neamh-mheasctha chun úsáidí teiripeacha nó próifiolacsacha, atá cóirithe ina ndáileoga tomhaiste (lena n‐áirítear iad siúd atá i bhfoirm córas riarachán trasdeirmeach) nó i bhfoirmeacha nó i bpacáistí lena miondíol',
    'Wadding, gauze, bandages and similar articles (for example, dressings, adhesive plasters, poultices), impregnated or coated with pharmaceutical substances or put up in forms or packings for retail sale for medical, surgical, dental or veterinary purposes' => 'Flocas, uige, bindealáin agus earraí comhchosúla (mar shampla, cóirithe, greimlíní, ceiríní), atá tuilithe nó brataithe le substaintí cógaisíochta nó cóirithe i bhfoirmeacha nó i bpacáistithe lena miondíol chun críoch míochaine, máinliachta, déidliachta nó tréidliachta',
    'Pharmaceutical goods specified in note 4 to this chapter' => 'Earraí cógaisíochta atá sonraithe i nóta 4 a ghabhann leis an gcaibidil seo',
    'Mineral or chemical fertilisers, nitrogenous' => 'Leasacháin mhianracha nó cheimiceacha, iad nítrigineach',
    'Mineral or chemical fertilisers, phosphatic' => 'Leasacháin mhianracha nó cheimiceacha, iad fosfáiteach',
    'Mineral or chemical fertilisers, potassic' => 'Leasacháin mhianracha nó cheimiceacha, iad potaiseach',
    'Mineral or chemical fertilisers containing two or three of the fertilising elements nitrogen, phosphorus and potassium; other fertilisers; goods of this chapter in tablets or similar forms or in packages of a gross weight not exceeding 10 kg' => 'Leasacháin mhianracha nó cheimiceacha ina bhfuil dhá cheann nó trí cinn de na dúile leasaitheacha nítrigin, fosfar agus potaisiam; leasacháin eile; earraí faoin gcaibidil seo i dtáibléid nó i bhfoirmeacha comhchosúla nó i bpacáistí nach mó ná 10 kg a n-ollmheáchan',
    'Tanning extracts of vegetable origin; tannins and their salts, ethers, esters and other derivatives' => 'Eastóscáin súdaireachta de bhunadh plandúil; tainniní agus a gcuid salann, éitir, eistir agus díorthaigh eile',
    'Synthetic organic tanning substances; inorganic tanning substances; tanning preparations, whether or not containing natural tanning substances; enzymatic preparations for pre-tanning' => 'Substaintí súdaireachta orgánacha sintéiseacha; substaintí súdaireachta neamhorgánacha; ullmhóidí súdaireachta, bíodh substaintí súdaireachta nádúrtha iontu nó ná bíodh; ullmhóidí einsímeacha le haghaidh réamhshúdaireachta',
    'Colouring matter of vegetable or animal origin (including dyeing extracts but excluding animal black), whether or not chemically defined; preparations as specified in note 3 to this chapter based on colouring matter of vegetable or animal origin' => 'Ábhair dhathúcháin de bhunadh plandúil nó ainmhíoch (lena n-áirítear eastóscáin súdaireachta ach gan dubh ainmhíoch a áireamh), bídís sainithe ó thaobh ceimice nó ná bídís; ullmhóidí mar a shonraítear i nóta 3 a ghabhann leis an gcaibidil seo atá bunaithe ar ábhar dathúcháin de bhunadh plandúil nó ainmhíoch',
    'Synthetic organic colouring matter, whether or not chemically defined; preparations as specified in note 3 to this chapter based on synthetic organic colouring matter; synthetic organic products of a kind used as fluorescent brightening agents or as luminophores, whether or not chemically defined' => 'Ábhair dhathúcháin orgánacha shintéiseacha, bídís sainithe ó thaobh ceimice nó ná bídís; ullmhóidí mar a shonraítear i nóta 3 a ghabhann leis an gcaibidil seo agus atá bunaithe ar ábhair dhathúcháin orgánacha shintéiseacha; táirgí orgánacha sintéiseacha de chineál a úsáidtear mar oibreáin ghealaithe fhluaraiseacha nó mar lúmanafóirbídís sainithe ó thaobh ceimice nó ná bídís',
    'Other colouring matter; preparations as specified in note 3 to this chapter, other than those of heading 3203, 3204 or 3205; inorganic products of a kind used as luminophores, whether or not chemically defined' => 'Ábhair dhathúcháin eile; ullmhóidí mar a shonraítear i nóta 3 a ghabhann leis an gcaibidil seo, seachas iad siúd atá faoi cheannteideal 3203, 3204 nó 3205; táirgí neamhorgánacha de chineál a úsáidtear mar lúmanafóir, bídís sainithe ó thaobh ceimice de nó ná bídís',
    'Prepared pigments, prepared opacifiers and prepared colours, vitrifiable enamels and glazes, engobes (slips), liquid lustres and similar preparations, of a kind used in the ceramic, enamelling or glass industry; glass frit and other glass, in the form of powder, granules or flakes' => 'Líocha ullmhaithe, teimhneoirí ullmhaithe agus dathanna ullmhaithe, cruain agus glónraí inghloinithe, eingeobanna (brait chríche), lonruithe leachtacha agus ullmhóidí comhchosúla, den chineál a úsáidtear sa tionscal ceirmeach, cruanta nó gloine; friochtachán gloine, i bhfoirm púdair, gráinníní nó calóg',
    'Paints and varnishes (including enamels and lacquers) based on synthetic polymers or chemically modified natural polymers, dispersed or dissolved in a non-aqueous medium; solutions as defined in note 4 to this chapter' => 'Péinteanna agus vearnaisí (lena n-áirítear cruain agus laicir) atá bunaithe ar pholaiméirí sintéiseacha nó polaiméirí nádúrtha atá modhnaithe ó thaobh ceimice de, iad easraithe nó tuaslagtha i meán neamh-uisceach; tuaslagáin mar a shainmhínítear i nóta 4 a ghabhann leis an gcaibidil seo',
    'Paints and varnishes (including enamels and lacquers) based on synthetic polymers or chemically modified natural polymers, dispersed or dissolved in an aqueous medium' => 'Péinteanna agus vearnaisí (lena n-áirítear cruain agus laicir) atá bunaithe ar pholaiméirí sintéiseacha nó polaiméirí nádúrtha atá modhnaithe ó thaobh ceimice de, iad easraithe nó tuaslagtha i meán uiscí',
    'Other paints and varnishes (including enamels, lacquers and distempers); prepared water pigments of a kind used for finishing leather' => 'Péinteanna agus vearnaisí eile (lena n-áirítear cruain, laicir agus leamhaol); líocha uisce ullmhaithe de chineál a úsáidtear chun leathar a bhailchríochnú',
    'Pigments (including metallic powders and flakes) dispersed in non-aqueous media, in liquid or paste form, of a kind used in the manufacture of paints (including enamels); stamping foils; dyes and other colouring matter put up in forms or packings for retail sale' => 'Líocha (lena n-áirítear púdair mhiotalacha agus calóga miotalacha), iad easraithe i meán nach meán uiscí é, i bhfoirm leachtach nó taois, de chineál a úsáidtear i monarú péinteanna (cruain san áireamh); scragaill stampála; ruaimeanna agus ábhair dhathúcháin eile atá cóirithe i bhfoirmeacha nó i bpacáistí lena miondíol',
    'Artists\', students\' or signboard painters\' colours, modifying tints, amusement colours and the like, in tablets, tubes, jars, bottles, pans or in similar forms or packings' => 'Dathanna ealaíontóirí, mac léinn nó péintéirí clár, imireacha chun modhnaithe, dathanna spraoi agus a leithéidí, i dtáibléid, i bhfeadáin, i gcrúscaí, i mbuidéil, i bpannaí nó i bhfoirmeacha nó i bpacáistí dá samhail',
    'Glaziers\' putty, grafting putty, resin cements, caulking compounds and other mastics; painters\' fillings; non-refractory surfacing preparations for façades, indoor walls, floors, ceilings or the like' => 'Puití gloineadóra, puití beangúcháin, stroighin roisíneach, comhdhúile calctha agus maisteoga eile; líonta péintéirí; ullmhóidí neamh-theasfhulangacha le haghaidh dromchlú aghaidheanna, ballaí faoi dhíon, urlár, síleálacha nó a leithéidí',
    'Printing ink, writing or drawing ink and other inks, whether or not concentrated or solid' => 'Dúch priontála, dúch scríbhneoireachta nó líníochta agus dúigh eile, bídís dlúth nó soladach nó ná bídís',
    'Essential oils (terpeneless or not), including concretes and absolutes; resinoids; extracted oleoresins; concentrates of essential oils in fats, in fixed oils, in waxes or the like, obtained by enfleurage or maceration; terpenic by-products of the deterpenation of essential oils; aqueous distillates and aqueous solutions of essential oils' => 'Blátholaí (bídís neamhtheirpéineach nó ná bídís), lena n-áirítear concréití agus absalóidí; roisíneoidí; oiléaroisíní eastósctha; tiúcháin bhlátholaí i saillte, in olaí fosaithe, i gcéaracha nó a leithéidí, a fhaightear trí ionbhláthú nó trí mhaothú; fotháirgí teirpéineacha ó dhítheirpéiniúblátholaí; driogáití uiscí agus tuaslagáin uiscí blátholaí',
    'Mixtures of odoriferous substances and mixtures (including alcoholic solutions) with a basis of one or more of these substances, of a kind used as raw materials in industry; other preparations based on odoriferous substances, of a kind used for the manufacture of beverages' => 'Meascáin de shubstaintí cumhra agus meascáin (lena n-áirítear tuaslagáin alcóil) de bhunús ceann amháin nó níos mó de na substaintí sin, de chineál a úsáidtear mar amhábhair sa tionsclaíocht; ullmhóidí eile atá bunaithe ar shubstaintí cumhra, de chineál a úsáidtear chun deochanna a mhonarú',
    'Perfumes and toilet waters' => 'Cumhráin agus uiscí maisíochta',
    'Beauty or make-up preparations and preparations for the care of the skin (other than medicaments), including sunscreen or suntan preparations; manicure or pedicure preparations' => 'Ullmhóidí áilleachta nó smididh agus ullmhóidí cúraim craicinn (seachas íoca leighis), lena n-áirítear sciath ghréine nó ullmhóidí gréine; ullmhóidí lámh-mhaisithe nó cosmhaisithe',
    'Preparations for use on the hair' => 'Ullmhóidí lena n-úsáid ar an ngruaig',
    'Preparations for oral or dental hygiene, including denture fixative pastes and powders; yarn used to clean between the teeth (dental floss), in individual retail packages' => 'Ullmhóidí le haghaidh sláinteachas béil nó fiacla, lena n-áirítear leafaois agus púdair ghreamaitheacha; abhras a úsáidtear chun an chuid idir na fiacla a ghlanadh (flas fiacla), i bpacáistí miondíola aonair',
    'Pre-shave, shaving or aftershave preparations, personal deodorants, bath preparations, depilatories and other perfumery, cosmetic or toilet preparations, not elsewhere specified or included; prepared room deodorisers, whether or not perfumed or having disinfectant properties' => 'Ullmhóidí réamh-bhearrtha, bearrtha, nó iarbhearrtha, díbholaígh phearsanta, ullmhóidí folctha, loimicí agus ullmhóidí eile cumhradóireachta, cosmaideacha nó maisíochta, nach bhfuil sonraithe ná áirithe in aon áit eile; díbholaígh ullmhaithe le haghaidh seomraí, bídís cumhraithe nó ná bídís nó bíodh airíonnadíghalraithe acu nó ná bíodh',
    'Soap; organic surface-active products and preparations for use as soap, in the form of bars, cakes, moulded pieces or shapes, whether or not containing soap; organic surface-active products and preparations for washing the skin, in the form of liquid or cream and put up for retail sale, whether or not containing soap; paper, wadding, felt and nonwovens, impregnated, coated or covered with soap or detergent' => 'Gallúnach; táirgí dromchla-ghníomhacha orgánacha agus ullmhóidí a úsáidtear mar ghallúnach, i bhfoirm barraí, cácaí, píosaí nó cruthanna múnlaithe, bíodh gallúnach iontu nó ná bíodh; táirgí dromchla-ghníomhacha orgánacha agus ullmhóidí chun an craiceann a ghlanadh, i bhfoirm leachta nó uachtair agus atá cóirithe lena miondíol, bíodh gallúnach iontu nó ná bíodh; páipéar, flocas, feilt agus fabraicí neamhfhite atá líonta, brataithe nó clúdaithe le gallúnach nó glantóir',
    'Organic surface-active agents (other than soap); surface-active preparations, washing preparations (including auxiliary washing preparations) and cleaning preparations, whether or not containing soap, other than those of heading 3401' => 'Oibreáin dhromchla-ghníomhacha orgánacha (seachas gallúnach); ullmhóidí dromchla-ghníomhacha, ullmhóidí níocháin (lena n-áirítear ullmhóidí cúntacha níocháin) agus ullmhóidí níocháin, bíodh gallúnach iontu nó ná bíodh, seachas ullmhóidí atá faoi cheannteideal 3401',
    'Lubricating preparations (including cutting-oil preparations, bolt or nut release preparations, anti-rust or anti-corrosion preparations and mould-release preparations, based on lubricants) and preparations of a kind used for the oil or grease treatment of textile materials, leather, furskins or other materials, but excluding preparations containing, as basic constituents, 70 % or more by weight of petroleum oils or of oils obtained from bituminous minerals' => 'Ullmhóidí bealaithe (lena n-áirítear ullmhóidí ola gearrtha, ullmhóidí scaoilte boltaí nó cnónna, ullmhóidí frithmheirgithe nó frithchreimthe agus ullmhóidí scaoilte múnlaí, bunaithe ar bhealaí) agus ullmhóidí de chineál a úsáidtear chun ábhair teicstíle, leathar, fionnadhsheithí agus ábhair eile a chóireáil, ach cé is moite d\'ullmhóidí ina bhfuil, mar chomhábhair bhunúsacha, cion 70 % nó níos mó de réir meáchain d\'olaí peitriliam nó d\'olaí a fhaightear ó mhianraí biotúmanacha',
    'Artificial waxes and prepared waxes' => 'Céaracha saorga agus céaracha ullmhaithe',
    'Polishes and creams, for footwear, furniture, floors, coachwork, glass or metal, scouring pastes and powders and similar preparations (whether or not in the form of paper, wadding, felt, nonwovens, cellular plastics or cellular rubber, impregnated, coated or covered with such preparations), excluding waxes of heading 3404' => 'Snasáin agus uachtair, le haghaidh coisbhirt, troscáin, urlár, oibre cóiste, gloine nó miotail, taois agus púdair sciúracháin agus ullmhóidí comhchosúla (bídís i bhfoirm páipéir, flocais, feilte, fabraicí neamhfhite, plaisteach ceallach nó rubair cheallaigh, agus tuilte, brataithe nó clúdaithe le hullmhóidí den chineál sin nó ná bíodh), seachas céaracha atá faoi cheannteideal 3404',
    'Casein, caseinates and other casein derivatives; casein glues' => 'Cáiséin, cáiséanáití agus díorthaigh cháiséine eile; gliúnna cáiséine',
    'Albumins (including concentrates of two or more whey proteins, containing by weight more than 80 % whey proteins, calculated on the dry matter), albuminates and other albumin derivatives' => 'Albaiminí (lena n-áirítear tiúcháin dhá phróitéin mheidhg nó níos mó, ina bhfuil cion is mó ná 80 % próitéin mheidhg de réir meáchain, a ríomhtar de réir an ábhair thirim), albaiminí agus díorthaigh eile albaimine',
    'Gelatin (including gelatin in rectangular (including square) sheets, whether or not surface-worked or coloured) and gelatin derivatives; isinglass; other glues of animal origin, excluding casein glues of heading 3501' => 'Geilitín (lena n-áirítear geilitín ina leatháin dhronuilleogacha (agus chearnógacha), bídís dathaithe nó dromchlaoibrithe nó ná bídís) agus díorthaigh geilitín; iascghlae; gliúnna eile de bhunadh ainmhíoch, seachas gliúnna cáiséine de cheannlíne 3501',
    'Peptones and their derivatives; other protein substances and their derivatives, not elsewhere specified or included; hide powder, whether or not chromed' => 'Peaptóin agus a ndíorthaigh; substaintí próitéine eile agus a ndíorthaigh, nach bhfuil sonraithe ná áirithe in áit eile; púdar seithe, bíodh sé crómaithe nó ná bíodh',
    'Dextrins and other modified starches (for example, pregelatinised or esterified starches); glues based on starches, or on dextrins or other modified starches' => 'Deistriní agus stáirsí modhnaithe eile (mar shampla, stáirsí réamhgheilitínithe nó éistearaithe); gliúnna atá bunaithe ar stáirsí, nó ar dheistriní nó ar stáirsí modhnaithe eile',
    'Prepared glues and other prepared adhesives, not elsewhere specified or included; products suitable for use as glues or adhesives, put up for retail sale as glues or adhesives, not exceeding a net weight of 1 kg' => 'Gliúnna sainullmhaithe agus greamacháin eile shainullmhaithe, nach bhfuil sonraithe ná áirithe in áit eile; táirgí atá oiriúnach lena n-úsáid mar ghliúnna nó greamacháin, atá cóirithe lena miondíol mar ghliúnna nó greamacháin, nach mó a nglanmheáchan ná 1 kg',
    'Enzymes; prepared enzymes not elsewhere specified or included' => 'Einsímí; einsímí ullmhaithe nach bhfuil sonraithe ná áirithe in áit eile',
    'Safety fuses; detonating cords; percussion or detonating caps; igniters; electric detonators' => 'Fiúsanna sábháilteachta; corda maidhmithe; caipíní buailte nó maidhmithe; adhainteoirí; maidhmitheoirí leictreacha',
    'Fireworks, signalling flares, rain rockets, fog signals and other pyrotechnic articles' => 'Tinte ealaíne, bladhmanna comharthaíochta, roicéid báistí, ceo-chomhartha agus earraí piriteicniúla eile',
    'Ferro-cerium and other pyrophoric alloys in all forms; articles of combustible materials as specified in note 2 to this chapter' => 'Fearóiceriam agus cóimhiotail phioreafóracha i ngach foirm; earraí d\'ábhair indóite mar atá sonraithe i nóta 2 a ghabhann leis an gcaibidil seo',
    'Photographic plates and film in the flat, sensitised, unexposed, of any material other than paper, paperboard or textiles; instant print film in the flat, sensitised, unexposed, whether or not in packs' => 'Plátaí fótagrafacha agus scannán fótagrafacha i bhfoirm chomhréidh, iad íograithe, neamhnochtaithe, déanta as aon ábhar seachas páipéar, cairtchlár nó teicstílí; scannán inphriontáilte ar an toirt i bhfoirm chomhréidh, iad íograithe, neamhnochtaithe, bídís i bpacáistí nó ná bídís',
    'Photographic film in rolls, sensitised, unexposed, of any material other than paper, paperboard or textiles; instant print film in rolls, sensitised, unexposed' => 'Scannán fótagrafach i bhfoirm rollaí, iad íograithe, neamhnochtaithe, d\'aon ábhar seachas páipéar, cairtchlár nó teicstílí; scannán inphriontáilte ar an toirt i bhfoirm rollaí, iad íograithe, neamhnochtaithe',
    'Photographic paper, paperboard and textiles, sensitised, unexposed' => 'Páipéar agus cairtchlár fótagrafach agus teicstílí fótagrafacha, iad íograithe, neamhnochtaithe',
    'Photographic plates, film, paper, paperboard and textiles, exposed but not developed' => 'Plátaí, scannáin, páipéar, cairtchlár agus teicstílí fótografacha, iad nochtaithe ach gan forbairt',
    'Photographic plates and film, exposed and developed, other than cinematographic film' => 'Plátaí agus scannáin fhótagrafacha, iad nochtaithe agus forbartha, seachas scannáin chineamatagrafacha',
    'Cinematographic film, exposed and developed, whether or not incorporating soundtrack or consisting only of soundtrack' => 'Scannáin chineamatagrafacha, iad nochtaithe agus forbartha, bíodh fuaimrian ionchorpraithe iontu nó ná bíodh nó bíodh nach bhfuil iontu ach an fuaimrian',
    'Chemical preparations for photographic uses (other than varnishes, glues, adhesives and similar preparations); unmixed products for photographic uses, put up in measured portions or put up for retail sale in a form ready for use' => 'Ullmhóidí ceimiceacha le haghaidh úsáidí fótagrafacha (seachas vearnaisí, gliúnna, greamacháin agus ullmhóidí comhchosúla); táirgí neamh-mheasctha le haghaidh úsáidí fótagrafacha atá curtha i láthair ina sciartha tomhaiste nó atá curtha ar miondíol i bhfoirm atá réidh le húsáid',
    'Artificial graphite; colloidal or semi-colloidal graphite; preparations based on graphite or other carbon in the form of pastes, blocks, plates or other semi-manufactures' => 'Graifít shaorga; graifít chollóideach nó leathchollóideach; ullmhóidí atá bunaithe ar ghraifít nó ar charbón eile i bhfoirm leafaos, bloc, plátaí nó ábhar eile leathmhonaraithe',
    'Activated carbon; activated natural mineral products; animal black, including spent animal black' => 'Carbón gníomhachtaithe; táirgí mianraí aiceanta gníomhachtaithe; cnámhghualach, lena n-áirítear cnámhghualach caite',
    'Tall oil, whether or not refined' => 'Róisín leachtach, bíodh sé scagtha nó ná bíodh',
    'Gum, wood or sulphate turpentine and other terpenic oils produced by the distillation or other treatment of coniferous woods; crude dipentene; sulphite turpentine and other crude para-cymene; pine oil containing alpha-terpineol as the main constituent' => 'Olaí tuirpintín guma, adhmaid nó sulfáite agus olaí teirpéineacha eile a tháirgtear trí adhmaid bhuaircíneacha a dhriogadh nó a chóireáil ar bhealach eile; dépheintéin amh; tuirpintín sulfáite agus paraciméiní amha eile; ola péine inarb é alfa-teirpiné-ól an príomh-chomhábhar',
    'Rosin and resin acids, and derivatives thereof; rosin spirit and rosin oils; run gums' => 'Róisín agus aigéid roisín, agus díorthaigh díobh; biotáillí róisín agus olaí róisín; gumaí reatha',
    'Wood tar; wood tar oils; wood creosote; wood naphtha; vegetable pitch; brewers\' pitch and similar preparations based on rosin, resin acids or on vegetable pitch' => 'Tarra adhmaid; olaí tarra adhmaid; créasóid adhmaid; nafta adhmaid; pic ghlasrúil; pic ghrúdaireachta agus ullmhóidí comhchosúla atá bunaithe ar róisín, ar aigéid roisín nó ar phic ghlasrúil',
    'Insecticides, rodenticides, fungicides, herbicides, anti-sprouting products and plant-growth regulators, disinfectants and similar products, put up in forms or packings for retail sale or as preparations or articles (for example, sulphur-treated bands, wicks and candles, and fly-papers)' => 'Feithidicídí, creimiricídí, fungaicídí, luibhicídí, táirgí frithphéactha agus rialaitheoirí fáis plandaí, díghalráin agus táirgí comhchosúla a chóirítear i bhfoirmeacha nó i bpacáistí lena miondíol nó mar ullmhóidí nó mar earraí (mar shampla, bandaí, buacais agus coinnle sulfarchóirithe, agus cuilpháipéir)',
    'Finishing agents, dye carriers to accelerate the dyeing or fixing of dyestuffs and other products and preparations (for example, dressings and mordants), of a kind used in the textile, paper, leather or like industries, not elsewhere specified or included' => 'Oibreáin bhailchríche, iompróirí ruaimeanna chun dlús a chur leis an ruaimniú nó le daingniú na ruaimeachán agus táirgí eile agus ullmhóidí eile (mar shampla, cóirithe agus buanaitheoirí), de chineál a úsáidtear sa tionscal teicstíle, páipéir nó leathair nó i dtionscail chomhchosúla, nach bhfuil sonraithe ná áirithe in aon áit eile',
    'Pickling preparations for metal surfaces; fluxes and other auxiliary preparations for soldering, brazing or welding; soldering, brazing or welding powders and pastes consisting of metal and other materials; preparations of a kind used as cores or coatings for welding electrodes or rods' => 'Ullmhóidí picile miotail; floscanna agus ullmhóidí cúnta eile le haghaidh sádrála, prásála nó táthú; púdair agus taois sádrála, phrásála nó tháthúcháin ina bhfuil miotal agus ábhair eile; ullmhóidí de chineál a úsáidtear mar chroíthe nó mar bhratú le haghaidh leictreoidí nó slata táthúcháin',
    'Anti-knock preparations, oxidation inhibitors, gum inhibitors, viscosity improvers, anti-corrosive preparations and other prepared additives, for mineral oils (including gasoline) or for other liquids used for the same purposes as mineral oils' => 'Ullmhóidí frithchnagarnaí, coscairí ocsaídiúcháin, coscairí guma, feabhsaitheoirí slaodachta, ullmhóidí frithchreimneacha agus breiseáin ullmhaithe eile, le haghaidh olaí mianra (lena n-áirítear gásailín) nó le haghaidh leachtanna eile a úsáidtear chun na gcríoch céanna a n-úsáidtear olaí mianra chucu',
    'Prepared rubber accelerators; compound plasticisers for rubber or plastics, not elsewhere specified or included; anti-oxidising preparations and other compound stabilisers for rubber or plastics' => 'Brostaitheoirí rubair ullmhaithe; plaisteacháin chomhdhúile le haghaidh rubair nó plaisteach, nach bhfuil sonraithe ná airithe in aon áit eile; ullmhóidí frith-ocsaídiúcháin agus cobhsaitheoirí eile comhdhúile le haghaidh rubair nó plaisteach',
    'Organic composite solvents and thinners, not elsewhere specified or included; prepared paint or varnish removers' => 'Tuaslagóirí agus caolaitheoirí comhchodacha orgánacha nach bhfuil sonraithe ná áirithe in áit eile; ullmhóidí díothaithe péinte nó vearnaise',
    'Reaction initiators, reaction accelerators and catalytic preparations, not elsewhere specified or included' => 'Tionscnóirí imoibriúcháin, brostaitheoirí imoibriúcháin agus ullmhóidí catalaíocha, nach bhfuil sonraithe ná áirithe in áit eile',
    'Refractory cements, mortars, concretes and similar compositions, including dolomite ramming mix, other than products of heading 3801' => 'Stroighin, moirtéal agus coincréit atá teasfhulangach, agus cumaisc chomhchosúla, seachas na táirgí atá faoi cheannteideal 3801',
    'Mixed alkylbenzenes and mixed alkylnaphthalenes, other than those of heading 2707 or 2902' => 'Ailcilbeinséiní measctha agus ailciolnaftailéiní measctha, seachas iad siúd atá faoi cheannteideal 2707 nó 2902',
    'Chemical elements doped for use in electronics, in the form of discs, wafers or similar forms; chemical compounds doped for use in electronics' => 'Dúile ceimiceacha dópáilte lena n-úsáid i leictreonaic, i bhfoirm dioscaí, nó sliseog nó i bhfoirmeacha comhchosúla; comhdhúile ceimiceacha dópáilte lena n-úsáid i leictreonaic',
    'Diagnostic or laboratory reagents on a backing, prepared diagnostic or laboratory reagents whether or not on a backing, whether or not put up in the form of kits, other than those of heading 3006; certified reference materials' => 'Imoibreáin dhiagnóiseacha nó imoibreáin saotharlainne ar bhonn, imoibreáin dhiagnóiseacha nó saotharlainne, bídís ar bhonn nó ná bídís, seachas iad siúd atá faoi cheannteideal 3006; ábhair thagartha dheimhnithe',
    'Industrial monocarboxylic fatty acids; acid oils from refining; industrial fatty alcohols' => 'Aigéid shailleacha thionsclaíocha aoncharbocsaileacha; olaí aigéid ó athscagadh; alcóil shailleacha thionsclaíocha',
    'Prepared binders for foundry moulds or cores; chemical products and preparations of the chemical or allied industries (including those consisting of mixtures of natural products), not elsewhere specified or included' => 'Táthuithe ullmhaithe do mhúnlaí nó do chroíthe teilgcheártan; táirgí agus ullmhóidí ceimiceacha ó na tionscail cheimiceacha nó ó na tionscail ghaolmhara (lena n-áirítear iad siúd ina bhfuil meascáin de tháirgí nádúrtha), nach bhfuil sonraithe ná áirithe in áit eile',
    'Residual products of the chemical or allied industries, not elsewhere specified or included; municipal waste; sewage sludge; other wastes specified in note 6 to this chapter' => 'Táirgí iarmharacha ó na tionscail cheimiceacha nó ó na tionscail ghaolmhara, nach bhfuil sonraithe ná áirithe in áit eile; dramhaíl chathrach; sloda séarachais; dramhaíl eile a shonraítear i nóta 6 a ghabhann leis an gcaibidil seo',
    'Biodiesel and mixtures thereof, not containing or containing less than 70 % by weight of petroleum oils or oils obtained from bituminous minerals' => 'Bithdhíosal agus meascáin atá déanta as, nach bhfuil olaí peitriliam nó olaí a fhaightear ó mhianraí bitiúmanacha iontu nó ina bhfuil, de réir meáchain, níos lú ná 70 % de na holaí sin',
    'Mixtures containing halogenated derivatives of methane, ethane or propane, not elsewhere specified or included' => 'Meascáin ina bhfuil díorthaigh halaiginithe de mheatán, d\'eatán nó de phrópán, nach bhfuil sonraithe ná áirithe in aon áit eile',
    'Polymers of ethylene, in primary forms' => 'Polaiméirí eitiléine, i bhfoirmeacha príomhúla',
    'Polymers of propylene or of other olefins, in primary forms' => 'Polaiméirí déanta de phróipiléin nó d\'olaifíní eile, i bhfoirmeacha príomhúla',
    'Polymers of styrene, in primary forms' => 'Polaiméirí stiréine, i bhfoirmeacha príomhúla',
    'Polymers of vinyl chloride or of other halogenated olefins, in primary forms' => 'Polaiméirí de chlóiríd vinile nó d\'olaifíní halaiginithe eile, i bhfoirmeacha príomhúla',
    'Polymers of vinyl acetate or of other vinyl esters, in primary forms; other vinyl polymers in primary forms' => 'Polaiméirí de chlóiríd vinile nó d\'olaifíní halaiginithe eile, i bhfoirmeacha príomhúla; polaiméirí aicrileacha eile, i bhfoirmeacha príomhúla',
    'Acrylic polymers in primary forms' => 'Polaiméirí aicrileacha, i bhfoirmeacha príomhúla',
    'Polyacetals, other polyethers and epoxide resins, in primary forms; polycarbonates, alkyd resins, polyallyl esters and other polyesters, in primary forms' => 'Pola-aicéatail, polai-éatair eile agus roisíní eapocsaíde i bhfoirmeacha príomhúla; polacharbonáití, roisíní ailcíde, eistir polaillile agus poileistir eile, i bhfoirmeacha príomhúla',
    'Polyamides in primary forms' => 'Polaimídí i bhfoirmeacha príomhúla',
    'Amino-resins, phenolic resins and polyurethanes, in primary forms' => 'Aimínea-roisíní, roisíní fionólacha agus polúireatáin, i bhfoirmeacha príomhúla',
    'Petroleum resins, coumarone-indene resins, polyterpenes, polysulphides, polysulphones and other products specified in note 3 to this chapter, not elsewhere specified or included, in primary forms' => 'Roisíní peitroliam, roisíní cúmarón-indéine, polaiteirpéiní, polasuilfídí, polasulfóin agus táirgí eile a shonraítear i nóta 3 a ghabhann leis an gcaibidil seo, nach bhfuil sonraithe ná áirithe in áit eile, i bhfoirmeacha príomhúla',
    'Cellulose and its chemical derivatives, not elsewhere specified or included, in primary forms' => 'Ceallalós agus na díorthaigh a bhaintear as, nach sonraítear ná nach n-áirítear in aon áit eile, i bhfoirmeacha príomhúla',
    'Natural polymers (for example, alginic acid) and modified natural polymers (for example, hardened proteins, chemical derivatives of natural rubber), not elsewhere specified or included, in primary forms' => 'Polaiméirí nádúrtha (mar shampla aigéad ailgineach) agus polaiméirí nádúrtha modhnaithe (mar shampla próitéiní cruaite, díorthaigh cheimiceacha ó rubar nádúrtha), nach sonraítear ná nach n-áirítear in aon áit eile, i bhfoirmeacha príomhúla',
    'Waste, parings and scrap, of plastics' => 'Dramhaíl, dramh bearrtha agus fuíoll, iad as plaistigh',
    'Monofilament of which any cross-sectional dimension exceeds 1 mm, rods, sticks and profile shapes, whether or not surface-worked but not otherwise worked, of plastics' => 'Aonfhiliméad ar mó aon diminsean trasghearrthach dá chuid ná 1 mm, slata, maidí agus cruthanna próifíle, bíodh saoirsiú déanta ar an dromchla orthu nó ná bíodh ach neamhshaoirsithe seachas sin, as plaistigh',
    'Tubes, pipes and hoses, and fittings therefor (for example, joints, elbows, flanges), of plastics' => 'Feadáin, píopaí agus píobáin agus feistis dóibh (mar shampla, ailt, uillinneacha, feirí), iad déanta as plaistigh',
    'Floor coverings of plastics, whether or not self-adhesive, in rolls or in the form of tiles; wall or ceiling coverings of plastics, as defined in note 9 to this chapter' => 'Clúdaigh urláir as plaistigh, bídís déanta le greamú uathu féin nó ná bíodh, ina rollaí nó i bhfoirm tíleanna; clúdaigh balla nó síleála déanta as plaistigh, mar atá sainmhínithe i nóta 9 den chaibidil seo',
    'Self-adhesive plates, sheets, film, foil, tape, strip and other flat shapes, of plastics, whether or not in rolls' => 'Plátaí, leatháin, scannán, scragaill, téip, stiallacha atá déanta le greamú uathu féin agus cruthanna cothroma eile déanta as plaistigh, bídís ina rollaí nó ná bíodh',
    'Other plates, sheets, film, foil and strip, of plastics, non-cellular and not reinforced, laminated, supported or similarly combined with other materials' => 'Plátaí, leatháin, scannán, scragall agus stiallacha eile, as plaistigh neamhcheallacha, nach bhfuil treisithe, lannaithe, faoi thacú nó i gcumasc de chineálsin le hábhair eile',
    'Other plates, sheets, film, foil and strip, of plastics' => 'Plátaí, brait, scannán, scragall agus stiallacha eile, déanta as plaistigh',
    'Baths, shower-baths, sinks, washbasins, bidets, lavatory pans, seats and covers, flushing cisterns and similar sanitary ware, of plastics' => 'Folcadáin, cithfholcadáin, doirtil, báisíní níocháin, bidets, pannaí leithris, suíocháin agus clúdaigh, sistéil shruthlaithe agus earraí sláintíocha, as plaistigh',
    'Articles for the conveyance or packing of goods, of plastics; stoppers, lids, caps and other closures, of plastics' => 'Nithe chun earraí a iompar nó a phacáil, as plaistigh; stopalláin, claibíní, caidhpeanna agus cláir eile, iad déanta as plaistigh',
    'Tableware, kitchenware, other household articles and hygienic or toilet articles, of plastics' => 'Gréithe, earraí cistine, earraí teaghlaigh eile agus earraí sláintíochta nó leithris, as plaistigh',
    'Builders\' ware of plastics, not elsewhere specified or included' => 'Earraí tógálaithe atá déanta as plaistigh, nach bhfuil sonraithe ná áirithe in áit eile',
    'Other articles of plastics and articles of other materials of headings 3901 to 3914' => 'Nithe eile as plaistigh agus nithe as ábhair eile faoi cheannteideal 3901 go 3914',
    'Natural rubber, balata, gutta-percha, guayule, chicle and similar natural gums, in primary forms or in plates, sheets or strip' => 'Rubar nádúrtha, balata, gutta-percha, guayula, chicle nó gumaí nádúrtha comhchosúla, i bhfoirmeacha príomhúla nó i bplátaí, ina leatháin nó ina stiallacha',
    'Synthetic rubber and factice derived from oils, in primary forms or in plates, sheets or strip; mixtures of any product of heading 4001 with any product of this heading, in primary forms or in plates, sheets or strip' => 'Rubar sintéiseach agus faictís a fhaightear ó olaí, i bhfoirmeacha príomhúla nó ina phlátaí; meascáin d\'aon táirge faoi cheannteideal 4001 i bhfoirmeacha príomhúla nó i bplátaí, i leatháin nó i stiallacha',
    'Compounded rubber, unvulcanised, in primary forms or in plates, sheets or strip' => 'Rubar comhshuite, neamhbholcánaithe i bhfoirmeacha príomhúla nó i bplátaí, i leatháin nó i stiallacha',
    'Other forms (for example, rods, tubes and profile shapes) and articles (for example, discs and rings), of unvulcanised rubber' => 'Foirmeacha eile (mar shampla, slata, feadáin agus cruthanna próifíle) agus nithe (mar shampla dioscaí agus fáinní), as rubar neamhbholcánaithe',
    'Plates, sheets, strip, rods and profile shapes, of vulcanised rubber other than hard rubber' => 'Plátaí, leatháin, stiallacha, slata, agus cruthanna próifíle, as rubar bolcánaithe seachas rubar crua',
    'Tubes, pipes and hoses, of vulcanised rubber other than hard rubber, with or without their fittings (for example, joints, elbows, flanges)' => 'Feadáin, píopaí agus píobáin, iad déanta as rubar bolcánaithe seachas rubar crua, iad feistithe nó gan a bheith feistithe (mar shampla le hailt, uillinneacha, feirí)',
    'Conveyor or transmission belts or belting, of vulcanised rubber' => 'Criosanna nó beilteanna iompair nó tarchurtha, den rubar bolcánaithe',
    'New pneumatic tyres, of rubber' => 'Aerbhoinn nua, déanta as rubar',
    'Retreaded or used pneumatic tyres of rubber; solid or cushion tyres, tyre treads and tyre flaps, of rubber' => 'Aerbhoinn atráchtaithe nó athláimhe as rubar; boinn sholadacha nó chúisín, tráchta boinn agus flapaí boinn, as rubar',
    'Inner tubes, of rubber' => 'Feadáin, as rubar',
    'Hygienic or pharmaceutical articles (including teats), of vulcanised rubber other than hard rubber, with or without fittings of hard rubber' => 'Nithe sláinteacha nó cógaisíochta (lena n-áirítear siní), as rubar bolcánaithe seachas rubar crua, agus feistis as rubar crua orthu nó gan a bheith orthu',
    'Articles of apparel and clothing accessories (including gloves, mittens and mitts), for all purposes, of vulcanised rubber other than hard rubber' => 'Baill éadaigh nó gabhálais éadaigh (lena n-áirítear lámhainní, miotóga agus mitíní), chun gach cineál críche, déanta as rubar bolcánaithe seachas rubar crua',
    'Other articles of vulcanised rubber other than hard rubber' => 'Nithe eile atá déanta as rubar bolcánaithe seachas an rubar crua',
    'Raw hides and skins of bovine (including buffalo) or equine animals (fresh, or salted, dried, limed, pickled or otherwise preserved, but not tanned, parchment-dressed or further prepared), whether or not dehaired or split' => 'Seithí amha agus craicne amha ó bhó-ainmhithe (lena n-áirítear buabhaill) nó eachainmhithe (iad úr, nó saillte, triomaithe, aolta, picilte nó leasaithe ar bhealach eile, ach nach bhfuil súdaraithe ná párchóirithe ná gan ullmhú thairis sin orthu), bídís lomtha nó scoilte nó ná bídís',
    'Raw skins of sheep or lambs (fresh, or salted, dried, limed, pickled or otherwise preserved, but not tanned, parchment-dressed or further prepared), whether or not with wool on or split, other than those excluded by note 1(c) to this chapter' => 'Craicne amha ó chaoirigh nó ó uain (iad úr, nó saillte, triomaithe, aolta, picilte nó leasaithe ar bhealach eile, ach nach bhfuil súdaraithe ná párchóirithe ná gan ullmhú thairis sin orthu), bíodh an olann orthu nó ná bíodh agus bídís lomtha nó ná bídís, seachas na craicne sin a eisiatar le nóta 1(c) a ghabhann leis an gCaibidil seo',
    'Other raw hides and skins (fresh, or salted, dried, limed, pickled or otherwise preserved, but not tanned, parchment-dressed or further prepared), whether or not dehaired or split, other than those excluded by note 1(b) or 1(c) to this chapter' => 'Seithí agus craicne amha eile (iad úr, nó saillte, triomaithe, aolta, picilte nó leasaithe ar bhealach eile, ach nach bhfuil súdaraithe ná párchóirithe ná gan ullmhú thairis sin orthu), bídís lomtha nó scoilte nó ná bídís, seachas na seithí agus na craicne sin a eisiatar le nóta 1(b) nó 1(c) a ghabhann leis an gCaibidil seo',
    'Tanned or crust hides and skins of bovine (including buffalo) or equine animals, without hair on, whether or not split, but not further prepared' => 'Seithí agus craicne ó bhó-ainmhithe (lena n-áirítear buabhaill) nó ó eachainmhithe, iad súdaraithe nó coirteach, agus lomtha, bídís scoilte nó ná bídís, ach gan ullmhú thairis sin orthu',
    'Tanned or crust skins of sheep or lambs, without wool on, whether or not split, but not further prepared' => 'Craicne súdaraithe nó coirteacha ó chaoirigh nó ó uain, gan olann, bídís scoilte nó ná bídís, ach gan ullmhú thairis sin orthu',
    'Tanned or crust hides and skins of other animals, without wool or hair on, whether or not split, but not further prepared' => 'Seithí agus craicne ó ainmhithe eile, iad súdaraithe nó coirteach, gan olann gan ghruaig, bídís scoilte nó ná bídís, ach gan ullmhú thairis sin orthu',
    'Leather further prepared after tanning or crusting, including parchment-dressed leather, of bovine (including buffalo) or equine animals, without hair on, whether or not split, other than leather of heading 4114' => 'Leathar a ndearnadh ullmhú breise air tar éis a shúdaraithe nó a choirtithe, lena n-áirítear leathar párchóirithe, ó bhó-ainmhithe (lena n-áirítear buabhaill) nó ó eachainmhithe, é gan ghruaig, bíodh sé scoilte nó ná bíodh, seachas leathar atá faoi cheannteideal 4114',
    'Leather further prepared after tanning or crusting, including parchment-dressed leather, of other animals, without wool or hair on, whether or not split, other than leather of heading 4114' => 'Leathar a ndearnadh ullmhú breise air tar éis a shúdaraithe nó a choirtithe, lena n-áirítear leathar párchóirithe, ó ainmhithe eile, é gan olann gan ghruaig, bíodh sé scoilte nó ná bíodh, seachas leathar atá faoi cheannteideal 4114',
    'Chamois (including combination chamois) leather; patent leather and patent laminated leather; metallised leather' => 'Leathar ó sheamaithe (lena n-áirítear leathar cumaisc ó sheamaithe); snasleathar agus snasleathar lannaithe; leathar miotalaithe',
    'Composition leather with a basis of leather or leather fibre, in slabs, sheets or strip, whether or not in rolls; parings and other waste of leather or of composition leather, not suitable for the manufacture of leather articles; leather dust, powder and flour' => 'Leathar comhdhéanta de bhunús leathair nó snáithíní leathair, ina leaca, ina leatháin nó ina stiallacha, bíodh sé ina rollaí nó ná bíodh; dramh bearrtha agus dramhaíl eile ó leathar nó ó leathar comhdhéanta, nach bhfuil oiriúnach chun earraí leathair a mhonarú; deannach, púdar agus plúr leathair',
    'Trunks, suitcases, vanity cases, executive-cases, briefcases, school satchels, spectacle cases, binocular cases, camera cases, musical instrument cases, gun cases, holsters and similar containers; travelling-bags, insulated food or beverages bags, toilet bags, rucksacks, handbags, shopping-bags, wallets, purses, map-cases, cigarette-cases, tobacco-pouches, tool bags, sports bags, bottle-cases, jewellery boxes, powder boxes, cutlery cases and similar containers, of leather or of composition leather, of sheeting of plastics, of textile materials, of vulcanised fibre or of paperboard, or wholly or mainly covered with such materials or with paper' => 'Truncaí, cásanna taistil, maiseagáin, cásanna gnóthaistil, málaí cáipéisí, málaí scoile, cásanna spéaclaí, cásanna déshúileach, cásanna ceamara, cásanna uirlise ceoil, cásanna gunna, curraí gunna, agus coimeádáin dá samhail; málaí taistil, málaí inslithe bia nó deochanna, málaí maisíochta, málaí droma, málaí láimhe, málaí siopadóireachta, tiachóga, sparáin, cásanna léarscáile, cáisíní toitíní, púitsí tobac, málaí gléasra, málaí spóirt, cásanna buidéal, boscaí seodra, boscaí púdair, cásanna sceanra agus coimeádáin dá samhail, iad déanta as leathar nó leathar comhdhéanta, as leatháin plaisteach, ábhair theicstíle, snáithín bolcánaithe nó páipéarchlár, nó iad lánchumhdaithe nó páirtchumhdaithe le hábhair den tsamhail sin nó le páipéar',
    'Articles of apparel and clothing accessories, of leather or of composition leather' => 'Baill éadaigh nó gabhálais éadaigh, iad déanta as leathar nó leathar comhdhéanta',
    'Other articles of leather or of composition leather' => 'Earraí eile atá déanta as leathar nó leathar comhdhéanta',
    'Raw furskins (including heads, tails, paws and other pieces or cuttings, suitable for furriers\' use), other than raw hides and skins of heading 4101, 4102 or 4103' => 'Craicne fionnaidh amha (lena n-áirítear cinn, eireabaill, lapaí agus píosaí eile nó gearrtháin eile, atá oiriúnach lena n-úsáid ag fionnadóirí), seachas seithí amha agus craicne amha atá faoi cheannteideal 4101, 4102 nó 4103',
    'Tanned or dressed furskins (including heads, tails, paws and other pieces or cuttings), unassembled, or assembled (without the addition of other materials) other than those of heading 4303' => 'Craicne fionnaidh súdaraithe nó cóireáilte (lena n-áirítear cinn, eireabaill, lapaí agus píosaí nó gearrtháin eile), nach bhfuil cóimeáilte, nó atá cóimeáilte (gan ábhair eile a bheith curtha leo) seachas iad siúd atá faoi cheannteideal 4303',
    'Articles of apparel, clothing accessories and other articles of furskin' => 'Baill éadaigh, gabhálais éadaigh agus earraí eile craicinn fionnaidh',
    'Fuel wood, in logs, in billets, in twigs, in faggots or in similar forms; wood in chips or particles; sawdust and wood waste and scrap, whether or not agglomerated in logs, briquettes, pellets or similar forms' => 'Connadh, atá ina cheapa, ina smutáin, ina chipíní, ina bhrosna, nó i bhfoirmeacha den chineál sin; adhmad atá ina sliseanna nó ina cháithníní; min sáibh agus dramhaíl adhmaid agus fuíoll adhmaid, bídís ceirtleánaithe i bhfoirm ceapa, brícíní, millíní nó i bhfoirmeacha den chineál sin nó ná bídís',
    'Wood charcoal (including shell or nut charcoal), whether or not agglomerated' => 'Fioghual (lena n-áirítear scillig-ghualach nó cnóghualach), bíodh sé ceirtleánaithe nó ná bíodh',
    'Wood in the rough, whether or not stripped of bark or sapwood, or roughly squared' => 'Adhmad neamhchóirithe, bíodh an choirt nó an sú-adhmad bainte de nó ná bíodh, nó é cearnaithe go garbh',
    'Hoopwood; split poles; piles, pickets and stakes of wood, pointed but not sawn lengthwise; wooden sticks, roughly trimmed but not turned, bent or otherwise worked, suitable for the manufacture of walking sticks, umbrellas, tool handles or the like; chipwood and the like' => 'Adhmad fonsaí; poil scoilte; cairn, cuaillí agus stácaí as adhmad, a bhfuil bior orthu ach nach bhfuil sáfa ar a fhad; slata d’adhmad atá garbh-bhearrtha ach nach bhfuil deilte, lúbtha ná snoite ar bhealach eile, atá oiriúnach chun maidí siúil, scáthanna fearthainne, cosa uirlisí nó a leithéid a mhonarú; adhmad sliseanna agus a leithéid',
    'Railway or tramway sleepers (cross-ties) of wood' => 'Trasnáin iarnróid nó trambhealaí (trascheangail) as adhmad',
    'Wood sawn or chipped lengthwise, sliced or peeled, whether or not planed, sanded or end-jointed, of a thickness exceeding 6 mm' => 'Adhmad atá sáfa nó scealptha ar a fhad, sliseáilte nó scafa, bíodh sé plánáilte, greanáilte, nó ceannsiúntáilte nó ná bíodh, agus atá ar tiús is mó ná 6 mm',
    'Sheets for veneering (including those obtained by slicing laminated wood), for plywood or for similar laminated wood and other wood, sawn lengthwise, sliced or peeled, whether or not planed, sanded, spliced or end-jointed, of a thickness not exceeding 6 mm' => 'Leatháin atá le veiníriú (lena n-áirítear leatháin a fhaightear trí adhmad lannaithe a shliseadh), leatháin le haghaidh sraithadhmaid nó le haghaidh adhmaid lannaithe chomhchosúil agus adhmaid eile, atá sáfa ar a fhad, sliste nó scafa, bíodh sé plánáilte, greanáilte, scarshiúntaithe nó ceannsiúntáilte nó ná bíodh, nach mó ná 6 mm a dtiús',
    'Wood (including strips and friezes for parquet flooring, not assembled) continuously shaped (tongued, grooved, rebated, chamfered, V-jointed, beaded, moulded, rounded or the like) along any of its edges, ends or faces, whether or not planed, sanded or end-jointed' => 'Adhmad (lena n-áirítear stiallacha agus fríosanna d\'urlár iontlaise, nach bhfuil cóimeáilte) atá dealbhaithe go leanúnach (teangaithe, eitrithe, céimnithe, seaimféaráilte, V-siúntáilte, feirbthe, múnlaithe, maolaithe nó a leithéidí) ar feadh aon cheann de na himill, dá chinn nó dá éadain, bíodh sé plánáilte, greanáilte, nó ceannsiúntáilte nó ná bíodh',
    'Particle board, oriented strand board (OSB) and similar board (for example, waferboard) of wood or other ligneous materials, whether or not agglomerated with resins or other organic binding substances' => 'Slischlár, clár sliseog treoshuite agus cláir chomhchosúla (clár sliseogach, mar shampla) atá déanta as adhmad nó as ábhair adhmadúla eile, bídís ceirtleánaithe le roisíní nó le substaintí nasctha orgánacha eile nó ná bídís',
    'Fibreboard of wood or other ligneous materials, whether or not bonded with resins or other organic substances' => 'Clár snáithíneach as ábhair adhmadúla eile, bíodh sé nasctha le roisíní nó le substaintí nasctha orgánacha eile nó ná bíodh',
    'Plywood, veneered panels and similar laminated wood' => 'Sraithadhmad, painéil veinírithe agus adhmad lannaithe comhchosúil eile',
    'Wooden frames for paintings, photographs, mirrors or similar objects' => 'Frámaí atá déanta as adhmad i gcomhair pictiúr, grianghraf, scáthán nó earraí comhchosúla',
    'Packing cases, boxes, crates, drums and similar packings, of wood; cable-drums of wood; pallets, box pallets and other load boards, of wood; pallet collars of wood' => 'Cásanna pacála, boscaí, cliathbhoscaí, drumaí agus pacáistithe comhchosúla, as adhmad; drumaí cáblaí as adhmad; pailléid, sráideoga bosca agus boird ualaigh eile; as adhmad; coiléir phailléid as adhmad',
    'Builders\' joinery and carpentry of wood, including cellular wood panels, assembled flooring panels, shingles and shakes' => 'Siúinéireacht agus cearpantóireacht na dtógálaithe ina n-úsáidtear adhmad, lena n-áirítear painéil cheallacha as adhmad, painéil urláir chóimeáilte, slinnte agus fabhtanna',
    'Tableware and kitchenware, of wood' => 'Gréithe agus earraí cistine, as adhmad',
    'Wood marquetry and inlaid wood; caskets and cases for jewellery or cutlery, and similar articles, of wood; statuettes and other ornaments, of wood; wooden articles of furniture not falling in Chapter 94' => 'Maircíneacht ina n-úsáidtear adhmad agus adhmad atá inleagtha; cisteoga agus cásanna do sheodra nó sceanra, agus earraí comhchosúla, as adhmad; deilbhíní agus earraí ornáideacha eile, as adhmad; troscáin atá déanta as adhmad nach gcumhdaítear i gCaibidil 94',
    'Other articles of wood' => 'Earraí eile as adhmad',
    'Natural cork, raw or simply prepared; waste cork; crushed, granulated or ground cork' => 'Corc aiceanta, amh nó ullmhaithe go simplí; dramhaíl choirc; corc brúite, gránaithe nó meilte',
    'Articles of natural cork' => 'Earraí atá déanta as corc aiceanta',
    'Agglomerated cork (with or without a binding substance) and articles of agglomerated cork' => 'Corc ceirtleánaithe (a bhfuil táthshubstaint aige nó nach bhfuil) agus earraí atá déanta as corc ceirtleánaithe',
    'Plaits and similar products of plaiting materials, whether or not assembled into strips; plaiting materials, plaits and similar products of plaiting materials, bound together in parallel strands or woven, in sheet form, whether or not being finished articles (for example, mats, matting, screens)' => 'Trilseáin agus táirgí comhchosúla atá déanta as ábhair thrilseánaithe, bídís cóimeáilte ina stiallacha nó na bídís; ábhair thrilseacha, trilseáin agus táirgí comhchosúla atá déanta as ábhair thrilseacha atá ceangailte le chéile i nduail chomhthreomhara nó fite, i bhfoirm leatháin, bídís ina n-earraícríochnaithe (mar shampla mataí, matra, sciatha) nó ná bídís',
    'Basketwork, wickerwork and other articles, made directly to shape from plaiting materials or made up from goods of heading 4601; articles of loofah' => 'Cis-earraí, earraí caolaigh agus earraí eile, a dhéantar go díreach chun crutha as ábhair thrilseacha nó as na hearraí atá faoi cheannteideal 4601; earraí atá déanta as lúfach',
    'Mechanical wood pulp' => 'Laíon meicniúil adhmaid',
    'Chemical wood pulp, soda or sulphate, other than dissolving grades' => 'Laíon ceimiceach adhmaid, sóid nó sulfáit, seachas gráid thuaslagtha',
    'Chemical wood pulp, sulphite, other than dissolving grades' => 'Suilfít nó laíon ceimiceach adhmaid, seachas gráid tuaslagtha',
    'Pulps of fibres derived from recovered (waste and scrap) paper or paperboard or of other fibrous cellulosic material' => 'Laíon snáithíní a fhaightear ó pháipéar slánaithe nó cairtchlár slánaithe (atá déanta as dramhaíl agus fuíoll) nó laíon atá déanta as ábhair eile de cheallalóis snáithíneach',
    'Recovered (waste and scrap) paper or paperboard' => 'Páipéar slánaithe nó cairtchlár slánaithe (atá déanta as dramhaíl agus fuíoll)',
    'Uncoated paper and paperboard, of a kind used for writing, printing or other graphic purposes, and non-perforated punchcards and punch-tape paper, in rolls or rectangular (including square) sheets, of any size, other than paper of heading 4801 or 4803; handmade paper and paperboard' => 'Páipéar neamhbhrataithe agus páipéarchlár neamhbhrataithe, de chineál a úsáidtear chun críocha na scríbhneoireachta, na clódóireachta nó chun críocha eile grafaice, agus pollchártaí neamhphollta agus páipéar téip-phollta, ina rollaí nó ina leatháin dhronuilleogacha (lena n-áirítear leatháin chearnóga), ar thomhas ar bith, seachas páipéar atá faoi cheannteideal 4801 nó 4803; páipéarlámhdhéanta agus páipéarchlár lámhdhéanta',
    'Toilet or facial tissue stock, towel or napkin stock and similar paper of a kind used for household or sanitary purposes, cellulose wadding and webs of cellulose fibres, whether or not creped, crinkled, embossed, perforated, surface-coloured, surface-decorated or printed, in rolls or sheets' => 'Stoc de chiarsúir leithris nó éadain, stoc de thuáillí nó de naipcíní agus páipéar comhchosúil de chineál a úsáidtear chun críocha teaghlaigh nó sláintíochta, flocas ceallalóise agus uigí de shnáithíní ceallalóise, bídís i bhfoirm síprise, nó bídís creaptha, cabhartha, pollta, bíodh a n-éadain daite, maisithenó clóite nó ná bídís, ina rollaí nó ina leatháin',
    'Uncoated kraft paper and paperboard, in rolls or sheets, other than that of heading 4802 or 4803' => 'Craftpháipéar neamhbhrataithe agus páipéarchlár neamhbhrataithe, é ina rollaí nó ina leatháin, seachas an méid atá faoi cheannteideal 4802 nó 4803',
    'Other uncoated paper and paperboard, in rolls or sheets, not further worked or processed than as specified in note 3 to this chapter' => 'Craftpháipéar neamhbhrataithe eile agus páipéarchlár neamhbhrataithe eile, ina rollaí nó ina leatháin, nach bhfuil tuilleadh oibre nó próiseála déanta orthu seachas mar a shonraítear i nóta 3 a ghabhann leis an gcaibidil seo',
    'Vegetable parchment, greaseproof papers, tracing papers and glassine and other glazed transparent or translucent papers, in rolls or sheets' => 'Pár atá déanta as glasraí, páipéir ghréiscdhíonacha, rianpháipéir agus bréagphár agus páipéir eile atá glónraithe, trédhearcach nó tréshoilseach, ina rollaí nó ina leatháin',
    'Composite paper and paperboard (made by sticking flat layers of paper or paperboard together with an adhesive), not surface-coated or impregnated, whether or not internally reinforced, in rolls or sheets' => 'Páipéar cumaisc agus páipéarchlár cumaisc (a dhéantar trí shraitheanna cothroma de pháipéar nó de pháipéarchlár a ghreamú le chéile le greamachán), nach bhfuil a n-éadain brataithe nó tuilithe, bídís atreisithe go hinmheánach nó ná bídís, ina rollaí nó ina leatháin',
    'Paper and paperboard, corrugated (with or without glued flat surface sheets), creped, crinkled, embossed or perforated, in rolls or sheets, other than paper of the kind described in heading 4803' => 'Páipéar roctha agus páipéarchlár roctha, (gona leatháin chothroma éadain gliúáilte orthu nó gan sin gliúáilte orthu), i bhfoirm síprise nó creaptha, nó iad cabhartha nó pollta, ina rollaí nó ina leatháin, seachas páipéar den chineál a ndéantar tuairisc air i gceannteideal 4803',
    'Carbon paper, self-copy paper and other copying or transfer papers (including coated or impregnated paper for duplicator stencils or offset plates), whether or not printed, in rolls or sheets' => 'Páipéar carbóin, páipéar féinchóipeála agus páipéir eile chóipeála nó aistrithe, ina rollaí nó ina leatháin (lena n-áirítear páipéar atá brataithe nó tuilithe, atá le haghaidh stionsal do ghléasanna cóipeála nó le haghaidh seachphlátaí), bídís clóite nó ná bídís',
