    'Fabricated asbestos fibres; mixtures with a basis of asbestos or with a basis of asbestos and magnesium carbonate; articles of such mixtures or of asbestos (for example, thread, woven fabric, clothing, headgear, footwear, gaskets), whether or not reinforced, other than goods of heading 6811 or 6813' => 'snáithíní atá déanta as aispeist; meascáin ina bhfuil bonn aispeiste nó bonn aispeiste agus charbónáit mhaignéisiam; earraí déanta as meascáin chomhchosúla nó as aispeist (mar shampla, snáithe, fabraic fhite, éadaí, ceannbheart, coisbheart, gaiscéid), bídís treisithe nó ná bíodh, seachas earraí faoi cheannteideal 6811 nó 6813',
    'Friction material and articles thereof (for example, sheets, rolls, strips, segments, discs, washers, pads), not mounted, for brakes, for clutches or the like, with a basis of asbestos, of other mineral substances or of cellulose, whether or not combined with textile or other materials' => 'Ábhar frithchuimilteach agus earraí déanta as an ábhar sin (mar shampla, leatháin, rollaí, stiallacha, teascáin, dioscaí, leicneáin, pillíní), gan iad feistithe, i gcomhair coscáin agus crága nó a leithéidí, ar bhonn aispeiste, ar bhonn ábhar mianrach eile nó ar bhonn cheallalóis, bídís comhcheangailte le teicstíl nó le hábhair eile nó ná bíodh',
    'Worked mica and articles of mica, including agglomerated or reconstituted mica, whether or not on a support of paper, paperboard or other materials' => 'Míoca saoirsithe agus earraí déanta as míoca, lena n-áirítear míoca atá ceirtleánaithe nó athdhéanta, bíodh páipéar, páipéarchlár nó ábhar eile ina ábhar taca leis sin nó ná bíodh',
    'Articles of stone or of other mineral substances (including carbon fibres, articles of carbon fibres and articles of peat), not elsewhere specified or included' => 'Earraí déanta as cloch nó as ábhar mianrach eile (lena n-áirítear snáithíní carbóin, earraí déanta as snáithíní carbóin agus earraí móna), nach bhfuil sonraithe ná áirithe faoi cheannteideal eile',
    'Refractory bricks, blocks, tiles and similar refractory ceramic constructional goods, other than those of siliceous fossil meals or similar siliceous earths' => 'Brící, bloic, tíleanna teasfhulangacha agus earraí foirgníochta ceirmeacha, teasfhulangacha comhchosúla, seachas iad sin as lón siliúil iontaise nó créanna siliciúla comhchosúla',
    'Other refractory ceramic goods (for example, retorts, crucibles, muffles, nozzles, plugs, supports, cupels, tubes, pipes, sheaths, rods and slide gates), other than those of siliceous fossil meals or of similar siliceous earths' => 'Earraí ceirmeacha teasfhulangacha eile (mar shampla, freangáin, breogáin, mufail, buinní, stopalláin, tacaí, cupaí, feadáin, píobáin, truaillí agus slata), ach amháin earraí déanta as min iontaise shiliciúil nó as créanna siliciúla comhchosúla',
    'Ceramic building bricks, flooring blocks, support or filler tiles and the like' => 'Brící ceirmeacha tógála, bloic urláir, tíleanna taca nó tíleanna chun líonta agus a leithéidí',
    'Roofing tiles, chimney pots, cowls, chimney liners, architectural ornaments and other ceramic constructional goods' => 'Tíleanna díonadóireachta, potaí simléir, cochaill, líneálaigh simléir, maisiúcháin ailtireachta agus earraí ceirmeacha eile le haghaidh na tógála',
    'Ceramic flags and paving, hearth or wall tiles; ceramic mosaic cubes and the like, whether or not on a backing; finishing ceramics' => 'Leaca ceirmeacha agus pábháil, tíleanna teallaigh nó balla; ciúbanna ceirmeacha mósáice nó a leithéidí, bíodh taca fúthu nó ná bíodh; táirgí ceirmeacha chun bailchríche',
    'Ceramic wares for laboratory, chemical or other technical uses; ceramic troughs, tubs and similar receptacles of a kind used in agriculture; ceramic pots, jars and similar articles of a kind used for the conveyance or packing of goods' => 'Earraí ceirmeacha le húsáid sa tsaotharlann, go ceimiceach nó go teicniúil ar bhealaí eile; umair cheirmeacha, tobáin agus gabhdáin cheirmeacha chomhchosúla a úsáidtear sa talmhaíocht; potaí, crúscaí agus earraí ceirmeacha comhchosúla a úsáidtear chun earraí a iompar nó a phacáil',
    'Ceramic sinks, washbasins, washbasin pedestals, baths, bidets, water closet pans, flushing cisterns, urinals and similar sanitary fixtures' => 'Doirtil, báisíní níocháin, seastáin báisíní níocháin, folcadáin, bidets, soithí leithris, sistéil sruthlaithe, fualáin cheirmeacha agus daingneáin sláintíochta chomhchosúla',
    'Tableware, kitchenware, other household articles and toilet articles, of porcelain or china' => 'Earraí boird, earraí cistine, earraí teaghlaigh eile agus earraí ionlainne, déanta as poirceallán nó cré shíneach',
    'Statuettes and other ornamental ceramic articles' => 'Deilbhíní agus earraí ceirmeacha ornáideacha eile',
    'Other ceramic articles' => 'Earraí ceirmeacha eile',
    'Cullet and other waste and scrap of glass, excluding glass from cathode-ray tubes or other activated glass of heading 8549; glass in the mass' => 'Cuilléid agus fuíollábhar gloine agus dramhghloine, seachas gloine as feadáin gha-chatóideacha nó gloine ghníomhachtaithe eile faoi cheannteideal 8549; gloine sa mhais',
    'Glass in balls (other than microspheres of heading 7018), rods or tubes, unworked' => 'Gloine i liathróidí (seachas micrisféir faoi cheannteideal 7018) slata nó feadáin, neamhshaoirsithe',
    'Cast glass and rolled glass, in sheets or profiles, whether or not having an absorbent, reflecting or non-reflecting layer, but not otherwise worked' => 'Gloine theilgthe agus gloine rollta, ina leatháin nó ina bpróifílí, bíodh brat ionsúiteach, frithchaiteach nó neamh-fhrithchaiteach léi nó ná bíodh, ach í neamhshaoirsithe seachas sin',
    'Drawn glass and blown glass, in sheets, whether or not having an absorbent, reflecting or non-reflecting layer, but not otherwise worked' => 'Gloine tharraingthe agus gloine shéidte, ina leatháin nó ina bpróifílí, bíodh brat ionsúiteach, frithchaiteach nó neamh-fhrithchaiteach léi nó ná bíodh, ach í neamhshaoirsithe seachas sin',
    'Float glass and surface ground or polished glass, in sheets, whether or not having an absorbent, reflecting or non-reflecting layer, but not otherwise worked' => 'Gloine ar snámh agus gloine snoite nó snasta, ina leatháin nó ina bpróifílí, bíodh brat ionsúiteach, frithchaiteach nó neamh-fhrithchaiteach léi nó ná bíodh, ach í neamhshaoirsithe seachas sin',
    'Glass of heading 7003, 7004 or 7005, bent, edge-worked, engraved, drilled, enamelled or otherwise worked, but not framed or fitted with other materials' => 'Gloine faoi cheannteidil 7003, 7004 nó 7005, í lúbtha, an chiumhais saoirsithe inti, í greanta, druileáilte, cruanta nó saoirsithe ar bhealach eile, ach gan fráma uirthi ná í feistithe le hábhair eile',
    'Safety glass, consisting of toughened (tempered) or laminated glass' => 'Gloine sábháilteachta, déanta as gloine threisithe (fhaghartha) nó as gloine lannach',
    'Multiple-walled insulating units of glass' => 'Aonaid gloine ilbhallaí le haghaidh insliúcháin',
    'Glass mirrors, whether or not framed, including rear-view mirrors' => 'Scátháin ghloine, bídís i bhfráma nó ná bídís, lena n-áirítear scátháin chúlfhéachana',
    'Carboys, bottles, flasks, jars, pots, phials, ampoules and other containers, of glass, of a kind used for the conveyance or packing of goods; preserving jars of glass; stoppers, lids and other closures, of glass' => 'Carbáigh, buidéil, fleascáin, crúscaí, potaí, fiala, ampaill agus coimeádáin eile, atá déanta as gloine, de chineál a úsáidtear chun earraí a iompar nó a phacáil; crúscaí caomhnúcháin atá déanta as gloine; stopalláin, claibíní agus cláir eile atá déanta as gloine',
    'Glass envelopes (including bulbs and tubes), open, and glass parts thereof, without fittings, for electric lamps and light sources, cathode-ray tubes or the like' => 'Imchlúdaigh gloine (lena n-áirítear bolgáin agus feadáin), oscailte, agus codanna gloine díobh sin, gan feistis, le haghaidh lampaí leictreacha, feadáin gha-chatóideacha nó a leithéid',
    'Glassware of a kind used for table, kitchen, toilet, office, indoor decoration or similar purposes (other than that of heading 7010 or 7018)' => 'Earraí gloine den chineál a úsáidtear ag an mbord, sa chistin, sa leithreas, san oifig, i gcomhair maisiúchán inmheánach nó chun críoch comhchosúil (seachas earraí atá faoi cheannteideal 7010 nó 7018)',
    'Clock or watch glasses and similar glasses, glasses for non-corrective or corrective spectacles, curved, bent, hollowed or the like, not optically worked; hollow glass spheres and their segments, for the manufacture of such glasses' => 'Gloiní cloig nó uaireadóirí agus gloiní comhchosúla, gloiní do spéaclaí neamhcheartúcháin nó ceartúcháin, iad cuartha, lúbtha, tollta agus mar sin de, gan iad saoirsithe ó thaobh na hoptaice de; tollsféir gloine agus a gcuid deighleoga, do mhonarú gloiní den sórt sin',
    'Paving blocks, slabs, bricks, squares, tiles and other articles of pressed or moulded glass, whether or not wired, of a kind used for building or construction purposes; glass cubes and other glass smallwares, whether or not on a backing, for mosaics or similar decorative purposes; leaded lights and the like; multicellular or foam glass in blocks, panels, plates, shells or similar forms' => 'Bloic pábhála, leaca, brící, cearnóga, tíleanna agus earraí eile déanta as gloine bhrúite nó mhúnlaithe, bíodh sí sreangaithe nó ná bíodh, den chineál a úsáidtear chun foirgníochta nó tógála; ciúbanna gloine agus mionearraí gloine eile, bíodh taca fúthu nó ná bíodh, le haghaidh mósáice nó chun críocha maisiúcháin comhchosúla; soilse luaidhe agus a leithéid; gloine ilcheallach nó chúrtha ina bloic, ina painéil, ina plátaí, ina blaoscanna nó i bhfoirmeacha comhchosúla',
    'Laboratory, hygienic or pharmaceutical glassware, whether or not graduated or calibrated' => 'Earraí gloine saotharlainne, sláinteachais nó cógaisíochta, bídís grádaithe nó calabraithe nó ná bíodh',
    'Glass beads, imitation pearls, imitation precious or semi-precious stones and similar glass smallwares, and articles thereof other than imitation jewellery; glass eyes other than prosthetic articles; statuettes and other ornaments of lamp-worked glass, other than imitation jewellery; glass microspheres not exceeding 1 mm in diameter' => 'Coirníní gloine, péarlaí bréige, clocha lómhara agus scothlómhara tacair agus mionearraí gloine comhchosúla, agus earraí déanta astu sin seachas seodra bréige; súile gloine seachas earraí próistéiteacha; deilbhíní agus ornáidí eile déanta as gloine saoirsithe de lampa, seachas seodra bréige; micrisféir gloine nach mó ná 1 mm an trastomhas atá iontu',
    'Glass fibres (including glass wool) and articles thereof (for example, yarn, rovings, woven fabrics)' => 'Snáithíní gloine (lena n-áirítear olann ghloine) agus earraí déanta astu sin (mar shampla, snáth, fabraicí fite)',
    'Other articles of glass' => 'Earraí eile gloine',
    'Pearls, natural or cultured, whether or not worked or graded but not strung, mounted or set; pearls, natural or cultured, temporarily strung for convenience of transport' => 'Péarlaí nádúrtha nó péarlaí saothraithe, bídís saoirsithe nó ná bíodh, bídís grádaithe nó ná bíodh, ach nach péarlaí ar shreang, péarlaí suite ná péarlaí buailte iad; péarlaí nádúrtha nó péarlaí saothraithe agus iad ar shreang go sealadach i gcomhair a n-iompartha',
    'Diamonds, whether or not worked, but not mounted or set' => 'Diamaint shaoirsithe nó diamaint neamhshaoirsithe, ach nach diamaint atá suite ná buailte iad',
    'Precious stones (other than diamonds) and semi-precious stones, whether or not worked or graded but not strung, mounted or set; ungraded precious stones (other than diamonds) and semi-precious stones, temporarily strung for convenience of transport' => 'Cloch lómhara (seachas diamaint) agus clocha scothlómhara, bídís saoirsithe nó neamhshaoirsithe nó grádaithe nó na bíodh ach gan iad curtha ar shreang, gan iad suite ná buailte; clocha lómhara neamhgrádaithe (seachas diamaint) agus clocha scothlómhara, agus iad ar shreang go sealadach i gcomhair a n-iompartha',
    'Synthetic or reconstructed precious or semi-precious stones, whether or not worked or graded but not strung, mounted or set; ungraded synthetic or reconstructed precious or semi-precious stones, temporarily strung for convenience of transport' => 'Clocha lómhara nó clocha scothlómhara sintéiseacha nó athdhéanta, iad saoirsithe nó neamhshaoirsithe, grádaithe nó neamhghrádaithe ach gan iad curtha ar shreang, agus gan iad suite ná buailte; clocha lómhara nó clocha scothlómhara neamhghrádaithe, sintéiseacha nó athdhéanta, agus iad curtha ar shreang go sealadach i gcomhair a n-iompartha',
    'Dust and powder of natural or synthetic precious or semi-precious stones' => 'Deannach agus púdar clocha lómhara agus clocha scothlómhara nádúrtha agus sintéiseacha',
    'Silver (including silver plated with gold or platinum), unwrought or in semi-manufactured forms, or in powder form' => 'Airgead (lena n-áirítear airgead atá plátáilte le hór nó le platanam), é neamhshaoirsithe nó i bhfoirmeacha leathmhonaraithe, sin nó ina phúdar',
    'Gold (including gold plated with platinum), unwrought or in semi-manufactured forms, or in powder form' => 'Ór (lena n-áirítear ór atá plátáilte le platanam), é neamhshaoirsithe, nó é i bhfoirmeacha leathmhonaraithe, nó i bhfoirm púdair',
    'Platinum, unwrought or in semi-manufactured forms, or in powder form' => 'Platanam, é neamhshaoirsithe nó i bhfoirmeacha leathmhonaraithe, nó é ina phúdar',
    'Waste and scrap of precious metal or of metal clad with precious metal; other waste and scrap containing precious metal or precious-metal compounds, of a kind used principally for the recovery of precious metal other than goods of heading 8549' => 'Fuíoll agus dramhaíl déanta as miotal lómhar nó as miotal cumhdaithe le miotal lómhar; fuíoll agus dramhaíl eile ina bhfuil miotal lómhar nó comhdhúile de mhiotail lómhara de chineál a úsáidtear go príomha chun miotal lómhar a athghnóthú seachas na hearraí atá faoi cheannteideal 8549',
    'Articles of jewellery and parts thereof, of precious metal or of metal clad with precious metal' => 'Earraí seodra agus páirteanna díobh, agus páirteanna de mhiotal lómhar nó de mhiotal atá cumhdaithe le miotal lómhar',
    'Articles of goldsmiths\' or silversmiths\' wares and parts thereof, of precious metal or of metal clad with precious metal' => 'Earraí gaibhne óir nó gaibhne geala agus codanna díobh, déanta as miotal lómhar nó as miotal cumhdaithe le miotal lómhar',
    'Other articles of precious metal or of metal clad with precious metal' => 'Earraí eile déanta as miotal lómhar nó as miotal cumhdaithe le miotal lómhar',
    'Articles of natural or cultured pearls, precious or semi-precious stones (natural, synthetic or reconstructed)' => 'Earraí déanta as péarlaí nádúrtha nó saothraithe, clocha lómhara nó leathlómhara (nádúrtha, sintéiseach nó athdhéanta)',
    'Imitation jewellery' => 'Seodra bréige',
    'Coin' => 'Boinn',
    'Pig iron and spiegeleisen in pigs, blocks or other primary forms' => 'Muciarann agus spiegeleisen ina mhuc-bharraí, ina bhloic nó i bhfoirmeacha príomhúla eile',
    'Ferro-alloys' => 'Fearó-chóimhiotail',
