    'Ferrous waste and scrap; remelting scrap ingots of iron or steel' => 'Fuíollábhar iarainn agus dramhiarann; athleá ar dhramhuingí iarainn agus cruach',
    'Granules and powders, of pig iron, spiegeleisen, iron or steel' => 'Gráiníní agus púdair de mhuciarann, spiegeleisen, d’iarann nó de chruach',
    'Iron and non-alloy steel in ingots or other primary forms (excluding iron of heading 7203)' => 'Iarann agus cruach nach cóimhiotal í in uingí nó foirmeacha príomhúla eile (seachas iarann faoi cheannteideal 7203)',
    'Semi-finished products of iron or non-alloy steel' => 'Táirgí leathchríochnaithe d’iarann agus de chruach neamh-chóimhiotail',
