    'Flat-rolled products of iron or non-alloy steel, of a width of 600 mm or more, cold-rolled (cold-reduced), not clad, plated or coated' => 'Táirgí cothromrollta d’iarann nó de ruach neamh-chóimhiotail, ar leithead 600 mm nó níos mó, fuar-rollta (fuarlaghdaithe), nach bhfuil cumhdaithe, plátáilte, ná brataithe',
    'Flat-rolled products of iron or non-alloy steel, of a width of 600 mm or more, clad, plated or coated' => 'Táirgí cothromrollta d’iarann nó de chruach neamh-chóimhiotail, ar leithead 600 mm nó níos mó, cumhdaithe, plátáilte nó brataithe',
    'Flat-rolled products of iron or non-alloy steel, of a width of less than 600 mm, not clad, plated or coated' => 'Táirgí cothromrollta d’iarann nó de chruach neamh-chóimhiotail, ar leithead 600 mm, nach bhfuil cumhdaithe, plátáilte, ná brataithe',
    'Flat-rolled products of iron or non-alloy steel, of a width of less than 600 mm, clad, plated or coated' => 'Táirgí cothromrollta d’iarann nó de chruach neamh-chóimhiotail, ar leithead 600 mm, cumhdaithe, plátáilte nó brataithe',
    'Bars and rods, hot-rolled, in irregularly wound coils, of iron or non-alloy steel' => 'Barraí agus slata, iad teo-rollta, iad ina gcornaí arb é an casadh mírialta atá iontu, iad déanta as iarann nó as cruach neamh-chóimhiotail',
    'Other bars and rods of iron or non-alloy steel, not further worked than forged, hot-rolled, hot-drawn or hot-extruded, but including those twisted after rolling' => 'Barraí agus slata eile déanta as iarann nó as cruach neamh-chóimhiotail, iad gaibhnithe, teo-rollta, teo-tharraingthe nó teo-easbhrúite, agus gan aon saoirsiú thairis sin déanta orthu, lena n-áirítear an chuid a gcuirtear casadh iontu tar éis a rollta',
    'Other bars and rods of iron or non-alloy steel' => 'Barraí agus slata eile déanta as iarann nó as cruach neamh-chóimhiotail',
    'Angles, shapes and sections of iron or non-alloy steel' => 'Uillinneacha, cruthanna agus cónaisc déanta as iarann nó as cruach neamh-chóimhiotail',
