    'Stainless steel in ingots or other primary forms; semi-finished products of stainless steel' => 'Cruach dhomheirgthe in uingí nó foirmeacha príomhúla eile; táirgí leathchríochnaithe cruach dosmálta',
    'Flat-rolled products of stainless steel, of a width of 600 mm or more' => 'Táirgí cothromrollta cruach dosmálta, ar leithead 600 mm nó níos mó',
    'Flat-rolled products of stainless steel, of a width of less than 600 mm' => 'Táirgí cothromrollta cruach dosmálta, ar leithead níos lú ná 600 mm',
    'Other bars and rods of stainless steel; angles, shapes and sections of stainless steel' => 'Barraí agus slata eile as cruach dhomheirgthe; uillinneacha, cruthanna agus cónaisc déanta as cruach dhomheirgthe',
    'Other alloy steel in ingots or other primary forms; semi-finished products of other alloy steel' => 'Cruach chóimhiotail eile in uingí nó foirmeacha príomhúla eile; earraí leathchríochnaithe de chruach chóimhiotail eile',
    'Flat-rolled products of other alloy steel, of a width of 600 mm or more' => 'Táirgí cothromrollta cruach cóimhiotail eile, ar leithead 600 mm nó níos mó',
    'Flat-rolled products of other alloy steel, of a width of less than 600 mm' => 'Táirgí cothromrollta cruach cóimhiotail eile, ar leithead níos lú ná 600 mm',
    'Bars and rods, hot-rolled, in irregularly wound coils, of other alloy steel' => 'Barraí agus slata, iad teo-rollta, iad ina gcornaí atá corntha go mírialta, iad déanta as cruach chóimhiotail de chineál eile',
    'Other bars and rods of other alloy steel; angles, shapes and sections, of other alloy steel; hollow drill bars and rods, of alloy or non-alloy steel' => 'Barraí agus slata eile déanta as cruach chóimhiotail eile; uillinneacha, cruthanna agus cónaisc, iad déanta as cruach chóimhiotail eile; barraí agus slata druilire tolla, iad déanta as cruach chóimhiotail agus neamh-chóimhiotail',
    'Wire of other alloy steel' => 'Sreang agus é déanta as cruach cóimhiotail de chineál eile',
    'Sheet piling of iron or steel, whether or not drilled, punched or made from assembled elements; welded angles, shapes and sections, of iron or steel' => 'Bratphíleáil iarainn nó cruach, bídís druileáilte nó pollta, bídís déanta as nithe cóimeáilte nó ná bíodh; uillinneacha, cruthanna agus cónaisc agus táthú déanta orthu, iad déanta as iarann nó as cruach',
