    'Tubes, pipes and hollow profiles, of cast iron' => 'Feadáin, píobáin agus próifílí tolla déanta as iarann teilgthe',
    'Tubes, pipes and hollow profiles, seamless, of iron (other than cast iron) or steel' => 'Feadáin, píobáin agus próifílí tolla gan uaim, iad déanta as cruach nó as iarann (seachas iarann teilgthe)',
    'Other tubes and pipes (for example, welded, riveted or similarly closed), having circular cross-sections, the external diameter of which exceeds 406,4 mm, of iron or steel' => 'Feadáin agus píobáin eile (iad táite, mar shampla, sin nó iad seamaithe nó dúnta ar bhealach eile den chineál sin), arb é an trasghearradh ciorclach atá iontu, iad níos mó ná 406,4 mm ar an trastomhas seachtrach, agus iad déanta as iarann nó cruach',
    'Other tubes, pipes and hollow profiles (for example, open seam or welded, riveted or similarly closed), of iron or steel' => 'Feadáin, píobáin agus próifílí tolla eile atá déanta as iarann nó cruach (a bhfuil a séama oscailte nó táthaithe, iad séamaithe nó dúnta ar bhealach eile den chineál sin, mar shampla)',
    'Tube or pipe fittings (for example, couplings, elbows, sleeves), of iron or steel' => 'Feistis feadáin nó píobáin (mar shampla, cúplálacha, uillinneacha, muinchillí) agus iad déanta as iarann nó as cruach',
    'Structures (excluding prefabricated buildings of heading 9406) and parts of structures (for example, bridges and bridge-sections, lock-gates, towers, lattice masts, roofs, roofing frameworks, doors and windows and their frames and thresholds for doors, shutters, balustrades, pillars and columns), of iron or steel; plates, rods, angles, shapes, sections, tubes and the like, prepared for use in structures, of iron or steel' => 'Struchtúir (foirgnimh réamhdhéanta faoi cheannteideal 9406 agus codanna d\'fhoirgnimh as iarann nó as cruach (mar shampla, droichid agus codanna droichid, geataí loic, túir, crainn laitíse, díonta, creatlacha dín, doirse agus fuinneoga agus a bhfrámaí mar aon le tairseacha doirse, comhlaí, balastráidí, piléir, colúin); plátaí, slata, uillinneacha, cruthanna, cónaisc, feadáin agus a leithéidí, arna n-ullmhú lena n-úsáid i bhfoirgnimh iarainn nó chruach',
    'Reservoirs, tanks, vats and similar containers for any material (other than compressed or liquefied gas), of iron or steel, of a capacity exceeding 300 l, whether or not lined or heat-insulated, but not fitted with mechanical or thermal equipment' => 'Taiscumair, umair, dabhcha agus taisceadáin eile den chineál sin, iad déanta as iarann nó as cruach, le haghaidh aon ábhair (seachas gás comhbhrúite nó leachtaithe), a bhfuil toilleadh is mó ná 300 l iontu, bídís línithe nó inslithe in aghaidh teasa nó ná bíodh, ach nach bhfuil trealamh meicniúil ná teirmeach feistithe orthu',
    'Tanks, casks, drums, cans, boxes and similar containers, for any material (other than compressed or liquefied gas), of iron or steel, of a capacity not exceeding 300 l, whether or not lined or heat-insulated, but not fitted with mechanical or thermal equipment' => 'Umair, bairillí, drumaí, cannaí, boscaí agus taisceadáin eile den chineál céanna, iad déanta as iarann nó as cruach, le haghaidh aon ábhair (seachas gás comhbhrúite nó leachtaithe), a bhfuil toilleadh iontu nach mó ná 300 l, bídís línithe nó inslithe in aghaidh teasa nó ná bíodh, ach nach bhfuil trealamh meicniúil ná teirmeach feistithe orthu',
    'Containers for compressed or liquefied gas, of iron or steel' => 'Taisceadáin le haghaidh gás comhbhrúite nó leachtaithe agus iad déanta as iarann nó as cruach',
    'Stranded wire, ropes, cables, plaited bands, slings and the like, of iron or steel, not electrically insulated' => 'Sreang dhualach, rópaí, cáblaí, bandaí trilseacha, crocháin agus a leithéid, iad déanta as iarann nó as cruach, gan iad inslithe go leictreach',
    'Cloth (including endless bands), grill, netting and fencing, of iron or steel wire; expanded metal of iron or steel' => 'Éadach (lena n-áirítear bandaí éigríochta), greille, líontán agus fálta, iad déanta as sreang iarainn nó sreang chruach; Earraí eile déanta as iarann nó cruach',
    'Chain and parts thereof, of iron or steel' => 'Slabhra agus codanna de, déanta as iarann nó as cruach',
    'Nails, tacks, drawing pins, corrugated nails, staples (other than those of heading 8305) and similar articles, of iron or steel, whether or not with heads of other material, but excluding such articles with heads of copper' => 'Tairní, greamanna, bioráin ordóige, tairní rocacha, stáplaí (gan na cinn atá faoi cheannteideal 8305 a áireamh) agus earraí eile den chineál sin, iad déanta as iarann nó as cruach, bíodh cnogaí ó ábhar eile orthu nó ná bíodh, agus gan earraí a bhfuil cnogaí copair orthu a áireamh',
    'Screws, bolts, nuts, coach screws, screw hooks, rivets, cotters, cotter pins, washers (including spring washers) and similar articles, of iron or steel' => 'Scriúnna, boltaí, cnónna, scriúnna cóiste, crúcaí scriú, seamanna, leicníní, pionnaí leicnín, leicneáin (lena n-áirítear leicneáin ar sprionga) agus earraí den chineál céanna, iad déanta as iarann nó as cruach',
    'Sewing needles, knitting needles, bodkins, crochet hooks, embroidery stilettos and similar articles, for use in the hand, of iron or steel; safety pins and other pins of iron or steel, not elsewhere specified or included' => 'Snáthaidí fuála, bioráin chniotála, bóidicíní, crúcaí cróise, bioráin bhróidnéireachta agus earraí eile den chineál céanna, lena n-úsáid de láimh, iad déanta as iarann nó as cruach; bioráin bhróidnéireachta agus earraí eile den chineál céanna, lena n-úsáid de láimh, iad déanta as iarann nó as cruach; rudaí nach bhfuil luaite go sonrach ná curtha san áireamh in áit eile',
    'Springs and leaves for springs, of iron or steel' => 'Spriongaí agus lannóga sprionga déanta as iarann nó as cruach',
    'Stoves, ranges, grates, cookers (including those with subsidiary boilers for central heating), barbecues, braziers, gas rings, plate warmers and similar non-electric domestic appliances, and parts thereof, of iron or steel' => 'Soirn, grátaí, cócaireáin (lena n-áirítear na cinn a bhfuil fo-choirí acu le haghaidh téamh lárnach), fulachtaí, ciseáin tine, fáinní gáis, téiteoirí plátaí agus fearais tí neamhleictreacha den chineál céanna, agus codanna díobh, déanta as iarann nó as cruach',
    'Radiators for central heating, not electrically heated, and parts thereof, of iron or steel; air heaters and hot-air distributors (including distributors which can also distribute fresh or conditioned air), not electrically heated, incorporating a motor-driven fan or blower, and parts thereof, of iron or steel' => 'Radaitheoirí le haghaidh téamh lárnach, gan iad téite go leictreach, agus codanna de na radaitheoirí sin, iad déanta as iarann nó as cruach; téiteoirí aeir agus dáileoirí aeir the (lena n-áirítear dáileoirí lenar féidir aer úr nó aer cóirithe a dháileadh freisin), gan iad téite go leictreach, ina bhfuil fean nó séidire ar inneall, agus codanna díobh sin, iad déanta as iarann nó as cruach',
    'Table, kitchen or other household articles and parts thereof, of iron or steel; iron or steel wool; pot scourers and scouring or polishing pads, gloves and the like, of iron or steel' => 'Earraí cistine, earraí tís, nó earraí i gcomhair an bhoird, agus codanna de na hearraí sin, iad déanta as iarann nó as cruach; olann iarainn nó chruach; ábhar sciúrtha potaí, nó pillíní snasa, miotóga agus a leithéid sin, iad déanta as iarann nó as cruach',
    'Sanitary ware and parts thereof, of iron or steel' => 'Earraí sláintíochta agus codanna de na hearraí sin, iad déanta as iarann nó as cruach',
