    'Table, kitchen or other household articles and parts thereof, of copper; pot scourers and scouring or polishing pads, gloves and the like, of copper; sanitary ware and parts thereof, of copper' => 'Earraí cistine, earraí tís, nó earraí i gcomhair an bhoird, agus codanna de na hearraí sin, iad déanta as copar; ábhar sciúrtha potaí, nó pillíní snasa, miotóga agus a leithéid sin, iad déanta as copar; earraí sláintíochta agus codanna díobh, iad déanta as copar',
    'Other articles of copper' => 'Earraí copair eile',
