    'Aluminium wire' => 'Sreang alúmanaim',
    'Aluminium plates, sheets and strip, of a thickness exceeding 0,2 mm' => 'Plátaí, leatháin agus stiallacha alúmanaim, atá níos mó ná 0,2 mm ar tiús',
    'Aluminium foil (whether or not printed or backed with paper, paperboard, plastics or similar backing materials) of a thickness (excluding any backing) not exceeding 0,2 mm' => 'Scragall alúmanaim (bíodh sé priontáilte nó bíodh páipéar, cairtchlár, plaistigh nó ábhar taca comhchosúil ar a chúl nó ná bíodh), nach mó bhfuil níos mó ná 0,2 mm ar tiús (gan aon ábhar taca a áireamh)',
    'Aluminium tubes and pipes' => 'Feadáin agus píobáin alúmanaim',
    'Aluminium structures (excluding prefabricated buildings of heading 9406) and parts of structures (for example, bridges and bridge-sections, towers, lattice masts, roofs, roofing frameworks, doors and windows and their frames and thresholds for doors, balustrades, pillars and columns); aluminium plates, rods, profiles, tubes and the like, prepared for use in structures' => 'Struchtúir (gan foirgnimh réamhdhéanta atá faoi cheannteideal 9406a áireamh) agus codanna de struchtúir (mar shampla, droichid agus codanna de dhroichid, geataí loic, túir, crainn laitíse, díonta, creatlacha dín, doirse agus fuinneoga agus na frámaí a théann leo, mar aon le tairseacha dorais, dallóga, balastráidí, piléir agus colúin); plátaí alúmanaim, slata, próifílí, feadáin agus a leithéid sin agus iad ullmhaithe le húsáid i struchtúir',
    'Aluminium casks, drums, cans, boxes and similar containers (including rigid or collapsible tubular containers), for any material (other than compressed or liquefied gas), of a capacity not exceeding 300 litres, whether or not lined or heat-insulated, but not fitted with mechanical or thermal equipment' => 'Bairillí, drumaí, cannaí, boscaí agus taisceadáin chomhchosúla (lena n-áirítear taisceadáin fheadánacha righne nó infhillte) agus iad déanta as alúmanam, le haghaidh aon ábhar (seachas gás comhbhrúite nó leachtaithe), a bhfuil toilleadh iontu nach mó ná 300 lítear, bídís línithe nó inslithe in aghaidh teasa nó ná bíodh, ach gan trealamh meicniúil ná teirmeach feistithe orthu',
    'Stranded wire, cables, plaited bands and the like, of aluminium, not electrically insulated' => 'Sreang dhualach, cáblaí, bandaí trilseach agus a leithéid, iad déanta as alúmanam, gan insliú leictreach orthu',
    'Table, kitchen or other household articles and parts thereof, of aluminium; pot scourers and scouring or polishing pads, gloves and the like, of aluminium; sanitary ware and parts thereof, of aluminium' => 'Earraí cistine, earraí tís, nó earraí i gcomhair an bhoird, agus codanna de na hearraí sin, iad déanta as alúmanam; ábhar sciúrtha potaí, nó pillíní snasa, miotóga agus a leithéid sin, iad déanta as alúmanam; earraí sláintíochta agus codanna díobh, iad déanta as alúmanam',
    'Other articles of aluminium' => 'Earraí alúmanaim eile',
    'Unwrought lead' => 'Luaidhe neamhshaoirsithe',
    'Lead plates, sheets, strip and foil; lead powders and flakes' => 'Plátaí agus leatháin luaidhe, stiallacha agus duilleoga luaidhe; púdair agus calóga luaidhe',
