    'Tantalum and articles thereof, including waste and scrap' => 'Tantalam agus earraí tantalaim, lena n-áirítear fuíoll agus dramhaíl',
    'Magnesium and articles thereof, including waste and scrap' => 'Maignéisiam agus earraí maignéisiam, lena n-áirítear fuíoll agus dramhaíl',
    'Cobalt mattes and other intermediate products of cobalt metallurgy; cobalt and articles thereof, including waste and scrap' => 'Maití cóbailt agus táirgí idirmheánacha eile de mhiotalóireacht chóbailt; cóbailt agus earraí déanta as cóbalt, fuíoll agus dramhaíl san áireamh',
    'Bismuth and articles thereof, including waste and scrap' => 'Biosmat agus earraí biosmait, lena n-áirítear fuíoll agus dramhaíl',
    'Titanium and articles thereof, including waste and scrap' => 'Tíotáiniam agus earraí tíotáiniam, lena n-áirítear fuíoll agus dramhaíl',
    'Zirconium and articles thereof, including waste and scrap' => 'Siorcóiniam agus earraí siorcóiniam, lena n-áirítear an fuíoll agus an dramhaíl',
    'Antimony and articles thereof, including waste and scrap' => 'Antamón agus earraí antamóin, lena n-áirítear fuíoll agus dramhaíl',
    'Manganese and articles thereof, including waste and scrap' => 'Mangainéis agus earraí mangainéise, lena n-áirítear fuíoll agus dramhaíl',
    'Beryllium, chromium, hafnium, rhenium, thallium, cadmium, germanium, vanadium, gallium, indium and niobium (columbium), and articles of these metals, including waste and scrap' => 'Beirilliam, cróimiam, haifniam, réiniam, tailliam, caidmiam, gearmáiniam, vanaidiam, gailliam, indiam agus niaibiam (colaimbiam), agus earraí atá déanta as na miotail sin, lena n-áirítear fuíoll agus dramhaíl',
    'Cermets and articles thereof, including waste and scrap' => 'Ceirméid agus earraí ceirméad, lena n-áirítear fuíoll agus dramhaíl',
    'Hand tools, the following' => 'spades, shovels, mattocks, picks, hoes, forks and rakes; axes, billhooks and similar hewing tools; secateurs and pruners of any kind; scythes, sickles, hay knives, hedge shears, timber wedges and other tools of a kind used in agriculture, horticulture or forestry\': \'Uirlisí láimhe, iad seo a leanas: rámhainní, sluaiste, matóga, piocóidí, grafóga, graeipí agus rácaí; tuanna, bileoga agus uirlisí comhchosúla chun teasctha agus chun bainte; deimheas crann agus prúnairí de chineál ar bith; speala, corráin, sceana féir, deimhis le sceacha a bhearradh, dingeacha adhmaid agus uirlisí eile de chineál a úsáidtear sa talmhaíocht, sa ghairneoireacht, nó sa choillteoireacht',
    'Handsaws; blades for saws of all kinds (including slitting, slotting or toothless saw blades)' => 'Sábha láimhe; lanna i gcomhair sábha de gach cineál (lena n-áirítear lanna do shábha scáinte, sliotán nó míne)',
    'Files, rasps, pliers (including cutting pliers), pincers, tweezers, metal-cutting shears, pipe-cutters, bolt croppers, perforating punches and similar hand tools' => 'Líomháin, raspaí, greamairí (lena n-áirítear greamairí gearrtha), pionsúir, pionsúiríní, deimheas miotail, gearrthóirí píobán, bearrthóirí boltaí, pollairí agus uirlisí láimhe dá leithéid',
    'Hand-operated spanners and wrenches (including torque meter wrenches but not including tap wrenches); interchangeable spanner sockets, with or without handles' => 'Castairí agus rinsí lámhoibrithe (lena n-áirítear rinsí torcmhéadair, ach gan rinsí tapa san áireamh); soicéid chastaire inmhalartaithe, bíodh hanlaí orthu nó ná bíodh',
    'Hand tools (including glaziers\' diamonds), not elsewhere specified or included; blowlamps; vices, clamps and the like, other than accessories for and parts of machine-tools or water-jet cutting machines; anvils; portable forges; hand- or pedal-operated grinding wheels with frameworks' => 'Uirlisí láimhe (lena n-áirítear diamaint na ngloineadóirí), nach bhfuil sonraithe ná san áireamh in aon áit eile; séidlampaí; bíseanna, clampaí agus a leithéid, seachas gabháltais uirlisí meaisín agus comhpháirteanna díobh nó meaisíní scairdtrinseála; inneonacha; ceártaí so-iompartha; rothaí meilte a oibrítear de láimh nó de chois agus a bhfuil creatlacha orthu',
    'Interchangeable tools for hand tools, whether or not power-operated, or for machine tools (for example, for pressing, stamping, punching, tapping, threading, drilling, boring, broaching, milling, turning or screw driving), including dies for drawing or extruding metal, and rock-drilling or earth-boring tools' => 'Uirlisí inmhalartaithe le haghaidh uirlisí láimhe, bídís cumhachtoibrithe nó ná bíodh, nó le haghaidh meaisín-uirlisí (le haghaidh brú, stampáil, puinseáil, tapáil, snáithiú, druileáil, tolladh, bróisteáil, muilleáil, deileadóireacht nó tiomáint scriúnna), lena n-áirítear díslí le haghaidh miotal a tharraingt nó a easbhrú, agus uirlisí chun clocha a dhruileáil agus an talamh a tholladh',
    'Knives and cutting blades, for machines or for mechanical appliances' => 'Sceana agus lanna gearrtha, do mheaisíní nó d\'fhearais mheicniúla',
    'Plates, sticks, tips and the like for tools, unmounted, of cermets' => 'Plátaí, maidí, soic agus a leithéid le haghaidh uirlisí, nach bhfuil suite, as ceirméid',
    'Knives with cutting blades, serrated or not (including pruning knives), other than knives of heading 8208, and blades therefor' => 'Sceana agus lanna gearrtha, bídís fiaclach nó ná bíodh (lena n-áirítear sceana prúnála), seachas sceana atá faoi cheannteideal 8208, agus na lanna a bhíonn orthu',
    'Razors and razor blades (including razor blade blanks in strips)' => 'Rásúir agus lanna rásúir (lena n-áirítear lanna caocha rásúir ina stiallacha)',
    'Other articles of cutlery (for example, hair clippers, butchers\' or kitchen cleavers, choppers and mincing knives, paperknives); manicure or pedicure sets and instruments (including nail files)' => 'Earraí sceana eile (mar shampla: gléasanna bearrtha gruaige, scoiltirí búistéara nó cistine, mionghearrthóirí agus sceana mionaithe, sceana gearrtha páipéir); uirlisí nó tacair uirlisí i gcomhair mhaisiú na lámh nó na gcos (uirlisí i gcomhair líomhadh na n-ingne san áireamh)',
    'Spoons, forks, ladles, skimmers, cake-servers, fish-knives, butter-knives, sugar tongs and similar kitchen or tableware' => 'Spúnóga, forcanna, liacha, scimíní, tráidirí cácaí, sceana éisc, sceana ime, tlúnna siúcra agus earraí boird nó cistine dá leithéid',
    'Padlocks and locks (key, combination or electrically operated), of base metal; clasps and frames with clasps, incorporating locks, of base metal; keys for any of the foregoing articles, of base metal' => 'Glais fraincín agus glais (a osclaítear le heochair, le sraith siombailí nó go leictreach), iad déanta as táirmhiotal; claspaí nó frámaí a bhfuil claspaí orthu, agus glas mar chuid díobh, iad déanta as táirmhiotal; eochracha i gcomhair ceann ar bith de na nithe thuasluaite, iad déanta as táirmhiotal',
    'Base-metal mountings, fittings and similar articles suitable for furniture, doors, staircases, windows, blinds, coachwork, saddlery, trunks, chests, caskets or the like; base-metal hat-racks, hat-pegs, brackets and similar fixtures; castors with mountings of base metal; automatic door closers of base metal' => 'Gléasadh, feistis agus earraí comhchosúla, iad déanta as táirmhiotal, agus iad atá oiriúnach do throscán agus doirse, do staighrí agus fuinneoga, do dhallóga agus obair chóiste, do dhiallatra, do thruncaí, do chófraí, do chisteoga agus dá leithéid; racaí i gcomhair hataí, crúcaí hataí, lúba agus feistí comhchosúla, iad déanta as táirmhiotal; roithlíní agus gléasadh orthu, iad déanta as táirmhiotal; gléasanna dúnta dorais uathoibríocha, iad déanta as táirmhiotal',
    'Armoured or reinforced safes, strongboxes and doors and safe deposit lockers for strong-rooms, cash or deed boxes and the like, of base metal' => 'Taisceadáin, cófraí daingne, doirse agus locair slántaisce atá armúrtha nó treisithe le haghaidh seomraí daingne, taisceadáin le haghaidh páipéir ghníomhais, nó airgead tirim agus a leithéid, iad déanta as táirmhiotal',
    'Fittings for loose-leaf binders or files, letter clips, letter corners, paper clips, indexing tags and similar office articles, of base metal; staples in strips (for example, for offices, upholstery, packaging), of base metal' => 'Feistis le haghaidh comhaid nó ceangaltóirí bileog scaoilte, fáiscíní litreach, coirnéil litreach, fáiscíní páipéir, clibeanna innéacs agus earraí oifige comhchosúla, iad déanta as táirmhiotal; stáplaí ina stiallacha (i gcomhair oifigí, mar shampla, sin nó cumhdach troscáin, pacáistiú), iad déanta as táirmhiotal',
    'Bells, gongs and the like, non-electric, of base metal; statuettes and other ornaments, of base metal; photograph, picture or similar frames, of base metal; mirrors of base metal' => 'Cloigíní, ganganna agus a leithéid, iad den chineál nach leictreach, iad déanta as táirmhiotal; deilbhíní agus ornáidí eile, iad déanta as táirmhiotal; frámaí grianghraf nó pictiúr nó frámaí comhchosúla, iad déanta as táirmhiotal; scátháin déanta as táirmhiotal',
    'Flexible tubing of base metal, with or without fittings' => 'Feadánra solúbtha as táirmhiotal, bíodh feistis air nó ná bíodh',
    'Clasps, frames with clasps, buckles, buckle-clasps, hooks, eyes, eyelets and the like, of base metal, of a kind used for clothing or clothing accessories, footwear, jewellery, wrist watches, books, awnings, leather goods, travel goods or saddlery or for other made up articles; tubular or bifurcated rivets, of base metal; beads and spangles, of base metal' => 'Claspaí, frámaí a bhfuil claspaí orthu, búclaí, claspaí i gcomhair búclaí, crúcaí, cróite, cróite beaga agus a leithéid, iad déanta as táirmhiotal, den chineál a úsáidtear le haghaidh éadaí agus oiriúintí, le haghaidh coisbheart agus seodra, le haghaidh uaireadóirí rosta, le haghaidh leabhar agus díonbhrat, le haghaidh earraí leathair agus earraí taistil, le haghaidh diallatra, nó earraí atá comhdhéanta as nithe eile; seamanna feadánacha nó gabhlógacha, iad déanta as táirmhiotal; coirníní agus spaglainí, iad déanta as táirmhiotal',
    'Stoppers, caps and lids (including crown corks, screw caps and pouring stoppers), capsules for bottles, threaded bungs, bung covers, seals and other packing accessories, of base metal' => 'Stopalláin, caidhpeanna agus claibíní (lena n-áirítear coirc chorónacha, scriú-chlaibíní agus stopalláin doirte), capsúil do bhuidéil, dalláin shnáithithe, clúdaigh dallán, séalaí agus comhghabhálais phacála eile, déanta as táirmhiotal',
    'Wire, rods, tubes, plates, electrodes and similar products, of base metal or of metal carbides, coated or cored with flux material, of a kind used for soldering, brazing, welding or deposition of metal or of metal carbides; wire and rods, of agglomerated base metal powder, used for metal spraying' => 'Sreang, slata, feadáin, plátaí, leictreoidí agus táirgí comhchosúla, iad déanta as táirmhiotal nó as cairbídí miotail atá brataithe le hábhar flosca, nó ábhar flosca ina gcroílár, de chineál a úsáidtear chun miotal nó cairbídí miotail a shádráil, a phrásáil, a tháthú nó a dheascadh; sreang agus slata, iad déanta as púdar comhdhlúite táirmhiotail, a úsáidtear chun miotal a spraeáil',
    'Nuclear reactors; fuel elements (cartridges), non-irradiated, for nuclear reactors; machinery and apparatus for isotopic separation' => 'Imoibreoirí núicléacha; eilimintí breosla (cartúis), nach bhfuil ionradaithe, le haghaidh imoibreoirí núicléacha; innealra agus gléasra le haghaidh scaradh iseatópach',
    'Steam or other vapour generating boilers (other than central heating hot water boilers capable also of producing low pressure steam); superheated water boilers' => 'Coirí a ghineann gal uisce nó gala eile (seachas coirí uisce te le haghaidh téimh lárnaigh lenar féidir gal uisce a ghiniúint faoi lagbhrú freisin); coirí uisce fhorthéite',
    'Central heating boilers other than those of heading 8402' => 'Coirí téimh lárnaigh seachas na cinn atá faoi cheannteideal 8402',
    'Auxiliary plant for use with boilers of heading 8402 or 8403 (for example, economisers, superheaters, soot removers, gas recoverers); condensers for steam or other vapour power units' => 'Gléasra cúnta le húsáid le coirí atá faoi cheannteideal 8402 nó 8403 (mar shampla, barainneoirí, forthéiteoirí, easbhainteoirí súiche, aisghabhálaithe gáis); comhdhlúthadáin gaile uisce nó córais cumhachta gaile eile',
    'Producer gas or water gas generators, with or without their purifiers; acetylene gas generators and similar water process gas generators, with or without their purifiers' => 'Gineadóirí gáis táirgeora nó gáis uisce, gona n-íontóirí nó gan íontóirí; gineadóirí gáis; aicéitiléine agus gineadóirí gáis comhchosúla a úsáideann próiseas uisce, gona n-íontóirí nó gan íontóirí',
    'Steam turbines and other vapour turbines' => 'Tuirbíní gaile uisce agus tuirbíní gaile eile',
    'Spark-ignition reciprocating or rotary internal combustion piston engines' => 'Innill loiní dócháin inmheánaigh, frithingeacha spréachadhainte nó rothlacha',
    'Compression-ignition internal combustion piston engines (diesel or semi-diesel engines)' => 'Innill loine dócháin inmheánaigh d\'adhaint chomhbhrú (innill díosail nó leathdhíosail)',
    'Parts suitable for use solely or principally with the engines of heading 8407 or 8408' => 'Páirteanna atá oiriúnach le húsáid le hinnill faoi cheannteidil 8407 nó 8408',
    'Hydraulic turbines, water wheels, and regulators therefor' => 'Tuirbíní hiodrálacha, rothaí uisce, maille leis na rialtáin a ghabhann leo',
    'Turbojets, turbopropellers and other gas turbines' => 'Innill turba-scairde, turba-liáin agus tuirbíní gáis eile',
    'Other engines and motors' => 'Innill agus mótair eile',
    'Pumps for liquids, whether or not fitted with a measuring device; liquid elevators' => 'Caidéil le haghaidh leachtanna, bídís feistithe le feiste tomhais nó ná bídís; ardaitheoirí leachta',
    'Air or vacuum pumps, air or other gas compressors and fans; ventilating or recycling hoods incorporating a fan, whether or not fitted with filters; gas-tight biological safety cabinets, whether or not fitted with filters' => 'Caidéil aeir nó folúis, comhbhrúiteoirí agus gaothráin aeir nó gáis eile; cochaill aerála nó athchúrsála lena gcuimsítear gaothrán; bídís feistithe le scagairí nó ná bídís',
    'Air-conditioning machines, comprising a motor-driven fan and elements for changing the temperature and humidity, including those machines in which the humidity cannot be separately regulated' => 'Meaisíní aerchóirithe, ina bhfuil gaothrán mótarthiomáinte agus eilimintí chun an teocht agus taise an aeir a athrú, lena n-áirítear na meaisíní nach féidir taise an aeir a rialú ann ar leithligh',
    'Furnace burners for liquid fuel, for pulverised solid fuel or for gas; mechanical stokers, including their mechanical grates, mechanical ash dischargers and similar appliances' => 'Dóirí foirnéise i gcomhair breosla leachtach, i gcomhair breosla soladach mionaithe nó i gcomhair gáis; stócálaithe meicniúla gona ngrátaí meicniúla, gona scaoilteoirí luatha meicniúla agus fearais chomhchosúla',
    'Industrial or laboratory furnaces and ovens, including incinerators, non-electric' => 'Foirnéisí agus oighinn thionsclaíocha, lena n-áirítear loisceoirí, neamhleictreacha',
    'Refrigerators, freezers and other refrigerating or freezing equipment, electric or other; heat pumps other than air-conditioning machines of heading 8415' => 'Cuisneoirí, reoiteoirí agus trealamh cuisniúcháin nó reo eile, bídís leictreach nó ná bídís; caidéil teasa seachas na meaisíní aerchóirithe atá faoi cheannteideal 8415',
    'Machinery, plant or laboratory equipment, whether or not electrically heated (excluding furnaces, ovens and other equipment of heading 8514), for the treatment of materials by a process involving a change of temperature such as heating, cooking, roasting, distilling, rectifying, sterilising, pasteurising, steaming, drying, evaporating, vaporising, condensing or cooling, other than machinery or plant of a kind used for domestic purposes; instantaneous or storage water heaters, non-electric' => 'Innealra, gléasra nó trealamh saotharlainne, bíodh sé téite go leictreach (seachas foirnéisí, oighinn, agus trealamh eile faoi cheannteideal 8514), nó ná bíodh, le haghaidh cóireáil ábhar trí phróiseas lena mbaineann athrú teochta mar théamh, cócaireacht, róstadh, driogadh, ceartú, steiriliú, paistéaradh, gail, triomú, galú, gal a dhéanamh, comhdhlúthú nó fuarú, seachas innealra nó gléasra de chineál a úsáidtear chun tís; prapthéitheoirí nó taiscthéitheoirí uisce, neamhleictreacha',
    'Calendering or other rolling machines, other than for metals or glass, and cylinders therefor' => 'Meaisíní cleandrála nó meaisíní rollta eile, seachas i gcomhair miotal nó gloine, maille leis na sorcóirí a ghabhann leo',
    'Centrifuges, including centrifugal dryers; filtering or purifying machinery and apparatus, for liquids or gases' => 'Lártheifneoirí, lena n-áirítear triomadóirí lártheifeacha; innealra agus gléasra scagacháin nó íonúcháin, i gcomhair leachtanna nó gás',
    'Dishwashing machines; machinery for cleaning or drying bottles or other containers; machinery for filling, closing, sealing or labelling bottles, cans, boxes, bags or other containers; machinery for capsuling bottles, jars, tubes and similar containers; other packing or wrapping machinery (including heat-shrink wrapping machinery); machinery for aerating beverages' => 'Miasniteoirí; Innealra le haghaidh buidéil nó coimeádáin eile a ghlanadh nó a thriomú; innealra i gcomhair buidéil, cannaí, boscaí, málaí nó coimeádáin eile a líonadh, a dhúnadh, a shéalú nó a lipéadú; innealra le buidéil, prócaí, feadáin agus coimeádáin chomhchosúla a chur i gcapsúl; innealra pacála nó clúdaithe eile(lena n-áirítear innealra teas-chrapchlúdaithe); innealra le haghaidhdeochanna a aerú',
    'Weighing machinery (excluding balances of a sensitivity of 5 cg or better), including weight-operated counting or checking machines; weighing machine weights of all kinds' => 'Innealra meáite (meánna a bhfuil íogaireacht 5 cg nó níos fearr acu as an áireamh), lena n-áirítear innill chomhairimh nó seiceála; meaisíní meáite de gach cineál',
    'Mechanical appliances (whether or not hand-operated) for projecting, dispersing or spraying liquids or powders; fire extinguishers, whether or not charged; spray guns and similar appliances; steam or sandblasting machines and similar jet projecting machines' => 'Fearais mheicniúla (bídís oibrithe de láimh nó ná bídís) i gcomhair leachtanna nó púdair a theilgean, a easrú nó a spraeáil; múchtóirí tine, bídís luchtaithe nó ná bídís; de gach cineál; gunnaí spraeála agus fearais chomhchosúla; meaisíní gaile nó greanroiste agus meaisíní scairdteilgin comhchosúla eile',
    'Pulley tackle and hoists other than skip hoists; winches and capstans; jacks' => 'Tácla agus croch ulóige seachas crocha scipe; crainn tochrais agus tochaird; seacanna',
    'Ships\' derricks; cranes, including cable cranes; mobile lifting frames, straddle carriers and works trucks fitted with a crane' => 'Deiricí long; craenacha, lena n-áirítear craenacha cábla; frámaí tógála inaistrithe, iompróirí scaradh gabhail agus trucailí oibreacha atá feistithe le craein',
    'Fork-lift trucks; other works trucks fitted with lifting or handling equipment' => 'Trucailí ladhar-ardaitheora; trucailí oibrithe eile atá feistithe le trealamh ardúcháin nó láimhseála',
    'Other lifting, handling, loading or unloading machinery (for example, lifts, escalators, conveyors, teleferics)' => 'Innealra eile tógála, láimhseála, luchtaithe nó díluchtaithe (mar shampla, ardaitheoirí, staighrí creasa, iompróirí, telefeiricí)',
    'Self-propelled bulldozers, angledozers, graders, levellers, scrapers, mechanical shovels, excavators, shovel loaders, tamping machines and roadrollers' => 'Ollscartairí, claonscartairí, grádóirí, leibhéalaithe, scríobairí, sluaistí meicniúla, tochaltóirí, lódairí sluaisteacha, meaisíní sactha agus rollóirí bóthair, iad féin ghluaiste',
    'Other moving, grading, levelling, scraping, excavating, tamping, compacting, extracting or boring machinery, for earth, minerals or ores; piledrivers and pile extractors; snowploughs and snowblowers' => 'Innealra eile grádaithe, leibhéalaithe, scríobtha, tochailte, sactha, balctha, asbhainte nó tollta, le haghaidh cré, mianraí nó mianta; sáiteoirí píle agus asbhainteoirí píle; céachtaí sneachta agus séidirí sneachta',
    'Parts suitable for use solely or principally with the machinery of headings 8425 to 8430' => 'Páirteanna atá oiriúnach le húsáid leis an innealra atá faoi cheannteidil 8425 go 8430',
    'Agricultural, horticultural or forestry machinery for soil preparation or cultivation; lawn or sports-ground rollers' => 'Innealra talmhaíochta, gortóireachta nó foraoiseachta le haghaidh ullmhú nó saothrú na hithreach; rollóirí faiche nó faiche spóirt',
    'Harvesting or threshing machinery, including straw or fodder balers; grass or hay mowers; machines for cleaning, sorting or grading eggs, fruit or other agricultural produce, other than machinery of heading 8437' => 'Innealra buainte nó buailte na barr, lena n-áirítear burlairí cocháin nó fodair; lomairí faichí féir; innill le haghaidh uibheacha, torthaí nó táirgí talmhaíochta eile a ghlanadh, a shórtáil nó a ghrádú, seachas innealra faoi cheannteideal 8437',
    'Milking machines and dairy machinery' => 'Meaisíní blite agus innealra déiríochta',
    'Presses, crushers and similar machinery used in the manufacture of wine, cider, fruit juices or similar beverages' => 'Preasanna, brúiteoirí agus innealra comhchosúil a úsáidtear i dtáirgeadh fíona, leann úll, súnna torthaí nó deochanna comhchosúla',
    'Other agricultural, horticultural, forestry, poultry-keeping or bee-keeping machinery, including germination plant fitted with mechanical or thermal equipment; poultry incubators and brooders' => 'Innealra eile talmhaíochta, gortóireachta, foraoiseachta, innealra um choinneáil éanlaithe clóis nó coinneáil na mbeach lena n-áirítear gléasra péactha ar a bhfuil trealamh meicniúil nó teirmeach feistithe; goradáin agus aonaid ghoir éanlaithe chlóis',
    'Machines for cleaning, sorting or grading seed, grain or dried leguminous vegetables; machinery used in the milling industry or for the working of cereals or dried leguminous vegetables, other than farm-type machinery' => 'Meaisíní chun síolta, grán nó glasraí léagúmacha triomaithe a ghlanadh, a shórtáil nó a ghrádú; innealra a úsáidtear i dtionscadal na muilleála nó le gránbhairr nó glasraí léagúmacha triomaithe a oibriú, seachas innealra den chineál a úsáidtear ar fheirm',
    'Machinery, not specified or included elsewhere in this chapter, for the industrial preparation or manufacture of food or drink, other than machinery for the extraction or preparation of animal or fixed vegetable or microbial fats or oils' => 'Innealra nach sonraítear nó nach bhfuil san áireamh in aon áit eile sa chaibidil seo, le haghaidh ullmhú tionsclaíoch nó déantús bia nó dí, seachas innealra le haghaidh asbhaint nó ullmhúchán saill nó olaí ainmhithe nó ola glasraí atá do-ghalaithe',
    'Machinery for making pulp of fibrous cellulosic material or for making or finishing paper or paperboard' => 'Innealra le haghaidh laíon d’ábhar snáithíneach ceallúlósach a dhéanamh nó le páipéar nó cairtchlár a dhéanamh nó a chríochnú',
    'Bookbinding machinery, including book-sewing machines' => 'Innealra leabharcheangail, lena n-áirítear meaisíní fuála leabhar',
    'Other machinery for making up paper pulp, paper or paperboard, including cutting machines of all kinds' => 'Innealra eile le haghaidhlaíon páipéir, páipéar nó cairtchlár a chóiriú, lena n-áirítear meaisíní gearrtha de gach cineál',
    'Machinery, apparatus and equipment (other than the machines of headings 8456 to 8465) for preparing or making plates, cylinders or other printing components; plates, cylinders and other printing components; plates, cylinders and lithographic stones, prepared for printing purposes (for example, planed, grained or polished)' => 'Innealra, gléasra agus trealamh (seachas meaisíní atá faoi cheannteidil 8456 go 8465) chun plátaí, sorcóirí agus comhpháirteanna priontála eile a ullmhú; plátaí, sorcóirí agus comhpháirteanna priontála eile; plátaí, sorcóirí agus clocha liteagrafacha, a ullmhaítear chun priontála (mar shampla, plánáilte, gránaithe nó snasta)',
    'Printing machinery used for printing by means of plates, cylinders and other printing components of heading 8442; other printers, copying machines and facsimile machines, whether or not combined; parts and accessories thereof' => 'Innealra priontála a úsáidtear i gcomhair priontála le plátaí, sorcóirí agus comhpháirteanna priontála eile atá faoi cheannteideal 8442; printéirí eile, meaisíní cóipeála agus meaisíní facs, bídís ceangailte le chéile nó ná bídís; páirteanna gona ngabhálais',
    'Machines for extruding, drawing, texturing or cutting man-made textile materials' => 'Meaisíní i gcomhair ábhair theicstíle de dhéantús an duine a easbhrú, a tharraingt, a uigeachtú nó a ghearradh',
    'Machines for preparing textile fibres; spinning, doubling or twisting machines and other machinery for producing textile yarns; textile reeling or winding (including weft-winding) machines and machines for preparing textile yarns for use on the machines of heading 8446 or 8447' => 'Meaisíní chun snáithíní teicstíle a ullmhú; meaisíní sníomhacháin, dúblála nó casta agus innealra eile le haghaidh snáth teicstíle a tháirgeadh; meaisíní tochraiste nó casta teicstíle (lena n-áirítear casadh innigh) agus meaisíní le haghaidh snáitheanna teicstíle a ullmhú le húsáid ar na meaisíní faoi cheannteideal 8446 nó 8447',
    'Weaving machines (looms)' => 'Meaisíní fíodóireachta (seolta)',
    'Knitting machines, stitch-bonding machines and machines for making gimped yarn, tulle, lace, embroidery, trimmings, braid or net and machines for tufting' => 'Meaisíní cniotála, meaisíní nasctha lúb agus meaisíní le haghaidh snáth galúnaithe, tulle, lása, bróidnéireachta, ciumhsóga, bréid nó eangaí agus meaisíní le haghaidh caitínithe',
    'Auxiliary machinery for use with machines of heading 8444, 8445, 8446 or 8447 (for example, dobbies, jacquards, automatic stop motions, shuttle changing mechanisms); parts and accessories suitable for use solely or principally with the machines of this heading or of heading 8444, 8445, 8446 or 8447 (for example, spindles and spindle flyers, card clothing, combs, extruding nipples, shuttles, healds and heald-frames, hosiery needles)' => 'Meaisíní cúnta le húsáid le meaisíní atá faoi cheannteidil 8444, 8445, 8446 nó 8447 (mar shampla, dobaithe, jacquard, stopanna uathoibríocha, meicníochtaí athraithe tointeálacha); páirteanna agus gabhálais atá oiriúnach le húsáid leis na gairis faoi cheannteideal 8444, 8445, 8446 nó 8447 amháin nó go príomha, (mar shampla, fearsaidí agus eitleoirí fearsaide, cardáil éadaí, cíortha, siní easbhrúite, tointeálacha, úmacha agus frámaí úma, snáthaidí osánachta)',
    'Household or laundry-type washing machines, including machines which both wash and dry' => 'Meaisíní níocháin tí nó le haghaidh neachtlainne, lena n-áirítear meaisíní a dhéanann idir níochán agus triomú',
    'Machinery (other than machines of heading 8450) for washing, cleaning, wringing, drying, ironing, pressing (including fusing presses), bleaching, dyeing, dressing, finishing, coating or impregnating textile yarns, fabrics or made-up textile articles and machines for applying the paste to the base fabric or other support used in the manufacture of floor coverings such as linoleum; machines for reeling, unreeling, folding, cutting or pinking textile fabrics' => 'Innealra (seachas meaisíní faoi cheannteideal 8450) le haghaidh snáitheanna teicstíle, fabraicí nó earraí teicstíle réamhdhéanta a ní, a ghlanadh, a fháisceadh, a thriomú, a smúdáil, a phreasáil (lena n-áirítear preasanna comhleáite), a thuar, a dhathú, a ghléasadh faoi threiscín, a chríochnú, a chlúdach nó a thuile agus meaisíní le haghaidh taos a chur ar bhonn fabraice nó tacú eile a úsáidtear i ndéantús clúdaigh urláir mar líonóil; meaisíní le haghaidh fabraicí teicstíle a thochras, a dhíthochras, a fhilleadh, a ghearradh nó a scealpadh',
    'Sewing machines, other than book-sewing machines of heading 8440; furniture, bases and covers specially designed for sewing machines; sewing machine needles' => 'Meaisíní fuála, seachas meaisíní fuála leabhar atá faoi cheannteideal 8440; troscán, boinn agus clúdaigh arna ndearadh go speisialta le haghaidh meaisíní fuála; snáthaidí meaisíní fuála',
    'Machinery for preparing, tanning or working hides, skins or leather or for making or repairing footwear or other articles of hides, skins or leather, other than sewing machines' => 'Innealra le haghaidh ullmhúchán, súdaireacht nó oibriú seithí, craicne nó leathair nó le haghaidh coisbheart nó earraí eile seithí, craicne nó leathair a dhéanamh nó a dheisiú, seachas meaisíní fuála',
    'Converters, ladles, ingot moulds and casting machines, of a kind used in metallurgy or in metal foundries' => 'Tiontairí, ladair, múnlaí tinní agus meaisíní teilgthe, de chineál a úsáidtear sa mhiotalóireacht nó i dteilgcheártaí miotail',
    'Metal-rolling mills and rolls therefor' => 'Muilte rollta miotail maille leis na rollaí a ghabhann leo',
    'Machine tools for working any material by removal of material, by laser or other light or photon beam, ultrasonic, electrodischarge, electrochemical, electron beam, ionic-beam or plasma arc processes; water-jet cutting machines' => 'Meaisín-uirlisí le haghaidh ábhar a shaoirsiú trí ábhar a bhaint, le próisis léasair nó solais nó léis fótóin eile, léis ultrasonaigh, díluchtaithe leictrigh, leictricheimiceacha, léis leictreoin, léis ianaigh nó stua-phlasmacha; meaisíní gearrtha scaird uisce',
    'Machining centres, unit construction machines (single station) and multi-station transfer machines, for working metal' => 'Ionaid mheaisínithe, meaisíní tógála seasta (stáisiún singil) agus meaisíní aistrithe ilstáisiúin, chun miotal a oibriú',
    'Lathes (including turning centres) for removing metal' => 'Deileanna (lena n-áirítear ionaid deileadóireachta) le miotail a bhaint',
    'Machine tools (including way-type unit head machines) for drilling, boring, milling, threading or tapping by removing metal, other than lathes (including turning centres) of heading 8458' => 'Meaisín-uirlisí (lena n-áirítear meaisíní ceannaonaid den chineál a bhíonn ar shleamhnáin) i gcomhair druileáil, tolladh, muilleáil, snáithiú nó tapáil trí mhiotal a bhaint, seachas ar dheileanna (lena n-áirítear ionaid deileadóireachta) atá faoi cheannteideal 8458',
    'Machine tools for deburring, sharpening, grinding, honing, lapping, polishing or otherwise finishing metal or cermets by means of grinding stones, abrasives or polishing products, other than gear cutting, gear grinding or gear finishing machines of heading 8461' => 'Meaisín-uirlisí le haghaidh miotal nó miotail cheirmeacha a dhíbhurrú, a fhaobhrú, a líomhadh, a mhíniú, a rádalú, a shnasú nó a chríochnú ar bhealach eile trí bhíthin clocha meilte, scríobaigh nó táirgí snasta, seachas meaisíní gearrtha giair, meilte giair nó críochnaithe giair atá faoi cheannteideal 8461',
    'Machine tools for planing, shaping, slotting, broaching, gear cutting, gear grinding or gear finishing, sawing, cutting-off and other machine tools working by removing metal or cermets, not elsewhere specified or included' => 'Meaisín-uirlisí le haghaidh plánáil, múnlú, déanamh sliotán, bróitseáil, gearradh giair, meilt giair nó críochnú giair, sábhadh, teascadh agus uirlisí meaisín eile a oibríonn trí mhiotal nó miotail cheirmeacha a bhaint, nach bhfuil sonraithe ná áirithe in áit eile',
    'Machine tools (including presses) for working metal by forging, hammering or die forging (excluding rolling mills); machine tools (including presses, slitting lines and cut-to-length lines) for working metal by bending, folding, straightening, flattening, shearing, punching, notching or nibbling (excluding draw-benches); presses for working metal or metal carbides, not specified above' => 'Meaisín-uirlisí (lena n-áirítear preasanna) le haghaidh miotal a oibriú trína ghaibhniú, a ghreadadh nó stampáil dísle; meaisín-uirlisí (lena n-áirítear preasanna) le haghaidh miotal a oibriú trí lúbadh, filleadh, díriú, leacú, fiar, puinseáil nó eangú (binsí tarraingthe as an áireamh); Preasanna le haghaidh cairbídí nó cairbídí miotail a oibriú, nach sonraítear thuas',
    'Other machine tools for working metal or cermets, without removing material' => 'Meaisín-uirlisí eile le haghaidh miotal nó miotal ceirmeach a oibriú, gan ábhar a bhaint',
    'Machine tools for working stone, ceramics, concrete, asbestos-cement or like mineral materials or for cold working glass' => 'Meaisín-uirlisí le haghaidh cloch, ceirmigh, coincréit, stroighin aispeiste nó ábhair mhianracha eile a oibriú nó le haghaidh gloine a oibriú go fuar',
    'Machine tools (including machines for nailing, stapling, glueing or otherwise assembling) for working wood, cork, bone, hard rubber, hard plastics or similar hard materials' => 'Meaisín-uirlisí (lena n-áirítear meaisíní le haghaidh tairneála, stáplála, gliúála nó cóimeála eile) le haghaidh adhmad, corc, cnámh, rubar crua, plaistigh chrua nó ábhair chrua chomhchosúla a oibriú',
    'Parts and accessories suitable for use solely or principally with the machines of headings 8456 to 8465, including work or tool holders, self-opening dieheads, dividing heads and other special attachments for the machines; tool holders for any type of tool for working in the hand' => 'Páirteanna agus gabhálais atá oiriúnach le húsáid go príomha leis na meaisíní atá faoi cheannteidil 8456 go 8465, nó chuige sin amháin, lena n-áirítear coinneálaithe saothair nó uirlise, cinn dísle féinoscailte, cinn a scoilteann agus ceangaltáin speisialta eile le haghaidh na meaisíní; coinneálaithe uirlise d’aon chineál uirlise le haghaidh oibriú i ngreim láimhe',
    'Tools for working in the hand, pneumatic, hydraulic or with self-contained electric or non-electric motor' => 'Uirlisí le haghaidh oibriú i ngreim láimhe, neomatach, hiodrálach nó le mótar féinchuimsithe leictreach nó neamhleictreach',
    'Machinery and apparatus for soldering, brazing or welding, whether or not capable of cutting, other than those of heading 8515; gas-operated surface tempering machines and appliances' => 'Innealra agus gléasra le haghaidh sádrála, prásála nó táthaithe, bíodh sé in ann gearradh nó ná bíodh, seachas iad siúd atá faoi cheannteideal 8515; meaisíní agus fearais a oibríonn le gás chun faghairt a chur ar dhromchlaí',
    'Calculating machines and pocket-size data-recording, reproducing and displaying machines with calculating functions; accounting machines, postage-franking machines, ticket-issuing machines and similar machines, incorporating a calculating device; cash registers' => 'Áireamháin agus meaisíní taifeadta sonraí, atáirgthe agus taispeána de mhéid póca a bhfuil feidhmeanna ríofa acu; meaisíní cuntasaíochta; meaisíní francála poist, meaisíní eisithe ticéad agus meaisíní comhchosúla, a chuimsíonn gaireas ríofa; scipéid airgid',
    'Automatic data-processing machines and units thereof; magnetic or optical readers, machines for transcribing data onto data media in coded form and machines for processing such data, not elsewhere specified or included' => 'Meaisíní próiseála sonraí uathoibríocha maille leis na haonaid a ghabhann leo; léitheoirí maighnéadacha nó optúla, meaisíní le sonraí a thras-scríobh ar mheáin sonraí i bhfoirm chódaithe agus meaisíní le haghaidh sonraí mar seo a phróiseáil, nach bhfuil sonraithe ná áirithe in áit eile',
    'Other office machines (for example, hectograph or stencil duplicating machines, addressing machines, automatic banknote dispensers, coin-sorting machines, coin-counting or -wrapping machines, pencil-sharpening machines, perforating or stapling machines)' => 'Meaisíní oifige eile (mar shampla, meaisíní heicteagraf nó dúblála stionsail, meaisíní breactha seoltaí, dáileoirí uathoibríocha nótaí airgid, meaisíní sórtála bonn, meaisíní comhairimh nó clúdaithe bonn, meaisíní bioraithe pinn luaidhe, meaisíní bréifnithe nó stáplála)',
    'Parts and accessories (other than covers, carrying cases and the like) suitable for use solely or principally with machines of headings 8470 to 8472' => 'Páirteanna agus gabhálais (seachas clúdaigh, cásanna iompair agus a leithéidí) atá oiriúnach le húsáid leis na meaisíní atá faoi cheannteideal 8470 go 8472',
    'Machinery for sorting, screening, separating, washing, crushing, grinding, mixing or kneading earth, stone, ores or other mineral substances, in solid (including powder or paste) form; machinery for agglomerating, shaping or moulding solid mineral fuels, ceramic paste, unhardened cements, plastering materials or other mineral products in powder or paste form; machines for forming foundry moulds of sand' => 'Innealra le haghaidh cré, cloch, mianta nó substaintí mianracha eile, i bhfoirm sholadach (lena n-áirítear púdar nó taos) a shórtáil, a chriathrú, a scaradh, a ní, a bhrú, a mheilt, a mheascadh nó a fhuineadh; innealra i gcomhair breoslaí soladacha mianracha, taos ceirmeach, ábhair plástrála nó táirgí mianracha eile i bhfoirm púdair nó taois a cheapadh nó a mhúnlú; meaisíní le haghaidh múnlaí teilgcheárta a dhéanamh de ghaineamh',
    'Machines for assembling electric or electronic lamps, tubes or valves or flashbulbs, in glass envelopes; machines for manufacturing or hot working glass or glassware' => 'Meaisíní le haghaidh lampaí, feadáin nó comhlaí nó splancbholgáin, leictreacha nó leictreonacha i gclúdaigh ghloine a chóimeáil; meaisíní le haghaidh saoirsiú te nó monarú; a dhéanamh ar ghloine nó earraí gloine',
    'Automatic goods-vending machines (for example, postage stamp, cigarette, food or beverage machines), including money-changing machines' => 'Meaisíní díola earraí uathoibríocha (mar shampla, stampaí poist, toitíní, bia nó deochanna), lena n-áirítear meaisíní sóinseála airgid',
    'Machinery for working rubber or plastics or for the manufacture of products from these materials, not specified or included elsewhere in this chapter' => 'Innealra le haghaidh rubar nó plaistigh a shaoirsiú le haghaidh táirgí a dhéanamh as na hábhair seo, nach bhfuil sonraithe nó san áireamh in aon áit eile sa chaibidil seo',
    'Machinery for preparing or making up tobacco, not specified or included elsewhere in this chapter' => 'Innealra le haghaidh tobac a ullmhú nó a chóiriú nach bhfuil sonraithe nó san áireamh in aon áit eile sa chaibidil seo',
    'Machines and mechanical appliances having individual functions, not specified or included elsewhere in this chapter' => 'Meaisíní agus fearais mheicniúla a bhfuil feidhmeanna ar leith acu nach bhfuil sonraithe, nó nach bhfuil san áireamh in aon áit eile sa chaibidil seo',
    'Moulding boxes for metal foundry; mould bases; moulding patterns; moulds for metal (other than ingot moulds), metal carbides, glass, mineral materials, rubber or plastics' => 'Boscaí múnlála le haghaidh teilgcheárta miotail; boinn múnlaithe; patrúin múnlaithe; múnlaí le haghaidh miotail (seachas múnlaigh tinní), cairbídí miotail, gloine, ábhair mhianracha, rubar nó plaistigh',
    'Taps, cocks, valves and similar appliances for pipes, boiler shells, tanks, vats or the like, including pressure-reducing valves and thermostatically controlled valves' => 'Sconnaí, cocaí agus fearais eile le haghaidh píopaí, blaoscanna coire, umair, dabhcha nó a leithéidí, lena n-áirítear comhlaí laghdaithe brú agus comhlaí rialaithe teasa',
    'Ball or roller bearings' => 'Imthacaí gránacha nó rollacha',
    'Transmission shafts (including cam shafts and crank shafts) and cranks; bearing housings and plain shaft bearings; gears and gearing; ball or roller screws; gear boxes and other speed changers, including torque converters; flywheels and pulleys, including pulley blocks; clutches and shaft couplings (including universal joints)' => 'Fearsaidí tarchuir (lena n-áirítear ceamfhearsaidí agus cromfhearsaidí) agus cromáin; cásálacha imthacaí agus imthaca loma fearsaide; giair agus giaráil; gránscriúnna nó rollscriúnna; giarbhoscaí agus athraitheoirí luais eile, lena n-áirítear tiontairí casmhóiminte; rothaí lústair agus ulóga, lena n-áirítear bloic ulóige; crága agus cúpláin fearsaide (lena n-áirítear ailt uilíocha)',
    'Gaskets and similar joints of metal sheeting combined with other material or of two or more layers of metal; sets or assortments of gaskets and similar joints, dissimilar in composition, put up in pouches, envelopes or similar packings; mechanical seals' => 'Gaiscéid agus ailt chomhchosúla leathánra mhiotail comhcheangailte le hábhar eile a bhfuil dhá shraith nó níos mó miotail ann; foirne nó ilchnuasaigh gaiscéad agus alt comhchosúil, a bhfuil comhdhéanamh neamhchosúil acu, curtha i máilíní, i gclúdaigh nó i bpacáil comhchosúil; séalaí meicniúla',
    'Machines for additive manufacturing' => 'Meaisíní chun breiseáin a mhonarú',
    'Machines and apparatus of a kind used solely or principally for the manufacture of semiconductor boules or wafers, semiconductor devices, electronic integrated circuits or flat panel displays; machines and apparatus specified in note 11(C) to this chapter; parts and accessories' => 'Meaisíní agus gléasra de chineál a úsáidtear go príomha le haghaidh peileanna nó sliseoga leathsheoltóirí, gairis leathsheoltóirí, ciorcaid leictreonacha chomhtháite nó painéil chothroma chun taispeána, nó chuige sin amháin; Meaisíní agus gléasra a shonraítear i nóta 11(C) a ghabhann leis an gcaibidil seo; páirteanna agus gabhálais',
    'Machinery parts, not containing electrical connectors, insulators, coils, contacts or other electrical features, not specified or included elsewhere in this chapter' => 'Páirteanna innealra, nach bhfuil seoláin leictreonacha, inslitheoirí, corna, tadhaill nó gnéithe leictreonacha eile iontu, nach bhfuil sonraithe ná áirithe in aon áit eile sa chaibidil seo',
    'Electric motors and generators (excluding generating sets)' => 'Mótair leictreacha agus gineadóirí (seachas foirne ginte)',
    'Electric generating sets and rotary converters' => 'Foirne ginte leictreachais agus tiontairí rothlacha',
    'Parts suitable for use solely or principally with the machines of heading 8501 or 8502' => 'Páirteanna atá oiriúnach le húsáid leis na meaisíní atá faoi cheannteideal 8501 nó 8502 amháin nó go príomha',
    'Electrical transformers, static converters (for example, rectifiers) and inductors' => 'Claochladáin leictreacha, tiontairí statacha (mar shampla, coigeartóirí) agus ionduchtóirí',
    'Electromagnets; permanent magnets and articles intended to become permanent magnets after magnetisation; electromagnetic or permanent magnet chucks, clamps and similar holding devices; electromagnetic couplings, clutches and brakes; electromagnetic lifting heads' => 'Leictreamaighnéid; buanmhaighnéid agus earraí arna gceapadh le bheith ina mbuanmhaighnéid tar éis iad a mhaighnéadú; smutáin, clampaí agus gairis coinneála comhchosúla leictreamaighnéadacha nó buanmhaighnéadacha; cúpláin, crága agus coscáin leictreamaighnéadacha; cinn tógála leictreamaighnéadacha',
    'Primary cells and primary batteries' => 'Cealla príomhúla agus ceallraí príomhúla',
    'Electric accumulators, including separators therefor, whether or not rectangular (including square)' => 'Taisc-chealla leictreacha, lena n-áirítear na scarthóirí a ghabhann leo, bídís dronuilleogach nó ná bídís (cearnógach san áireamh)',
    'Vacuum cleaners' => 'Folúsghlantóirí',
    'Electromechanical domestic appliances, with self-contained electric motor, other than vacuum cleaners of heading 8508' => 'Fearais tí leictrimheicniúla, a bhfuil mótar leictreach féinchuimsitheach iontu, seachas folúsghlantóirí atá faoi cheannteideal 8508',
    'Shavers, hair clippers and hair-removing appliances, with self-contained electric motor' => 'Bearrthóirí, clipéir gruaige agus fearais bainte gruaige, ina bhfuil mótar leictreach féinchuimsitheach',
    'Electrical ignition or starting equipment of a kind used for spark-ignition or compression-ignition internal combustion engines (for example, ignition magnetos, magneto-dynamos, ignition coils, sparking plugs and glow plugs, starter motors); generators (for example, dynamos, alternators) and cut-outs of a kind used in conjunction with such engines' => 'Fearais adhainte nó tosaithe leictreacha de chineál a úsáidtear le hinnill dócháin inmheánaigh lena mbaineann spréach-adhaint nó brú-adhaint (mar shampla, maignéatónna adhainte, maignéató-dineamónna, cornaí adhainte, spréachphlocóidí agus plocóidí téitheora, mótair dúisithe); gineadóirí (mar shampla, dineamónna, ailtéarnóirí) agus gearrthóga de chineál a úsáidtear i gcomhpháirt le hinnill dá leithéid',
    'Electrical lighting or signalling equipment (excluding articles of heading 8539), windscreen wipers, defrosters and demisters, of a kind used for cycles or motor vehicles' => 'Trealamh soilsithe nó comharthaíochta leictreonach (seachas earraí atá faoi cheannteideal 8539), cuimilteoirí gaothscátha, díreoáin agus dínéaltóirí, de chineál a úsáidtear le haghaidh rothar nó mótarfheithiclí',
    'Portable electric lamps designed to function by their own source of energy (for example, dry batteries, accumulators, magnetos), other than lighting equipment of heading 8512' => 'Lampaí inaistrithe leictreacha arna ndearadh le feidhmiú as a bhfoinse cumhachta féin (mar shampla, ceallraí tirime, taisc-chealla, maignéatónna), seachas trealamh soilsithe atá faoi cheannteideal 8512',
    'Industrial or laboratory electric furnaces and ovens (including those functioning by induction or dielectric loss); other industrial or laboratory equipment for the heat treatment of materials by induction or dielectric loss' => 'Foirnéisí agus oighinn leictreacha tionsclaíochta nó saotharlainne (lena n-áirítear iad siúd a fheidhmíonn trí ionduchtú nó caillteanas tréleictreach); trealamh tionsclaíochta nó saotharlainne eile le haghaidh cóireáil teasa ábhar trí ionduchtú nó caillteanas tréleictreach',
    'Electric (including electrically heated gas), laser or other light or photon beam, ultrasonic, electron beam, magnetic pulse or plasma arc soldering, brazing or welding machines and apparatus, whether or not capable of cutting; electric machines and apparatus for hot spraying of metals or cermets' => 'Meaisíní leictreacha agus gléasra leictreach (lena n-áirítear gás a théitear go leictreach), léasair nó léis solais nó fótóin eile, ultrasonacha, léis leictreoin, bíogtha maighnéadaigh nó sádrála stua-phlasmaí, brásála nó táthúcháin, bídís ábalta gearradh nó ná bídís; meaisíní agus gairis leictreacha le haghaidh spraeáil the miotal nó miotal ceirmeach',
    'Electric instantaneous or storage water heaters and immersion heaters; electric space-heating apparatus and soil-heating apparatus; electrothermic hairdressing apparatus (for example, hairdryers, hair curlers, curling tong heaters) and hand dryers; electric smoothing irons; other electrothermic appliances of a kind used for domestic purposes; electric heating resistors, other than those of heading 8545' => 'Prapthéitheoirí nó taiscthéitheoirí uisce agus tumthéitheoirí leictreacha; gléasra leictreach chun spás a théamh agus gléasra chun an ithir a théamh; gléasra leictritheirmeach gruagaireachta (mar shampla, triomadóirí gruaige, trilseacháin gruaige, téitheoirí tlú cataíola) agus triomadóirí láimhe; iarainn smúdála leictreacha; fearais leictriteirmeacha eile de chineál a úsáidtear sa teach; friotóirí téimh leictreacha; seachas na cinn atá faoi cheannteideal 8545',
    'Telephone sets, including smartphones and other telephones for cellular networks or for other wireless networks; other apparatus for the transmission or reception of voice, images or other data, including apparatus for communication in a wired or wireless network (such as a local or wide area network), other than transmission or reception apparatus of heading 8443, 8525, 8527 or 8528' => 'Gléasra teileafóin, lena n-áirítear teileafóin le haghaidh líonraí ceallacha nó le haghaidh líonraí eile gan sreang; gléasra eile le haghaidh guth, íomhánna nó sonraí eile a tharchur nó a fháil, lena n-áirítear gléasra le haghaidh cumarsáide i líonra le sreang nó gan sreang (lena n-áirítear líonra achair logánta nó líonra achair fhairsing), seachas gléasra tarchurtha nó fála atá faoi cheannteideal 8443, 8525, 8527 nó 8528',
    'Microphones and stands therefor; loudspeakers, whether or not mounted in their enclosures; headphones and earphones, whether or not combined with a microphone, and sets consisting of a microphone and one or more loudspeakers; audio-frequency electric amplifiers; electric sound amplifier sets' => 'Micreafóin agus seastáin dóibh; callairí, bídís suite ina gcompal nó ná bídís; cluasáin, bídís comhcheangailte le micreafón nó ná bídís, agus gléasra ina bhfuil micreafón agus callaire amháin nó níos mó; aimplitheoirí closmhinicíochta leictreacha; gléasra aimplitheoirí fuaime leictreacha',
    'Sound recording or sound reproducing apparatus' => 'Gléasra taifeadta fuaime nó atáirgthe fuaime',
    'Video recording or reproducing apparatus, whether or not incorporating a video tuner' => 'Gléasra taifeadta nó atáirgthe físe, bíodh tiúnóir físe ina chuid díobh nó ná bíodh',
    'Parts and accessories suitable for use solely or principally with the apparatus of heading 8519 or 8521' => 'Páirteanna agus gabhálais atá oiriúnach le húsáid go príomha leis na gairis sin amháin, nó leis na gairis sin go príomha, atá faoi cheannteideal 8519 nó 8521',
    'Discs, tapes, solid-state non-volatile storage devices, smart cards and other media for the recording of sound or of other phenomena, whether or not recorded, including matrices and masters for the production of discs, but excluding products of Chapter 37' => 'Dioscaí, téipeanna, gairis stórála soladstaide neamhluaineacha, cártaí cliste agus meáin eile le haghaidh fuaim nó feiniméin eile a thaifeadadh, bíodh sé taifeadta nó ná bíodh, lena n-áirítear maitrísí agus máistirthéipeanna le haghaidh dioscaí a tháirgeadh, ach gan táirgí Chaibidil 3 san áireamh 7',
    'Flat panel display modules, whether or not incorporating touch-sensitive screens' => 'Painéil chothroma ina modúil taispeána, bíodh scáileáin tadhall-íogair iontu nó ná bíodh',
    'Transmission apparatus for radio-broadcasting or television, whether or not incorporating reception apparatus or sound recording or reproducing apparatus; television cameras, digital cameras and video camera recorders' => 'Gléasra tarchuir le haghaidh craoladh raidió nó teilifíse, bíodh gléasra fála nó taifeadta nó atáirgthe fuaime ann nó ná bíodh; ceamaraí teilifíse, ceamaraí digiteacha agus fístaifeadáin cheamara',
    'Radar apparatus, radio navigational aid apparatus and radio remote control apparatus' => 'Gléasra radair, gléasra cúnta radloingseoireachta agus gléasra cianrialaithe raidió',
    'Reception apparatus for radio-broadcasting, whether or not combined, in the same housing, with sound recording or reproducing apparatus or a clock' => 'Gléasra glactha le haghaidh craoladh raidió nó teilifíse, bíodh gléasra taifeadta fuaime nó clog comhcheangailte, sa chásáil chéanna, nó ná bíodh',
    'Monitors and projectors, not incorporating television reception apparatus; reception apparatus for television, whether or not incorporating radio-broadcast receivers or sound or video recording or reproducing apparatus' => 'Monatóirí agus teilgeoirí nach gcuimsíonn gléasra glactha teilifíse; gléasra glactha le haghaidh teilifíse, bíodh glacadóir craolta raidió nó gléasra taifeadta nó atáirgthe fuaime nó físe ann nó ná bíodh',
    'Parts suitable for use solely or principally with the apparatus of headings 8524 to 8528' => 'Páirteanna atá oiriúnach le húsáid leis an ngléasra atá faoi cheannteidil 8524 go dtí 8528',
    'Electrical signalling, safety or traffic control equipment for railways, tramways, roads, inland waterways, parking facilities, port installations or airfields (other than those of heading 8608)' => 'Trealamh comharthaíochta, sábháilteachta nó rialaithe tráchta leictreach le haghaidh iarnród, trambhealaí, bóithre, uiscebhealaí intíre, áiseanna páirceála, fearais chalafoirt nó aerpháirceanna (seachas iad siúd atá faoi cheannteideal 8608)',
    'Electric sound or visual signalling apparatus (for example, bells, sirens, indicator panels, burglar or fire alarms), other than those of heading 8512 or 8530' => 'Gléasra leictreach fuaime nó físe (mar shampla, cloig, bonnáin, painéil táscaire, aláraim buirgléireachta nó tine), seachas iad siúd faoi cheannteideal 8512 nó 8530',
    'Electrical capacitors, fixed, variable or adjustable (pre-set)' => 'Toilleoirí leictreacha, seasta, inathraithe nó inchoigeartaithe (réamhshocraithe)',
    'Electrical resistors (including rheostats and potentiometers), other than heating resistors' => 'Friotóirí leictreacha (lena n-áirítear réastait agus poitéinsiméadair), seachas friotóirí téimh',
    'Printed circuits' => 'Ciorcaid phriontáilte',
    'Electrical apparatus for switching or protecting electrical circuits, or for making connections to or in electrical circuits (for example, switches, fuses, lightning arresters, voltage limiters, surge suppressors, plugs and other connectors, junction boxes), for a voltage exceeding 1000 V' => 'Gléasra leictreonach le haghaidh ciorcaid leictreonacha a lascadh nó a chosaint, nó le haghaidh naisc a dhéanamh le ciorcaid leictreacha nó laistigh díobh (mar shampla, lasca, fiúsanna, coscairí tintrí, teorantóirí voltais, sochtóirí borrtha, plocóidí agus nascóirí eile, comhchumair), le haghaidh voltas níos mó ná 1000 V',
    'Electrical apparatus for switching or protecting electrical circuits, or for making connections to or in electrical circuits (for example, switches, relays, fuses, surge suppressors, plugs, sockets, lamp holders and other connectors, junction boxes), for a voltage not exceeding 1000 V; connectors for optical fibres, optical fibre bundles or cables' => 'Gléasra leictreonach le haghaidh ciorcaid leictreonacha a lascadh nó a chosaint, nó le haghaidh naisc a dhéanamh le ciorcaid leictreacha nó laistigh díobh (mar shampla, lasca, athsheachadáin, fiúsanna, coscaire tintrí, plocóidí, soicéid, coinneálaithe lampa agus nascóirí eile, comhchumair), le haghaidh voltas nach mó ná 1000 V; nascóirí le haghaidh snáithíní optúla, cuacha snáithíní optúla nó cáblaí',
    'Boards, panels, consoles, desks, cabinets and other bases, equipped with two or more apparatus of heading 8535 or 8536, for electric control or the distribution of electricity, including those incorporating instruments or apparatus of Chapter 90, and numerical control apparatus, other than switching apparatus of heading 8517' => 'Cláir, painéil, consóil, deasca, caibinéid agus boinn eile, atá feistithe le dhá ghaireas nó níos mó atá faoi cheannteideal 8535 nó 8536, le haghaidh rialú leictreach nó dáileadh leictreachais, iad siúd a bhfuil uirlisí nó gairis faoi Chaibidil 90 mar chuid díobh san áireamh, agus gairis rialaithe uimhriúil, seachas gairis lasctha faoi cheannteideal 8517',
    'Parts suitable for use solely or principally with the apparatus of heading 8535, 8536 or 8537' => 'Páirteanna atá oiriúnach le húsáid leis an ngléasra sin amháin, nó go príomha, atá faoi cheannteideal 8535, 8536 nó 8537',
    'Electric filament or discharge lamps, including sealed beam lamp units and ultraviolet or infra-red lamps; arc-lamps; light-emitting diode (LED) light sources' => 'Lampaí filiméid leictrigh nó scaoilte, lena n-áirítear aonaid lampa léis shéalaithe agus lampaí ultraivialaite nó infridhearga; stua-lampaí; lampaí dé-óidí astaithe solais (LED)',
    'Thermionic, cold cathode or photocathode valves and tubes (for example, vacuum or vapour or gas filled valves and tubes, mercury arc rectifying valves and tubes, cathode ray tubes, television camera tubes)' => 'Comhlaí agus feadáin teirmianacha, catóide fuaire nó fótacatóide (mar shampla, comhlaí agus feadáin folúis nó gaile nó feadáin atá líonta le gás, comhlaí agus feadáin coigeartaithe stua-mhearcair, feadáin gha-chatóideacha, feadáin le haghaidh ceamaraí teilifíse)',
    'Semiconductor devices (for example, diodes, transistors, semiconductor-based transducers); photosensitive semiconductor devices, including photovoltaic cells whether or not assembled in modules or made up into panels; light-emitting diodes (LED), whether or not assembled with other light-emitting diodes (LED); mounted piezo-electric crystals' => 'Gairis leathsheoltóra (mar shampla, dé-óidí, trasraitheoirí, trasduchtóirí bunaithe ar leathsheoltóir); gairis leathsheoltóra fótamhothálacha, lena n-áirítear cealla fótavoltacha bídís cóimeáilte i módúil nó cóirithe ina bpainéil nó ná bídís; dé-óidí astaithe solais (LED), bídís cóimeáilte le dé-óidí astaíochta solais nó na bídís (LED); criostail phísileictreacha shuite',
    'Electronic integrated circuits' => 'Ciorcaid leictreonacha iomlánaithe',
    'Electrical machines and apparatus, having individual functions, not specified or included elsewhere in this chapter' => 'Meaisíní agus gléasra leictreonach a bhfuil feidhmeanna ar leith acu nach bhfuil sonraithe nó san áireamh in aon áit eile sa chaibidil seo',
    'Insulated (including enamelled or anodised) wire, cable (including coaxial cable) and other insulated electric conductors, whether or not fitted with connectors; optical fibre cables, made up of individually sheathed fibres, whether or not assembled with electric conductors or fitted with connectors' => 'Sreang (cruanta nó anóidithe san áireamh), cábla (lena n-áirítear cábla comh-aiseacha) inslithe agus seoltóirí leictreacha inslithe eile, bíodh nascóirí feistithe díobh nó ná bíodh; cáblaí snáithín optúil, déanta de shnáithíní i dtruaillí ar leith, bídís cóimeáilte le seoltóirí leictreacha nó feistithe le nascóirí nó ná bíodh',
    'Carbon electrodes, carbon brushes, lamp carbons, battery carbons and other articles of graphite or other carbon, with or without metal, of a kind used for electrical purposes' => 'Leictreoidí carbóin, scuaba carbóin, carbóin le haghaidh lampaí nó ceallraí agus earraí eile graifíte nó carbóin eile, le miotal nó gan é, de chineál a úsáidtear chun críocha leictreacha',
    'Electrical insulators of any material' => 'Inslitheoirí leictreacha atá déanta as aon ábhar',
    'Insulating fittings for electrical machines, appliances or equipment, being fittings wholly of insulating material apart from any minor components of metal (for example, threaded sockets) incorporated during moulding solely for purposes of assembly, other than insulators of heading 8546; electrical conduit tubing and joints therefor, of base metal lined with insulating material' => 'Feistis inslithe le haghaidh meaisíní leictreacha, fearais nó trealamh, ar feistis iad nach bhfuil iontu ach ábhar inslithe seachas aon mhion-chomhpháirt miotail (mar shampla, soicéid snáithithe) a cuireadh san áireamh le linn a mhúnlaithe chun críocha cóimeála amháin, seachas inslitheoirí atá faoi cheannteideal 8546; feadánra seolphíobáin leictreach agus ailt dóibh, de tháirmhiotal líneáilte le hábhar inslithe',
    'Electrical parts of machinery or apparatus, not specified or included elsewhere in this chapter' => 'Páirteanna leictreacha d’innealra nó de ghléasra, nach bhfuil sonraithe ná áirithe in aon áit eile sa Chaibidil seo',
    'Electrical and electronic waste and scrap' => 'Fuíoll agus drámh cealla príomhúla, ceallraí príomhúla agus taisc-cheallraí leictreacha',
    'Rail locomotives powered from an external source of electricity or by electric accumulators' => 'Innill fhéinghluaiste iarnróid a chumhachtaítear ó fhoinse sheachtrach leictreachais nó le taisc-chealla leictreacha',
    'Other rail locomotives; locomotive tenders' => 'Innill fhéinghluaiste iarnróid eile; gualcharranna',
    'Self-propelled railway or tramway coaches, vans and trucks, other than those of heading 8604' => 'Cóistí, veaineanna agus trucailí féinghluaiste iarnróid nó trambhealaigh, seachas iad siúd atá faoi cheannteideal 8604',
    'Railway or tramway goods vans and wagons, not self-propelled' => 'Veaineanna agus vaigíní iarnróid nó trambhealaigh le haghaidh iompar earraí, iad gan bheith féinghluaiste',
    'Parts of railway or tramway locomotives or rolling stock' => 'Páirteanna d’innill fhéinghluaiste iarnróid nó trambhealaigh nó de rothstoc',
    'Containers (including containers for the transport of fluids) specially designed and equipped for carriage by one or more modes of transport' => 'Coimeádáin (lena n-áirítear coimeádáin chun sreabháin a iompar) atá ceaptha agus feistithe go speisialta lena n-iompar ar mhodh iompair amháin nó níos mó',
    'Tractors (other than tractors of heading 8709)' => 'Tarracóirí (seachas tarracóirí atá faoi cheannteideal 8709)',
    'Motor vehicles for the transport of ten or more persons, including the driver' => 'Mótarfheithiclí chun deichniúr nó níos mó a iompar, an tiománaí san áireamh',
    'Motor cars and other motor vehicles principally designed for the transport of persons (other than those of heading 8702), including station wagons and racing cars' => 'Gluaisteáin agus mótarfheithiclí eile atá ceaptha go príomha chun daoine a iompar (seachas iad siúd atá faoi cheannteideal 8702), lena n-áirítear vaigíní stáisiúin agus carranna rásaíochta',
    'Motor vehicles for the transport of goods' => 'Mótarfheithiclí chun earraí a iompar',
    'Special purpose motor vehicles, other than those principally designed for the transport of persons or goods (for example, breakdown lorries, crane lorries, fire fighting vehicles, concrete-mixer lorries, road sweeper lorries, spraying lorries, mobile workshops, mobile radiological units)' => 'Mótarfheithiclí sainchuspóireacha, seachas iad siúd atá ceaptha go príomha chun daoine nó earraí a iompar (mar shampla, leoraithe deisithe, leoraithe craenach, feithiclí comhraicthe dóiteáin, leoraithe measctha coincréite, leoraithe scuabadóra bóthair, leoraithe spraeála, ceardlanna taistil, aonaid raideolaíocha taistil)',
    'Chassis fitted with engines, for the motor vehicles of headings 8701 to 8705' => 'Fonnaí a bhfuil inneall feistithe iontu, do na mótarfheithiclí atá faoi cheannteidil 8701 go 8705',
    'Bodies (including cabs), for the motor vehicles of headings 8701 to 8705' => 'Cabhlacha (lena n-áirítear cábáin), le haghaidh mótarfheithiclí atá faoi cheannteidil 8701 go 8705',
    'Parts and accessories of the motor vehicles of headings 8701 to 8705' => 'Páirteanna agus gabhálais de na mótarfheithiclí atá faoi cheannteidil 8701 go 8705',
    'Works trucks, self-propelled, not fitted with lifting or handling equipment, of the type used in factories, warehouses, dock areas or airports for short distance transport of goods; tractors of the type used on railway station platforms; parts of the foregoing vehicles' => 'Trucailí monarchan, de chineál féinghluaiste, nach bhfuil trealamh tógála nó láimhseála feistithe orthu, den chineál a úsáidtear i monarchana, trádstórais, limistéir duganna nó aerfoirt do ghearriompar earraí; tarracóirí den chineál a úsáidtear ar ardáin stáisiúin iarnróid; páirteanna de na feithiclí thuasluaite',
    'Motorcycles (including mopeds) and cycles fitted with an auxiliary motor, with or without side-cars; side-cars' => 'Gluaisrothair (lena n-áirítear móipéid) agus rothair a bhfuil mótar cúnta feistithe orthu, bíodh carranna cliathánacha orthu nó ná bíodh; carranna cliathánacha',
    'Bicycles and other cycles (including delivery tricycles), not motorised' => 'Rothair dhá roth agus rothair eile (lena n-áirítear trírothaigh), nach de chineál mótarthrealmhaithe iad',
    'Carriages for disabled persons, whether or not motorised or otherwise mechanically propelled' => 'Carráistí le haghaidh daoine faoi mhíchumas, bídís de chineál mótarthrealmhaithe nó de chineál innealltiomáinte ar bhealach eile nó ná bídís',
    'Parts and accessories of vehicles of headings 8711 to 8713' => 'Páirteanna agus gabhálais de na feithiclí atá faoi cheannteidil 8711 go 8713',
    'Baby carriages and parts thereof' => 'Naí-choistí agus páirteanna díobh',
    'Trailers and semi-trailers; other vehicles, not mechanically propelled; parts thereof' => 'Leantóirí agus leathleantóirí; feithiclí eile, nach feithiclí innealltiomáinte iad; páirteanna díobh',
    'Balloons and dirigibles; gliders, hang gliders and other non-powered aircraft' => 'Balúin agus balúin instiúrtha; faoileoirí, faoileoirí crochta agus aerárthaí neamhchumhachtaithe eile',
    'Other aircraft (for example, helicopters, aeroplanes), except unmanned aircraft of heading 8806; spacecraft (including satellites) and suborbital and spacecraft launch vehicles' => 'Aerárthaí eile (mar shampla, héileacaptair, eitleáin); seachas aerárthach gan foireann atá faoi cheannteideal 8806; spásárthaí (lena n-áirítear satailítí) agus feithiclí lainseála spásárthaí agus fofhithiseacha',
    'Aircraft launching gear; deck-arrestor or similar gear; ground flying trainers; parts of the foregoing articles' => 'Feisteas lainseála aeráthaigh; coscaire deisce nó trealamh comhchosúil; feistí oiliúna ionsamhalta eitilte; páirteanna de na hearraí thuasluaithe',
    'Unmanned aircraft' => 'Aerárthach gan foireann',
    'Parts of goods of heading 8801, 8802 or 8806' => 'Páirteanna d’earraí atá faoi cheannteideal 8801, 8802 nó 8806',
    'Cruise ships, excursion boats, ferry-boats, cargo ships, barges and similar vessels for the transport of persons or goods' => 'Longa cúrsála, báid turais, báid farantóireachta, longa lastais, báirsí agus soithí comhchosúla chun daoine nó earraí a iompar',
    'Fishing vessels; factory ships and other vessels for processing or preserving fishery products' => 'Soithí iascaireachta; longa monarchan agus soithí eile chun táirgí iascaigh a phróiseáil nó a leasú',
    'Yachts and other vessels for pleasure or sports; rowing boats and canoes' => 'Luaimh agus soithí eile le haghaidh áineasa nó spórt; báid iomraimh agus canúnna',
    'Tugs and pusher craft' => 'Tugaí agus brúshoithí',
    'Light-vessels, fire-floats, dredgers, floating cranes, and other vessels the navigability of which is subsidiary to their main function; floating docks; floating or submersible drilling or production platforms' => 'Soithí éadroma, raftaí dóiteáin, dreidirí, craenacha snámhacha agus soithí eile ar fofheidhm dá bpríomhfheidhm í a n-inseoltacht; duganna snámhacha; ardáin druileála nó táirgthe de chineál snámhach nó intumtha',
    'Other vessels, including warships and lifeboats other than rowing boats' => 'Soithí eile, lena n-áirítear longa cogaidh agus báid tarrthála seachas báid iomraimh',
    'Other floating structures (for example, rafts, tanks, coffer-dams, landing stages, buoys and beacons)' => 'Déanmhais snámhacha eile (mar shampla, raftaí, umair, cófradhambaí, lamairní, baoithe agus rabhcháin)',
    'Optical fibres and optical fibre bundles; optical fibre cables other than those of heading 8544; sheets and plates of polarising material; lenses (including contact lenses), prisms, mirrors and other optical elements, of any material, unmounted, other than such elements of glass not optically worked' => 'Snáithíní optúla agus bearta de shnáithíní optúla; cáblaí snáithíní optúla seachas iad sin atá faoi cheannteideal 8544; leatháin agus plátaí as ábhar polarúcháin; lionsaí (lena n-áirítear lionsaí tadhaill), priosmaí, scátháin agus eilimintí optúla eile, as aon ábhar, neamhfheistithe seachas eilimintí gloine den chineál sin nach ndearnadh oibriú optúil orthu',
    'Lenses, prisms, mirrors and other optical elements, of any material, mounted, being parts of or fittings for instruments or apparatus, other than such elements of glass not optically worked' => 'Lionsaí, priosmaí, scátháin agus eilimintí optúla eile, as aon ábhar, feistithe, atá ina bpáirteanna d\'uirlisí nó gairis nó atá ina bhfeistithe díobh, seachas eilimintí gloine den sórt sin nach ndearnadh oibriú optúil orthu',
    'Frames and mountings for spectacles, goggles or the like, and parts thereof' => 'Frámaí agus feistí do spéaclaí, spéaclaí cosanta nó a leithéidí agus páirteanna díobh',
    'Spectacles, goggles and the like, corrective, protective or other' => 'Spéaclaí, spéaclaí cosanta agus a leithéidí, spéaclaí ceartaitheacha, spéaclaí cosanta nó eile',
    'Binoculars, monoculars, other optical telescopes, and mountings therefor; other astronomical instruments and mountings therefor, but not including instruments for radio-astronomy' => 'Déshúiligh, leathshúiligh, teileascóip optúla eile agus feistí díobh; uirlisí réalteolaíochta eile agus feistí díobh, gan uirlisí radairéalteolaíochta san áireamh',
    'Photographic (other than cinematographic) cameras; photographic flashlight apparatus and flashbulbs other than discharge lamps of heading 8539' => 'Ceamaraí fótagrafacha (seachas ceamaraí cineamatagrafacha); gléasra splancsholais fótagrafach agus splancbholgáin seachas na lampaí díluchtaithe atá faoi cheannteideal 8539',
    'Cinematographic cameras and projectors, whether or not incorporating sound recording or reproducing apparatus' => 'Ceamaraí agus teilgeoirí cineamatagrafacha, bíodh gléasra taifeadta nó atáirgthe fuaime ina gcuid díobh nó ná bíodh',
    'Image projectors, other than cinematographic; photographic (other than cinematographic) enlargers and reducers' => 'Teilgeoirí íomhá seachas teilgeoirí cineamatagrafacha; méadaitheoirí agus laghdaitheoirí fótagrafacha; (seachas cinn chineamatagrafacha)',
    'Apparatus and equipment for photographic (including cinematographic) laboratories, not specified or included elsewhere in this chapter; negatoscopes; projection screens' => 'gléasra agus trealamh do shaotharlanna fótagrafacha (lena n-áirítear saotharlanna cineamatagrafacha) nach bhfuil sonraithe ná áirithe in áit eile sa chaibidil seo; scóip chlaonchló; scáileáin teilgthe',
    'Compound optical microscopes, including those for photomicrography, cinephotomicrography or microprojection' => 'Micreascóip optúla chomhshuite lena n-áirítear iad siúd le haghaidh cinea-fhótaimicreagrafaíochta nó micritheilgin',
    'Microscopes other than optical microscopes; diffraction apparatus' => 'Micreascóip seachas micreascóip optúla; gléasra díraonta',
    'Lasers, other than laser diodes; other optical appliances and instruments, not specified or included elsewhere in this chapter' => 'Léasair, seachas dé-óidí léasair; fearais agus uirlisí optúla eile nach bhfuil sonraithe ná áirithe in áit eile sa chaibidil seo',
    'Direction finding compasses; other navigational instruments and appliances' => 'Compáis threo-aimsithe; Ionstraimí agus fearais loingseoireachta eile',
    'Surveying (including photogrammetrical surveying), hydrographic, oceanographic, hydrological, meteorological or geophysical instruments and appliances, excluding compasses; rangefinders' => 'Suirbhéireacht (lena n-áirítear suirbhéireacht fhótaghram-mhéadrach), uirlisí agus fearais hidreagrafacha, aigéaneolaíocha, hidreolaíocha, mheitéareolaíocha nó gheoifisiceacha, gan compáis a áireamh; raonaimsitheoirí',
    'Balances of a sensitivity of 5 cg or better, with or without weights' => 'Meánna d’íogaireacht 5 cg nó níos fearr, bíodh tromáin iontu nó ná bíodh',
    'Drawing, marking-out or mathematical calculating instruments (for example, drafting machines, pantographs, protractors, drawing sets, slide rules, disc calculators); instruments for measuring length, for use in the hand (for example, measuring rods and tapes, micrometers, callipers), not specified or included elsewhere in this chapter' => 'Uirlisí líníochta, marcála amach nó ríofa mhatamaiticiúil (meaisíní líníochta, pantagraif, uillinntomhais, foirne líníochta, rialóirí sleamhnáin, áireamháin diosca, mar shampla); ionstraimí chun fad a thomhas, le húsáid de láimh (slata agus téipeanna tomhais, micriméadair, cailpéir, mar shampla), nach bhfuil sonraithe ná áirithe in aon áit eile sa Chaibidil seo',
    'Instruments and appliances used in medical, surgical, dental or veterinary sciences, including scintigraphic apparatus, other electromedical apparatus and sight-testing instruments' => 'Uirlisí agus fearais a úsáidtear sna heolaíochtaí míochaine, máinliachta, fiaclóireachta nó tréidliachta, lena n-áirítear gléasra drithleagrafaíochta, gléasra eile leictreomíochaine agus uirlisí radhairc',
    'Mechano-therapy appliances; massage apparatus; psychological aptitude-testing apparatus; ozone therapy, oxygen therapy, aerosol therapy, artificial respiration or other therapeutic respiration apparatus' => 'Fearais mheicnitheiripe; gléasra suathaireachta; gléasra trialach inniúlachta síceolaíche; gléasra le haghaidh teiripe ózóin, teiripe ocsaigine, teiripe aerasóil, gléasra riospráide saorga nó gléasra riospráide teiripí eile',
    'Other breathing appliances and gas masks, excluding protective masks having neither mechanical parts nor replaceable filters' => 'Fearais análaithe eile agus gásmhaisc, gan maisc chosanta nach bhfuil páirteanna meicniúla ná scagairí in-athsholáthraithe iontu a áireamh',
    'Orthopaedic appliances, including crutches, surgical belts and trusses; splints and other fracture appliances; artificial parts of the body; hearing aids and other appliances which are worn or carried, or implanted in the body, to compensate for a defect or disability' => 'Fearais ortaipéideacha, lena n-áirítear maidí croise, criosanna agus trusanna máinliachta; cléithíní agus fearais eile de chineál a úsáidtear i gcás cnámh bhriste; codanna saorga den chorp; áiseanna éisteachta agus fearais eile a chaitear nó a iompraítear nó atá ionphlandaithe sa chorp chun éalang nó mhíchumas a chúiteamh',
    'Apparatus based on the use of X-rays or of alpha, beta, gamma or other ionising radiation, whether or not for medical, surgical, dental or veterinary uses, including radiography or radiotherapy apparatus, X-ray tubes and other X-ray generators, high tension generators, control panels and desks, screens, examination or treatment tables, chairs and the like' => 'Gléasra atá bunaithe ar úsáid x-ghathanna nó radaíocht ianúcháin alfa, béite nó gáma, bídís le húsáid sna réimsí míochaine, máinliachta, fiaclóireachta nó tréidliachta nó ná bídís, lena n-áirítear gléasra radagrafaíochta nó gléasra radaiteiripe, feadáin x-ghathacha agus gineadóirí x-ghathanna eile, gineadóirí ardteannais, painéil rialúcháin agus deasca, scáileáin, boird agus cathaoireacha scrúdaithe nó cóireála agus a leithéidí',
    'Instruments, apparatus and models, designed for demonstrational purposes (for example, in education or exhibitions), unsuitable for other uses' => 'Uirlisí, gléasra agus mionsamhlacha, atá deartha chun críoch léirithe (i gcomhthéacs an oideachais nó taispeántas, mar shampla) nach bhfuil oiriúnach a úsáid i gcomhthéacsanna eile',
    'Machines and appliances for testing the hardness, strength, compressibility, elasticity or other mechanical properties of materials (for example, metals, wood, textiles, paper, plastics)' => 'Meaisíní agus fearais chun cruas, neart, in-chomhbhrúiteacht, leaisteachas nó saintréithe meicniúla eile ábhar a thástáil (miotail, adhmad, teicstílí, páipéar, plaistigh, mar shampla)',
    'Hydrometers and similar floating instruments, thermometers, pyrometers, barometers, hygrometers and psychrometers, recording or not, and any combination of these instruments' => 'Hidriméadair agus uirlisí comhchosúla a bhíonn ar snámh ar uisce, teirmiméadair, piriméadair, baraiméadair, taismhéadair agus sícriméadair, arb uirlisí iad is féidir nó nach féidir a úsáid le taifeadadh, agus aon mheascán de na huirlisí sin',
    'Instruments and apparatus for measuring or checking the flow, level, pressure or other variables of liquids or gases (for example, flow meters, level gauges, manometers, heat meters), excluding instruments and apparatus of heading 9014, 9015, 9028 or 9032' => 'Uirlisí agus gléasra chun sreabhadh, leibhéal, brú nó athróga eile leachtanna nó gás a thomhas nó a sheiceáil (sreabhmhéadair, tomhsairí leibhéil, manaiméadair, méadair teasa, mar shampla), gan na huirlisí agus na gléasra a áireamh atá faoi cheannteidil 9014, 9015, 9028 nó 9032',
    'Instruments and apparatus for physical or chemical analysis (for example, polarimeters, refractometers, spectrometers, gas or smoke analysis apparatus); instruments and apparatus for measuring or checking viscosity, porosity, expansion, surface tension or the like; instruments and apparatus for measuring or checking quantities of heat, sound or light (including exposure meters); microtomes' => 'Ionstraimí agus gléasra le haghaidh anailís fhisiceach nó cheimiceach (mar shampla, polaraiméadair, athraonmhéadair, speictriméadair, gléasra anailíse gáis nó deataigh); uirlisí agus gléasra chun slaodacht, póiriúlacht, méadú, teannas dromchla nó a leithéidí a thomhas nó a sheiceáil; uirlisí agus gléasra chun cainníochtaí teasa, fuaime nó solais a thomhas nó a sheiceáil (lena n-áirítear nochtmhéadair); micreatóim',
    'Gas, liquid or electricity supply or production meters, including calibrating meters therefor' => 'Méadar soláthair nó táirgeachta gáis, leachta nó leictreachais, lena n-áirítear méadair chalabraithe díobh',
    'Revolution counters, production counters, taximeters, milometers, pedometers and the like; speed indicators and tachometers, other than those of heading 9014 or 9015; stroboscopes' => 'Áiritheoirí imrothluithe, áiritheoirí táirgeachta, tacsaiméadair, odaiméadair, peidiméadair agus a leithéidí; luasmhéadair agus tacaiméadair, seachas na cinn atá faoi cheannteideal 9014 nó 9015; stróbascóip',
    'Oscilloscopes, spectrum analysers and other instruments and apparatus for measuring or checking electrical quantities, excluding meters of heading 9028; instruments and apparatus for measuring or detecting alpha, beta, gamma, X-ray, cosmic or other ionising radiation' => 'Ascalascóip, anailíseoirí speictrim agus ionstraimí agus gléasra eile chun cainníochtaí leictreachais a thomhas nó a sheiceáil, gan na méadair faoi cheannteideal 9028; uirlisí agus gléasra chun radaíocht ianúcháin alfa, béite, gáma, X-ghathach, chosmach nó radaíocht ianúcháin eile a thomhas nó a bhrath',
    'Measuring or checking instruments, appliances and machines, not specified or included elsewhere in this chapter; profile projectors' => 'Ionstraimí, fearais nó meaisíní tomhais nó seiceála nach bhfuil sonraithe ná áirithe in áit eile sa Chaibidil seo; teilgeoirí próifíle',
    'Automatic regulating or controlling instruments and apparatus' => 'Uirlisí uathoibríocha agus gairis uathoibríocha rialála nó rialaithe',
    'Parts and accessories (not specified or included elsewhere in this chapter) for machines, appliances, instruments or apparatus of Chapter 90' => 'Páirteanna agus gabhálais (nach bhfuil sonraithe ná áirithe in áit eile sa chaibidil seo) do mheaisíní, fearais, uirlisí nó gairis atá faoi Chaibidil 90',
    'Wristwatches, pocket-watches and other watches, including stopwatches, with case of precious metal or of metal clad with precious metal' => 'Uaireadóirí láimhe, uaireadóirí póca agus uaireadóirí eile, lena n-áirítear stopuaireadóirí, a bhfuil cás miotail lómhair ag gabháil leo nó cás miotail atá cumhdaithe le miotal lómhar',
    'Wristwatches, pocket-watches and other watches, including stopwatches, other than those of heading 9101' => 'Uaireadóirí láimhe, uaireadóirí póca agus uaireadóirí eile, lena n-áirítear stopuaireadóirí, seachas iad siúd atá faoi cheannteideal 9101',
    'Clocks with watch movements, excluding clocks of heading 9104' => 'Cloig ina bhfuil oibreacha uaireadóra, gan na cloig atá faoi cheannteideal 9104',
    'Other clocks' => 'Cloig eile',
    'Time of day recording apparatus and apparatus for measuring, recording or otherwise indicating intervals of time, with clock or watch movement or with synchronous motor (for example, time-registers, time-recorders)' => 'Gairis lenar féidir am an lae a thaifeadadh agus gairis chun eatraimh ama a thomhas, a thaifeadadh nó a chur in iúl le hoibreacha cloig nó uaireadóra nó le mótar sioncrónach (am-thaifeadáin, uaineadóirí mar shampla)',
    'Watch movements, complete and assembled' => 'Oibreacha uaireadóra, iad iomlán agus cóimeáilte',
    'Clock movements, complete and assembled' => 'Oibreacha cloig, iad iomlán agus cóimeáilte',
    'Complete watch or clock movements, unassembled or partly assembled (movement sets); incomplete watch or clock movements, assembled; rough watch or clock movements' => 'Oibreacha iomlána uaireadóra nó cloig, iad neamhchóimeáilte nó cóimeáilte go páirteach (tacair oibreacha); oibreacha neamhiomlána uaireadóra nó cloig, iad cóimeáilte; oibreacha garbha uaireadóra nó cloig',
    'Watch cases and parts thereof' => 'Cásanna uaireadóirí agus páirteanna díobh',
    'Clock cases and cases of a similar type for other goods of this chapter, and parts thereof' => 'Cásanna clog agus cásanna den chineál céanna le haghaidh earraí eile sa Chaibidil seo, agus páirteanna díobh',
    'Watch straps, watch bands and watch bracelets, and parts thereof' => 'Strapaí uaireadóirí, bandaí agus bráisléid uaireadóirí agus páirteanna díobh',
    'Other clock or watch parts' => 'Páirteanna eile cloig nó uaireadóra',
    'Pianos, including automatic pianos; harpsichords and other keyboard stringed instruments' => 'Pianónna, lena n-áirítear pianónna uathoibríocha; cruitchláir agus téaduirlisí méarchláir eile',
    'Other string musical instruments (for example, guitars, violins, harps)' => 'Téaduirlisí ceoil eile (giotáir, veidhlíní, cláirseacha, mar shampla)',
    'Wind musical instruments (for example, keyboard pipe organs, accordions, clarinets, trumpets, bagpipes), other than fairground organs and mechanical street organs' => 'Gaothuirlisí ceoil (píborgáin mhéarchláir, boscaí ceoil, clairinéid, trumpaí, an phíb mhála, mar shampla), seachas orgáin faiche aonaigh agus orgáin sráide mheicniúla',
    'Musical instruments, the sound of which is produced, or must be amplified, electrically (for example, organs, guitars, accordions)' => 'Uirlisí ceoil a ndéantar a bhfuaim go leictreach nó nach mór a aimpliú go leictreach (mar shampla orgáin, giotáir, boscaí ceoil)',
    'Musical boxes, fairground organs, mechanical street organs, mechanical singing birds, musical saws and other musical instruments not falling within any other heading of this chapter; decoy calls of all kinds; whistles, call horns and other mouth-blown sound signalling instruments' => 'Ceolbhoscaí, orgáin faiche aonaigh, orgáin sráide mheicniúla, éin cheoil mheicniúla, sábha ceoil agus uirlisí ceoil eile nach dtagann faoi aon cheannteideal eile den chaibidil seo; glaonna cluana de gach cineál; feadóga, glao-choirn agus uirlisí fuaimchomharthaíochta béil eile',
    'Parts (for example, mechanisms for musical boxes) and accessories (for example, cards, discs and rolls for mechanical instruments) of musical instruments; metronomes, tuning forks and pitch pipes of all kinds' => 'Páirteanna (meicníochtaí do cheolbhoscaí, mar shampla) agus gabhálais (cártaí, dioscaí agus rolláin d’uirlísí meicniúla, mar shampla) d’uirlisí ceoil; méadranóim, gabhlóga tiúnála agus feadóga airde de gach cineál',
    'Military weapons, other than revolvers, pistols and the arms of heading 9307' => 'Airm mhíleata, seachas gunnáin, piostail agus na hairm atá faoi cheannteideal 9307',
    'Other firearms and similar devices which operate by the firing of an explosive charge (for example, sporting shotguns and rifles, muzzle-loading firearms, Very pistols and other devices designed to project only signal flares, pistols and revolvers for firing blank ammunition, captive-bolt humane killers, line-throwing guns)' => 'Airm tine eile agus gairis chomhchosúla a oibríonn trí lánán pléascach a chaitheamh (gránghunnaí agus raidhfilí seilge, airm tine bhéal-lódáilte, piostail Very agus gairis eile atá deartha chun tóirsí foláirimh agus gan ach tóirsí foláirimh a chaitheamh, piostail agus gunnáin chun lón lámhaigh gan urchar a chaitheamh, stiúdghunnaí daonnachtúla, gunnaí caite línte, mar shampla)',
    'Parts and accessories of articles of headings 9301 to 9304' => 'Páirteanna agus gabhálais na n-earraí atá faoi cheannteidil 9301 go 9304',
    'Bombs, grenades, torpedoes, mines, missiles and similar munitions of war and parts thereof; cartridges and other ammunition and projectiles and parts thereof, including shot and cartridge wads' => 'Buamaí, gránáidí, toirpéid, mianaigh, diúracáin agus muinisin chogaidh chomhchosúla agus páirteanna díobh; cartúis agus armlón eile agus teilgeáin eile agus páirteanna díobh, lena n-áirítear ascart le haghaidh gránghunnaí agus cartús',
    'Seats (other than those of heading 9402), whether or not convertible into beds, and parts thereof' => 'Suíocháin (seachas iad siúd atá faoi cheannteideal 9402), cibé is féidir iad a thiontú go leapacha nó nach féidir, agus páirteanna díobh',
    'Medical, surgical, dental or veterinary furniture (for example, operating tables, examination tables, hospital beds with mechanical fittings, dentists\' chairs); barbers\' chairs and similar chairs, having rotating as well as both reclining and elevating movements; parts of the foregoing articles' => 'Troscán míochaine, máinliachta, fiaclóireachta nó tréidliachta (boird obráide, boird scrúdúcháin, leapacha ospidéil ar a bhfuil feistis mheicniúla, suíocháin fiaclóirí, mar shampla); suíocháin bearbóirí agus suíocháin chomhchosúla ag a bhfuil gluaiseachtaí rothlacha chomh maith le gluaiseachta insínte agus ardaithe; páirteanna de na hearraí thuasluaite',
    'Other furniture and parts thereof' => 'Troscán eile agus páirteanna díobh',
    'Mattress supports; articles of bedding and similar furnishing (for example, mattresses, quilts, eiderdowns, cushions, pouffes and pillows) fitted with springs or stuffed or internally fitted with any material or of cellular rubber or plastics, whether or not covered' => 'Tacaí tochta; cóir leapa agus troscán agus fearastú comhchosúil (mar shampla, tochtanna, cuilteanna, éadarchlúmh, cúisíní, súisteoga agus piliúir), feistithe le lingeáin nó líonta nó feistithe go hinmheánach le haon chineál ábhair nó atá déanta as rubar ceallach nó as plaistigh, bídís cumhdaithe nó ná bídís',
    'Luminaires and lighting fittings including searchlights and spotlights and parts thereof, not elsewhere specified or included; illuminated signs, illuminated nameplates and the like, having a permanently fixed light source, and parts thereof not elsewhere specified or included' => 'Soilse agus feistis soilsithe lena n-áirítear soilse cuardaigh agus spotsoilse agus páirteanna díobh, nach bhfuil sonraithe ná áirithe in áit eile; comharthaí soilsithe, ainmchláir shoilsithe agus a leithéidí, lena bhfuil foinse soilse suite go buan, agus páirteanna díobh nach bhfuil sonraithe ná áirithe in áit eile',
    'Prefabricated buildings' => 'Foirgnimh réamhdhéanta',
    'Tricycles, scooters, pedal cars and similar wheeled toys; dolls\' carriages; dolls; other toys; reduced-size (scale) models and similar recreational models, working or not; puzzles of all kinds' => 'Trírothaigh, scútair, mótair throitheáin agus bréagáin rothaí chomhchosúla; carráistí bábóg; bábóga; bréagáin eile; mionsamhlacha laghdaithe (de réir scála) agus mionsamhlacha áineasa comhchosúla, bídís ag oibriú nó ná bídís; puzail de gach cineál',
    'Video game consoles and machines, table or parlour games, including pintables, billiards, special tables for casino games and automatic bowling equipment, amusement machines operated by coins, banknotes, bank cards, tokens or by any other means of payment' => 'Consóil agus meaisíní físchluichí, cluichí boird nó parlúis lena n-áirítear boird pionnaí, billéardaí, boird speisialta le haghaidh cluichí casino agus trealamh bollaí uathoibríoch, meaisíní siamsaíochta a oibríonn le boinn, nótaí bainc, cártaí bainc, dearbháin nó aon mhodh íocaíochta eile',
    'Festive, carnival or other entertainment articles, including conjuring tricks and novelty jokes' => 'Earraí féile, carnabhail nó siamsaíochta eile, lena n-áirítear cleasanna draíodóireachta agus cleasanna iontais',
    'Articles and equipment for general physical exercise, gymnastics, athletics, other sports (including table tennis) or outdoor games, not specified or included elsewhere in this chapter; swimming pools and paddling pools' => 'Earraí agus trealamh le haghaidh aclaíocht fhisiciúil ghinearálta, gleacaíochta, lúthchleasaíochta, spóirt eile (lena n-áirítear leadóg bhoird) nó cluichí taobh amuigh nach bhfuil sonraithe ná áirithe sa chaibidil seo; linnte snámha agus linnte lapadaíola',
    'Fishing rods, fish-hooks and other line fishing tackle; fish landing nets, butterfly nets and similar nets; decoy birds (other than those of heading 9208 or 9705) and similar hunting or shooting requisites' => 'Slata iascaireachta, duáin agus tácla iascaireachta eile; bradóga éisc, líontáin féileacáin agus líontáin chomhchosúla; \'éin\' chluana (seachas iad siúd atá faoi cheannteideal 9208 nó 9705) agus earraí riachtanais seilge nó lámhaigh comhchosúla',
    'Travelling circuses and travelling menageries; amusement park rides and water park amusements; fairground amusements, including shooting galleries; travelling theatres' => 'Sorcais taistil agus sorcais ainmhithe taistil; trealamh marcaíochta le haghaidh páirceanna siamsaíochta agus trealamh siamsaíochta le haghaidh páirceanna uisce; trealamh siamsa faiche aonaigh lena n-áirítear gailearaithe lámhaigh; amharclanna taistil',
    'Worked ivory, bone, tortoiseshell, horn, antlers, coral, mother-of-pearl and other animal carving material, and articles of these materials (including articles obtained by moulding)' => 'Eabhar oibrithe, cnámh, blaosc toirtísí, adharc, beanna, coiréal, néamhann agus ábhar snoíodóireachta ainmhíoch eile agus earraí atá déanta as na hábhair sin (lena n-áirítear earraí a fhaightear trí mhúnláil)',
    'Brooms, brushes (including brushes constituting parts of machines, appliances or vehicles), hand-operated mechanical floor sweepers, not motorised, mops and feather dusters; prepared knots and tufts for broom or brush making; paint pads and rollers; squeegees (other than roller squeegees)' => 'Scuaba, scuaba urláir (lena n-áirítear scuaba a bhfuil páirteanna d\'innill, fearais nó feithiclí mar chuid díobh) lámhscuabóirí meicniúla urláir nach bhfuil inneall iontu, mapaí agus cleití dustála; snaidhmeanna agus cnapáin ullmhaithe chun scuaba agus scuaba urláir a dhéanamh; pillíní péinte agus rollóirí; cuimleoirí (seachas cuimleoirí rollóra)',
    'Buttons, press-fasteners, snap-fasteners and press studs, button moulds and other parts of these articles; button blanks' => 'Cnaipí, brúfháiscíní, smeachdhúntóirí agus brústodaí, múnlaí cnaipe agus páirteanna eile de na hearraí sin; bánáin chnaipe',
    'Slide fasteners and parts thereof' => 'Fáiscíní sleamhnáin agus páirteanna díobh',
    'Ballpoint pens; felt-tipped and other porous-tipped pens and markers; fountain pens, stylograph pens and other pens; duplicating stylos; propelling or sliding pencils; pen-holders, pencil-holders and similar holders; parts (including caps and clips) of the foregoing articles, other than those of heading 9609' => 'Pinn ghránbhioracha; pinn agus marcóirí feiltbhioracha agus pinn agus marcóirí eile a bhfuil bioranna póiriúla orthu; pinn tobair, pinn stíleagraif agus pinn eile; pinn stíleagraif dúblála; pinn luaidhe tochrais nó sleamhnáin; cróite peann, cróite pionsailí agus cróite comhchosúla; páirteanna (lena n-áirítear caipíní agus fáiscíní) de na hearraí thuasluaite, seachas iad siúd atá faoi cheannteideal 9609',
    'Pencils (other than pencils of heading 9608), crayons, pencil leads, pastels, drawing charcoals, writing or drawing chalks and tailors\' chalks' => 'Pionsail (seachas pionsail atá faoi cheannteideal 9608 criáin, luaidheanna pionsail, pastail, gualach líníochta, cailceanna líníochta nó scríbhneoireachta agus cailceanna táilliúra',
    'Typewriter or similar ribbons, inked or otherwise prepared for giving impressions, whether or not on spools or in cartridges; ink-pads, whether or not inked, with or without boxes' => 'Ribíní clóscríobháin nó ribíní comhchosúla ina bhfuil dúch nó atá ullmhaithe ar shlí eile chun brúnna a dhéanamh, bídís ar spóil nó i gcartúis nó ná bídís; pillíní dúigh, bíodh dúch iontu nó ná bíodh, le boscaí nó gan iad',
    'Cigarette lighters and other lighters, whether or not mechanical or electrical, and parts thereof other than flints and wicks' => 'Lastóirí toitíní agus lastóirí eile bídís meicniúil nó leictreach nó ná bídís, agus páirteanna díobh seachas breochlocha nó sloiteanna',
    'Smoking pipes (including pipe bowls) and cigar or cigarette holders, and parts thereof' => 'Píopaí tobac (lena n-áirítear babhlaí) agus coimeádáin toitíní nó todóige, agus páirteanna díobh',
