    'Scent sprays and similar toilet sprays, and mounts and heads therefor; powder-puffs and pads for the application of cosmetics or toilet preparations' => 'Spraeanna bolaidh agus spraeanna maisiúcháin comhchosúla, agus feistí agus bairr díobh; clúimhíní púdair agus pillíní chun cosmaidí nó ullmhúcháin mhaisíochta a úsáid',
    'Sanitary towels (pads) and tampons, napkins (diapers), napkin liners and similar articles, of any material' => 'Pillíní sláintíocha (pillíní) agus súitíní, naipcíní (clúidíní), líneálacha naipcín, agus earraí comhchosúla, as aon ábhar',
