    'Original engravings, prints and lithographs' => 'Greanadh, priontaí agus liteagraif bhunaidh',
    'Original sculpture and statuary, in any material' => 'Dealbhóireacht nó dealbh bhunaidh, in aon ábhar',
    'Collections and collectors’ pieces of archaeological, ethnographic, historical, zoological, botanical, mineralogical, anatomical, paleontological or numismatic interest' => 'Bailiúcháin agus earraí bailitheora ar díol spéise iad ó thaobh na seandálaíochta, na heitneagrafaíochta, na staire, na zó-eolaíochta, na luibheolaíochta, eolaíocht na mianraí, na hanatamaíochta, na pailé-eolaíochta, nó na moneolaíochta de',
